(77, 1, 'Dals &amp; Pulses', '&lt;p&gt;Pulses are enriched with fibres, proteins and fats. They are very beneficial for health. It is very healthy if one includes the pulses in his/her regular/daily diet&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;. It helps in improving the immune system. Dals and pulse also known as legumes are rich source of proteins, fiber,carbohydrates and folate.&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;They maintains blood cholesterol and &amp;nbsp;lower the risk of diabetes. Pulses are beneficial for vegetarians as they are rich in proteins.&lt;/span&gt;&lt;/p&gt;', 'Dals &amp; Pulses', '', ''),
(77, 3, 'Dals y legumbres', '&lt;p style=&quot;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Los pulsos están enriquecidos con fibras, proteínas y grasas. Ellos son muy beneficiosos para la salud. Es muy saludable si se incluye a los pulsos en su / su dieta regular / día. Ayuda a mejorar el sistema inmunológico. Dals y el pulso también conocidas como las legumbres son fuente rica de proteínas, fibra, carbohidratos y folate.They mantiene el colesterol en sangre y reducir el riesgo de diabetes. Las legumbres son beneficiosos para los vegetarianos, ya que son ricos en proteínas.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Dals y legumbres', '', ''),
(77, 4, 'دالس والبقول', '&lt;p style=&quot;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;يتم إثراء البقول مع الألياف والبروتينات والدهون. فهي مفيدة جدا للصحة. وهو امر صحي جدا إذا كان أحد تشمل البقول في له / لها منتظم حمية / يوميا. كما أنه يساعد في تحسين الجهاز المناعي. دالس ونبض المعروف أيضا باسم البقول هي مصدر غني للبروتينات والألياف والكربوهيدرات ويحافظ على folate.They الكوليسترول في الدم وتقلل من خطر الإصابة بمرض السكري. البقول هي مفيدة للنباتيين كما أنها غنية في البروتينات.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'دالس والبقول', '', ''),
