(114, 3, 'productos lácteos', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Los productos lácteos son los productos que se producen a partir de leche. Los productos lácteos incluyen queso, la leche, el yogur. Tiene gran cantidad de calcio que beneficioso para productos health..Dairy humanos incluye el queso, la leche, el yogurt. Tiene gran cantidad de calcio que beneficioso para health.Benefits humanos de los productos lácteos son que reduce el riesgo de enfermedades del corazón, diabetes, cáncer y obesidad. Se mantiene la presión arterial y el peso. Algunos productos lácteos son bajos en grasas cuya ingesta es esencial. La leche contiene alta cantidad de agua que mantiene nuestro cuerpo hidratado.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'productos lácteos', '', ''),
(73, 4, 'سبزیاں', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;سبزیاں جس کی وجہ سے غذا کے طور پر انسانوں کی طرف سے استعمال کیا جاتا ہے روزمرہ استعمال ہوتے ہیں. وہ خام کھایا یا پکا کر سکتے ہیں. سبزیاں انسانی جسم کو غذائیت فراہم کرتا ہے اور healthy.Originally ان رکھتا ہے جس کے ریشوں، معدنیات اور وٹامن میں چربی اور کاربوہائیڈریٹ لیکن امیر میں کم ہیں، سبزیاں زیادہ تر، شکاری &amp;nbsp;کی طرف سے جنگلی طرف سے آیا اور کے کئی حصوں میں کاشت کے طور پر داخل کے طور پر آب و ہوا &amp;nbsp;پانی اور ریشہ ایک صحت مند جسم کے لیے بہت ضروری ہے جس میں چکنائی اور کیلوری میں کم ہے لیکن امیر ہیں تمام سبزیاں دنیا بھر میں بڑی ہو گئی ہیں. انہوں نے ہماری قوت مدافعت کے نظام کو مضبوط رکھنے میں مدد ملتی ہے.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'سبزیاں', '', ''),
