(253, 1, 'Fresh Fruits', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Fruits are nature’s wonderful gift to the mankind. They are life-enhancing medicines packed with vitamins, minerals, anti-oxidants and many nutrients. They are an absolute feast to our sight, not just because of their color and flavor but for their nutrition that helps human body free from diseases and helps in making human body healthier and active.when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum. To remain healthy , fit and fine one should include the fruits to his/her daily diet.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Fresh Fruits', '', ''),
