(185, 1, 'Home Care &amp; Utilities', '&lt;p&gt;These products are used in our daily life . &amp;nbsp;These products helps to manage all household chores.A disinfectant house leads to a healthy life so it is important to use a cleaning agent. These products are used in our daily life routine &amp;nbsp;. &amp;nbsp;These products helps to manage all household chores. Safer products can be used to keep floors germs free.&lt;/p&gt;', 'Home Care &amp; Utilities', '', ''),
(185, 3, 'Casa y Utilidades', '&lt;p&gt;Estos productos se utilizan en nuestra vida diaria. Estos productos ayudan a gestionar todos los hogares chores.A casa desinfectante conduce a una vida saludable por lo que es importante utilizar un producto de limpieza. Estos productos se utilizan en nuestra rutina vida diaria. Estos productos ayudan a gestionar todas las tareas del hogar. productos más seguros se pueden utilizar para mantener los pisos libres de gérmenes.&lt;br&gt;&lt;/p&gt;', 'Casa y Utilidades', '', ''),
(185, 4, 'الرعاية المنزلية والمرافق', '&lt;p&gt;وتستخدم هذه المنتجات في حياتنا اليومية. هذه المنتجات تساعد على إدارة جميع الأسر chores.A منزل مطهر يؤدي إلى حياة صحية ولذلك فمن المهم استخدام عامل تنظيف. وتستخدم هذه المنتجات في موقعنا على روتين الحياة اليومية. هذه المنتجات تساعد على إدارة جميع الأعمال المنزلية. منتجات أكثر أمانا يمكن استخدامها للحفاظ على الأرضيات الجراثيم مجانا.&lt;br&gt;&lt;/p&gt;', 'الرعاية المنزلية والمرافق', '', ''),
