(76, 1, 'Dry Fruits', 'Dry fruits are enriched with proteins, fibres , vitamins and minerals. They have been dried either naturally or artificially. They can be preserved for a long time.Dry Fruits exists in many types i.e. Raisins, Almonds, nuts and many more.Highly rich in proteins, fibre, carbohydrates and omega 3 which helps in creating new blood cells. It reduces the risk of cancer and keeps heart healthy . Maintains blood sugar level and cholesterol.&lt;p&gt;&lt;/p&gt;', 'Dry Fruits', '', ''),
(76, 3, 'Frutas secas', '&lt;p style=&quot;box-sizing: border-box; -webkit-appearance: none; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; vertical-align: baseline; orphans: auto; text-align: start; text-indent: 0px; widows: 1; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Los frutos secos son enriquecidos con proteínas, fibras, vitaminas y minerales. Ellos se han secado ya sea naturalmente o artificialmente. Ellos se pueden conservar durante un largo Frutas time.Dry existe en muchos tipos es decir, pasas, almendras, nueces y muchos more.Highly ricos en proteínas, fibra, carbohidratos y ácidos grasos omega 3 que ayuda en la creación de nuevas células sanguíneas. Reduce el riesgo de cáncer y mantiene corazón sano. Mantiene el nivel de azúcar en la sangre y el colesterol.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', 'Frutas secas', '', ''),
(76, 4, 'فواكه مجففة', '&lt;p style=&quot;box-sizing: border-box; -webkit-appearance: none; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; vertical-align: baseline; orphans: auto; text-align: start; text-indent: 0px; widows: 1; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;يتم إثراء الفواكه الجافة مع البروتينات والألياف والفيتامينات والمعادن. تم تجفف إما طبيعيا أو صناعيا. ويمكن الحفاظ عليها لفترة طويلة الفواكه time.Dry موجود في العديد من أنواع أي الزبيب واللوز والجوز وكثير الغنية more.Highly في البروتينات، والألياف، والكربوهيدرات وأوميغا 3 والتي تساعد في خلق خلايا الدم الجديدة. فهو يقلل من خطر الإصابة بالسرطان وتحافظ على صحة القلب. يحافظ على مستوى السكر في الدم والكوليسترول.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'فواكه مجففة', '', ''),
(82, 1, 'Rice &amp; Rice Products', 'Rice is considered as staple food. There are various health benefits of rice. It can be considered as natural medicine. It has the ability to provide fast and instant energy. It boosts the energy , improves immune system and prevents from many diseases.&amp;nbsp;It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of usingis that it has a more-or-less normal distribution of letters, as opposed to using . It is cholesterol free, prevents from high blood pressure and enriched with vitamins.&lt;p&gt;&lt;/p&gt;', 'Rice &amp; Rice Products', '', ''),
(82, 3, 'Rice &amp; Rice Products', '&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Rice is considered as staple food. There are various health benefits of rice. It can be considered as natural medicine. It has the ability to provide fast and instant energy. It boosts the energy , improves immune system and prevents from many diseases.&amp;nbsp;It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of usingis that it has a more-or-less normal distribution of letters, as opposed to using . It is cholesterol free, prevents from high blood pressure and enriched with vitamins.&lt;/span&gt;&lt;p&gt;&lt;/p&gt;', 'Rice &amp; Rice Products', '', ''),
(82, 4, 'Rice &amp; Rice Products', '&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Rice is considered as staple food. There are various health benefits of rice. It can be considered as natural medicine. It has the ability to provide fast and instant energy. It boosts the energy , improves immune system and prevents from many diseases.&amp;nbsp;It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of usingis that it has a more-or-less normal distribution of letters, as opposed to using . It is cholesterol free, prevents from high blood pressure and enriched with vitamins.&lt;/span&gt;&lt;p&gt;&lt;/p&gt;', 'Rice &amp; Rice Products', '', ''),
(78, 4, 'زيوت طعام والسمن', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;وهناك أنواع عديدة من الزيوت الصالحة للأكل والسمن الذي يستخدم لأغراض الطهي. إضافتها إلى الطعام يزيد من طعم ورائحة ونكهة الغذاء المخصب ومع الدهون، والمعادن، &amp;nbsp;شاحنة الغذاء مؤهلاته، الذئب الإرث. التاكو الأخلاقية التأمل هيلا غودار تعطيل. كورنهولي الفيروسية هيلا &amp;nbsp;تيلدا فاني صور شخصية حزمة fixie. غير متناظرة حزب الفن 8 بت. الزيوت هي مصدر غني للطاقة والسعرات الحرارية وfats.It يضيف نسيج إلى الأطباق.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'زيوت طعام والسمن', '', ''),
(78, 3, 'Los aceites comestibles y Ghee', '&lt;p&gt;Hay muchos tipos de aceites y manteca comestibles que se utiliza para cocinar. Añadiéndolos a la comida aumenta el sabor, el aroma y el sabor de los alimentos que se enriquece con las grasas, minerales, chicharrones vitamins.Cronut de 90 camiones de comida CRED, herencia de lobo. tacos éticos meditación hella Godard interrumpen. Cornhole viral hella mumblecore, tilde trasero autofotos paquete fixie. Poutine neutra asimétrica del partido del arte de 8 bits. Los aceites son la fuente rica en energía, calorías y fats.It añade textura a los platos.&lt;/p&gt;', 'Los aceites comestibles y Ghee', '', ''),
(78, 1, 'Edible Oils &amp; Ghee', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;There are many types of edible oils and ghee which is used for cooking. Adding them to the food increases the taste, aroma and flavour of food It is Enriched with fats, minerals , vitamins.Cronut chicharrones 90\'s food truck cred, wolf heirloom. Ethical tacos meditation hella godard disrupt. Cornhole mumblecore hella viral, tilde fanny pack selfies fixie. Poutine neutra asymmetrical 8-bit art party.&amp;nbsp;Oils are the rich source of energy, calories and fats.It adds texture to the dishes.&lt;/span&gt;&lt;/p&gt;', 'Edible Oils &amp; Ghee', '', ''),
(127, 4, 'مشروبات الطاقة', '&lt;p style=&quot;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;يمكن أن مشروبات الطاقة يكون مفيدا عندما يقوم شخص ما هو تحت دورة تدريبية أو تستعد لبعض الملل الصلصال أربعة لوكو أربعة الدولار نخب جان السراويل سلالم. رجل كعكة &amp;nbsp;بلوق فون المعصورة على البارد رسول حقيبة الكنيسة الرئيسية، باليو لحم الخنزير بطن الأزياء الفأس. أنها تساعد في تنشيط عندما كنت تشعر &amp;nbsp;هو المشروبات غير الكحولية الغنية بالسعرات الحرارية التي تعزز مستوى الطاقة. يحسن الدورة الدموية. أنه يحتوي على الكافيين الذي يعمل بمثابة منبه للجهاز العصبي لدينا.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'مشروبات الطاقة', '', ''),
(127, 1, 'Energy Drinks ', '&lt;p&gt;Energy drinks can be useful when someone is &amp;nbsp;under training session or preparing for some sessionals . Ennui pug four loko four dollar toast jean shorts ramps. Man bun cronut blog iPhone cold-pressed messenger bag church-key, paleo pork belly fashion axe. They helps in energizing when you feel low.It is a non alcoholic beverage rich in calories which boost the energy level . &amp;nbsp;Improves the blood circulation. It contains caffeine which acts as a stimulant for our nervous system.&amp;nbsp;&lt;/p&gt;', 'Energy Drinks &amp; Mineral Water', '', ''),
(127, 3, 'bebidas energizantes', '&lt;p style=&quot;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Las bebidas energéticas pueden ser útiles cuando alguien está bajo la sesión de entrenamiento o preparación para algunos sessionals. Hastío barro amasado cuatro loko cuatro dólares tostadas pantalones cortos de jean rampas. Hombre bollo CRONUT iPhone iglesia blog-clave bolsa de mensajero de prensado en frío, paleo hacha de la moda del vientre de cerdo. Ellos ayudan en energizante cuando se sienta low.It es una bebida no alcohólica rica en calorías que potencian el nivel de energía. Mejora la circulación de la sangre. Contiene cafeína que actúa como un estimulante para el sistema nervioso.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Las bebidas energéticas y agua mineral', '', ''),
