(61, 4, 'فواكه وخضروات', '&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;الفواكه والخضروات هي هدية رائعة من الطبيعة للبشرية. في الواقع، فهي الأدوية التي تعزز الحياة محملة الفيتامينات والمعادن ومضادات الأكسدة والعديد من المغذيات النباتية. وهي تشكل وليمة المطلق في الأفق لدينا، ليس فقط بسبب لون بشرتهم ونكهة ولكن لفريد التغذية ملفهم الشخصي التي تساعد جسم الإنسان خالية من الأمراض والحفاظ عليه healthy.They هي غنية في الماء والألياف والفيتامينات والمعادن والبوتاسيوم. تقليل مخاطر الإصابة بأمراض القلب والأوعية الدموية. الفواكه والخضروات ضرورية لصحة الجسم.&lt;/span&gt;&lt;br&gt;', 'فواكه وخضروات', '', ''),
(61, 1, 'FRUITS &amp; VEGETABLES', '&lt;p&gt;Fruits and vegetables are wonderful gift of nature to mankind; indeed, they are life-enhancing medicines packed with vitamins, minerals, anti-oxidants and many phytonutrients. They are an absolute feast to our sight, not just because of their color and flavor but for their unique nutrition-profile that help human body free from diseases and keep it healthy.They are rich in water, fiber, vitamins, minerals and potassium. Reduce risk of cardiovascular &amp;nbsp;diseases. Fruits and vegetables are essential for healthy body.&lt;/p&gt;&lt;div&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;', 'FRUITS &amp; VEGETABLES', '', ''),
(61, 3, 'frutas y vegetales', '&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Las frutas y verduras son una maravilla regalo de la naturaleza a la humanidad; de hecho, son medicamentos que mejoran la vida y llenos de vitaminas, minerales, antioxidantes y fitonutrientes muchos. Son una fiesta absoluta a nuestra vista, no sólo debido a su color y sabor, sino por su única nutrición perfil que ayude cuerpo humano libre de enfermedades y mantenerlo healthy.They son ricos en agua, fibra, vitaminas, minerales y potasio. Reducir el riesgo de enfermedades cardiovasculares. Las frutas y verduras son esenciales para el cuerpo sano.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'frutas y vegetales', '', ''),
