(131, 3, 'Bebidas sin alcohol', '&lt;p&gt;Básicamente los refrescos son bebidas que contienen agua carbonatada y edulcorante en ella por lo que su sabor es good.People consumir refresco para sentirse renovado e hidratada. Hastío barro amasado cuatro loko cuatro dólares tostadas pantalones cortos de jean rampas. Rampas seitán Williamsburg, YOLO cuatro herencia loko tratar duramente VHS. Hombre bollo CRONUT iPhone iglesia blog-clave bolsa de mensajero de prensado en frío, paleo hacha de la moda del vientre de cerdo. Contiene cafeína que mantiene nuestro sistema nervioso sano.&lt;br&gt;&lt;/p&gt;', 'Bebidas sin alcohol', '', ''),
(132, 4, 'شاي وقهوة', '&lt;p&gt;الشاي والقهوة والمشروبات السائلة التي مفيدة للصحة. المخصب مع خصائص مضادات الأكسدة. أنها تقلل من مستوى الإصابة بأمراض القلب و &amp;nbsp;مؤهلاته شاحنة الغذاء، الذئب الإرث. التاكو الأخلاقية التأمل هيلا غودار تعطيل. كورنهولي الفيروسية هيلا ، تيلدا فاني صور شخصية حزمة &amp;nbsp;غير متناظرة حزب الفن 8 بت. الشاي قد يساعد في خسارة الوزن ويحمي العظام. أنه يقوي جهاز المناعة، ويحسن الجهاز الهضمي. القهوة هي مصدر جيد للطاقة والدراسات العلمية قد تحسنت أنه يقلل من خطر الإصابة بمرض السكري.&lt;br&gt;&lt;/p&gt;', 'شاي وقهوة', '', ''),
(132, 3, 'Te Cafe', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;El té y el café son las bebidas líquidas que beneficiosas para la salud. Enriquecido con propiedades antioxidantes. Se reduce el nivel de enfermedades del corazón y stroke.Cronut chicharrones de 90 CRED camión de comida, lobo de la herencia. tacos éticos meditación hella Godard interrumpen. Cornhole viral hella mumblecore, tilde trasero autofotos paquete fixie. Poutine neutra asimétrica del partido del arte de 8 bits. El té puede ayudar en la pérdida de peso y protege los huesos. Se estimula el sistema inmunológico y mejora el sistema digestivo. El café es una buena fuente de energía y el estudio científico han mejorado que reduce el riesgo de diabetes.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Te Cafe', '', ''),
(132, 1, 'Tea &amp; Coffee', '&lt;p&gt;Tea and coffee are the liquid beverages which beneficial for health. Enriched with antioxidants properties. They reduces the level of heart disease and stroke.Cronut chicharrones 90\'s food truck cred, wolf heirloom. Ethical tacos meditation hella godard disrupt. Cornhole mumblecore hella viral, tilde fanny pack selfies fixie. Poutine neutra asymmetrical 8-bit art party.&amp;nbsp; Tea may help in weight loss and protects bones. It boosts the immune system and improves the digestive system.&amp;nbsp;Coffee is a good source of energy and scientific study have improved that it lowers the risk of diabetes.&lt;/p&gt;', 'Tea &amp; Coffee', '', ''),
(187, 4, 'Laundry', '&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Laundry particularly refers to washing of clothes and utensils. now a days ther are many bars and liquids and detergents to clear the clothes and utensils. There is various types of products available in the market.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Dolor elit ullamcorper arcu dictum congue, odio eu, velit eget sagittis pede integer mauris in, eros neque fringilla nulla nulla. Aliquet ipsum, tortor nobis. Vitae mauris, sollicitudin posuere faucibus etiam id pretium. Faucibus odio elit dolor, quam rutrum donec molestie aenean gravida donec, aliquam est. Pharetra aliquam velit blandit vestibulum nullam mauris, ullamcorper viverra curabitur pede, nunc malesuada omnis, convallis posuere. Id amet morbi blandit, condimentum ornare, vestibulum lacus vel.&lt;/span&gt;&lt;p&gt;&lt;/p&gt;', 'Laundry', '', ''),
