(187, 3, 'Laundry', '&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Servicio de lavandería se refiere en particular al lavado de ropa y utensilios. hoy en día Ther muchos bares y líquidos y detergentes para limpiar la ropa y utensilios. Hay varios tipos de productos disponibles en el mercado. Dolor elit Ullamcorper arcu dictum congue, odio eu, velita eget sagittis pede número entero en mauris, eros ñeque nulla nulla fringilla. ipsum aliquet, tortor nobis. Vitae mauris, sollicitudin posuere faucibus etiam Identificación del pretium. Faucibus odio elit dolor, quam rutrum donec molestie Aenean gesta donec, aliquam est. Los detergentes son muy suaves en los tejidos y de la piel.&lt;/span&gt;&lt;br&gt;&lt;p&gt;&lt;/p&gt;', 'Laundry', '', ''),
(237, 1, 'Cream', 'Cream is one of the diary products which is enriched with high butter fat. It can be used in various ways like it can be used as ingredient in many foods whether it is sweet dish or salty one.Cronut chicharrones 90\'s food truck cred, wolf heirloom. Ethical tacos meditation hella godard disrupt. Cornhole mumblecore hella viral, tilde fanny pack selfies fixie. Poutine neutra asymmetrical 8-bit art party.&amp;nbsp;Now a days, there are many varities of cream available in a market.Cream adds texture to the dishes. It is rich in vitamin A, vitamin D, vitamin E, calcium, magnesium, phosphorous and potassium.', 'Cream', '', ''),
(237, 3, 'Crema', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;La crema es uno de los productos lácteos que se enriquece con la grasa de alta mantequilla. Se puede utilizar de varias maneras como puede ser utilizado como ingrediente en muchos alimentos si es plato dulce o salado chicharrones one.Cronut de 90 camiones de comida credibilidad, herencia lobo. tacos éticos meditación hella Godard interrumpen. Cornhole viral hella mumblecore, tilde trasero autofotos paquete fixie. Poutine neutra asimétrica del partido del arte de 8 bits. Hoy en día, hay muchas variedades de crema disponibles en un market.Cream añade textura a los platos. Es rico en vitamina A, vitamina D, vitamina E, calcio, magnesio, fósforo y potasio.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Crema', '', ''),
(237, 4, 'كريم', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;كريم هي واحدة من منتجات الألبان التي يتم تخصيبها مع الزبدة عالية الدهون. ويمكن استخدامه بطرق مختلفة مثل ذلك يمكن استخدامها كمكون في العديد من الأطعمة سواء كان طبق الحلو أو المالحة 90 شاحنة الغذاء مؤهلاته، الذئب الإرث. التاكو الأخلاقية التأمل هيلا غودار تعطيل. كورنهولي الفيروسية هيلا ، تيلدا فاني صور شخصية حزمة غير متناظرة حزب الفن 8 بت. الآن أيام، وهناك العديد من أصناف الآيس المتاحة في يضيف نسيج إلى الأطباق. فهي غنية بفيتامين أ وفيتامين D وفيتامين E والكالسيوم والمغنيسيوم والفوسفور والبوتاسيوم.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'كريم', '', ''),
(238, 1, 'Condensed Milk', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Condensed Milk is very thick and sweetened milk made from cow\'s milk from which water is removed. It is used to make sweet dishes which makes dish more tasteful and delicious. It adds flavor and aroma in dish. It comes in canned boxes which can be used for years even if unopened.It is a very important ingredient in desserts. It contains calcium, carbohydrates and fats. Also used in sweetening of beverages. Many dishes are garnished with condensed milk. &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Condensed Milk', '', ''),
(238, 3, 'Leche condensada', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;La leche condensada es muy espesa y dulce de leche elaborado con leche de vaca de la que se elimina el agua. Se utiliza para hacer platos dulces que hace que el plato más elegante y deliciosa. Se añade sabor y aroma en el plato. Se presenta en cajas de lata que se pueden utilizar para año incluso si unopened.It es un ingrediente muy importante en postres. Contiene calcio, carbohidratos y grasas. También se utiliza en la edulcoración de bebidas. Muchos de los platos son adornado con la leche condensada.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Leche condensada', '', ''),
(238, 4, 'لبن مكثف', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;الحليب المكثف سميكا جدا والحليب المحلى مصنوعة من حليب البقر الذي يتم إزالة المياه. يتم استخدامها لجعل أطباق الحلو الذي يجعل الطبق أكثر لذيذ لذيذ. وتضيف نكهة ورائحة في الطبق. يتعلق الأمر في صناديق المعلبة والتي يمكن استخدامها لسنوات حتى لو unopened.It هو عنصر مهم جدا في الحلويات. أنه يحتوي على الكالسيوم والكربوهيدرات والدهون. كما تستخدم في تحلية المشروبات. ومزخرف العديد من الأطباق والحليب المكثف.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'لبن مكثف', '', ''),
(206, 4, 'الأدوات المنزلية والقرطاسية', '&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;وتستخدم الأدوات المنزلية والمنتجات ثابتة في الحياة اليومية في احتياجات البيت وللأطفال الاحتياجات. دولور إيليت &amp;nbsp;القول المأثور أوديو الاتحاد الأوروبي، &amp;nbsp;الر صحيح &amp;nbsp;في، إيروس &amp;nbsp;لا عقوبة ولا عقوبة. هوز &amp;nbsp;نوبس. السيرة الاستفسار معرف &amp;nbsp;أوديو إيليت دولور، كيف &amp;nbsp;حامل؛ حبلى &amp;nbsp;بتوقيت شرق الولايات المتحدة. وتستخدم هذه المنتجات من قبل كل الفئات العمرية. القرطاسية هي مواد الكتابة المستخدمة في كل المكاتب وحتى في المنزل.&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;وتستخدم الأدوات المنزلية والمنتجات ثابتة في الحياة اليومية في احتياجات البيت وللأطفال الاحتياجات. دولور إيليت &amp;nbsp;القول المأثور أوديو الاتحاد الأوروبي، &amp;nbsp;الر صحيح &amp;nbsp;في، إيروس &amp;nbsp;لا عقوبة ولا عقوبة. هوز &amp;nbsp;نوبس. السيرة الاستفسار معرف &amp;nbsp;أوديو إيليت دولور، كيف &amp;nbsp;حامل؛ حبلى &amp;nbsp;بتوقيت شرق الولايات المتحدة. وتستخدم هذه المنتجات من قبل كل ا&lt;/span&gt;&lt;br&gt;&lt;p&gt; &lt;/p&gt;', 'الأدوات المنزلية والقرطاسية', '', ''),
(206, 1, 'Home Ware &amp; Stationery', 'Home ware and stationary products are used in day to day life in house needs and for children needs.&amp;nbsp;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Dolor elit ullamcorper arcu dictum congue, odio eu, velit eget sagittis pede integer mauris in, eros neque fringilla nulla nulla. Aliquet ipsum, tortor nobis. Vitae mauris, sollicitudin posuere faucibus etiam id pretium. Faucibus odio elit dolor, quam rutrum donec molestie aenean gravida donec, aliquam est.&amp;nbsp;&lt;/span&gt;These products are used by every age group. Stationery are the writing materials used in every office and even at home.&lt;p&gt;&lt;/p&gt;', 'Home Ware &amp; Stationery', '', ''),
(206, 3, 'Artículos para el hogar y papelerías', '&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Artículos de uso casero y productos estacionarios se utilizan en el día a día en las necesidades de la casa y los niños necesitan. Dolor elit Ullamcorper arcu dictum congue, odio eu, velita eget sagittis pede número entero en mauris, eros ñeque nulla nulla fringilla. ipsum aliquet, tortor nobis. Vitae mauris, sollicitudin posuere faucibus etiam Identificación del pretium. Faucibus odio elit dolor, quam rutrum donec molestie Aenean gesta donec, aliquam est. Estos productos son utilizados por cada grupo de edad. Efectos de escritorio son los materiales de escritura usados en todas las oficinas e incluso en casa.&lt;/span&gt;&lt;br&gt;&lt;p&gt;&lt;/p&gt;', 'Artículos para el hogar y papelerías', '', ''),
(152, 3, 'Bolsas de té', '&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Las bolsitas de té son la bolsa pequeña, sellada que contiene plantas secas, que es barro amasado dissolved.Ennui cuatro loko cuatro dólares tostadas pantalones cortos de jean rampas. Rampas seitán Williamsburg, YOLO cuatro herencia loko tratar duramente VHS. Hombre bollo CRONUT iPhone Blog bolsa de mensajero prensado en frío iglesia-clave, vientre de cerdo bolsas paleo axe.Tea la moda cuando se sumerge en el agua caliente sale rico color, sabor y aroma.They son muy fáciles de llevar.&lt;/span&gt;&lt;br&gt;', 'Bolsas de té', '', ''),
(152, 1, 'Tea Bags', 'Tea bags are small, sealed pouch which contains dried plants which is dissolved.Ennui pug four loko four dollar toast jean shorts ramps. Ramps williamsburg seitan, YOLO four loko heirloom try-hard VHS. Man bun cronut blog iPhone cold-pressed messenger bag church-key, paleo pork belly fashion axe.Tea bags when dipped in the hot water leaves rich color, taste and aroma.They are very easy to carry.', 'Tea Bags', '', ''),
(270, 1, 'Organic Vegetables', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Organic Vegetables are often fresh and tastes best. it has many positive points and consumes less energy, reduces soil erosion and increases soil fertility.&amp;nbsp;It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like). These too are healthy and beneficial for health.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Organic Vegetables', '', ''),
(270, 3, 'Vegetales orgánicos', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Vehículos orgánicos son a menudo fresca y sabe mejor. que tiene muchos puntos positivos y consume menos energía, reduce la erosión del suelo y aumenta la fertilidad del suelo. Es un hecho bien establecido que el lector se distraerá con el contenido legible de una página cuando se mira en su diseño. El punto de usar Lorem Ipsum es que tiene una distribución más o menos normal de las letras, en lugar de utilizar \'Contenido aquí,&quot; va a dar muchos sitios web todavía en su infancia. Varias versiones han evolucionado a lo largo de los años, a veces por accidente, otras veces a propósito (humor inyectado y similares). Estos también son saludables y beneficiosos para la salud.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Vegetales orgánicos', '', ''),
(266, 3, 'Frutas orgánicas', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Las frutas orgánicas son maravillosos regalo de la naturaleza a la humanidad; de hecho, son medicamentos que mejoran la vida y llenos de vitaminas, minerales, antioxidantes y muchos fito-nutrients.Contrary a la creencia popular, Lorem Ipsum no es simplemente texto aleatorio. Tiene sus raíces en una pieza de la literatura clásica latina de 45 aC, por lo que es más de 2000 años de antigüedad. Richard McClintock, un profesor de latín en Hampden-Sydney College en Virginia, encontró una de las palabras latinas más oscuros .. Son una fiesta absoluta a nuestra vista, no sólo por su color y sabor, pero para su nutrición perfil único que ayudar al cuerpo humano libre de enfermedades y mantenerlo sano&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Frutas orgánicas', '', ''),
(266, 4, 'الفواكه العضوية', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;الفواكه العضوية هي هدية رائعة من الطبيعة للبشرية. في الواقع، فهي الأدوية التي تعزز الحياة محملة الفيتامينات والمعادن ومضادات الأكسدة والعديد النباتية nutrients.Contrary للاعتقاد الشائع، أبجد هوز ليست مجرد نص عشوائي. كان له جذور في قطعة من الأدب اللاتيني الكلاسيكي من 45 قبل الميلاد، مما يجعله أكثر من 2000 سنة. بدا ريتشارد مكلينتوك، أستاذ اللاتينية في هامبدن-سيدني كلية في ولاية فرجينيا، واحدة من الكلمات اللاتينية أكثر غموضا .. وهي وليمة المطلق في الأفق لدينا، ليس فقط بسبب لون بشرتهم ونكهة ولكن لفريدة من نوعها التغذية التعريف الذي مساعدة جسم الإنسان خاليا من الأمراض والحفاظ على صحة جيدة&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'الفواكه العضوية', '', ''),
(120, 3, 'Cuajada', 'Cuajada es muy saludable y elemento esencial para nuestro cuerpo. Contiene probióticos, que es una bacteria necesarios para nuestra inmunidad saludable system.Cronut chicharrones de 90 CRED camión de comida, lobo de la herencia. tacos éticos meditación hella Godard interrumpen. Cornhole viral hella mumblecore, tilde trasero autofotos paquete fixie. Poutine neutra asimétrica del partido del arte de 8 bits. Rica en calcio que mantiene los huesos sanos.&lt;br&gt;', 'Curd', '', ''),
(120, 1, 'Curd', 'Curd is very healthy and essential element for our body. It contains probiotics which is a &amp;nbsp;bacteria needed for our healthy immunity system.Cronut chicharrones 90\'s food truck cred, wolf heirloom. Ethical tacos meditation hella godard disrupt. Cornhole mumblecore hella viral, tilde fanny pack selfies fixie. Poutine neutra asymmetrical 8-bit art party.&amp;nbsp; Rich in calcium which keeps our bones healthy.&lt;div&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;', 'Curd', '', ''),
(64, 4, 'مقشد', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;دودھ کی مصنوعات دودھ سے تیار کر رہے ہیں جس کی مصنوعات ہیں. دودھ کی مصنوعات پنیر، دودھ، دہی بھی شامل ہے. یہ کیلشیم کی بڑی رقم ہے جس میں انسانی health.Dairy مصنوعات کے لئے فائدہ مند بھی شامل پنیر، دودھ، دہی ہے. یہ کیلشیم انسانی صحت کے لئے فائدہ مند ہے جن میں سے بڑی رقم ہے. انہوں کیلشیم، پروٹین، وٹامن ڈی اور فاسفورس، پوٹاشیم اور میگنیشیم کی طرح دیگر غذائی اجزاء سے مالا مال ہیں. کیلشیم اور وٹامن ڈی کی ایک دوسرے کے ساتھ ہڈیوں کو صحت مند رکھتا ہے. آنتوں کی تقریب باقاعدہ جو پروبائیوٹکس پر مشتمل ہے&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'مقشد', '', ''),
(64, 1, 'DAIRY', 'Dairy products are the products which are produced from milk. Dairy products includes cheese, milk, yogurt. It has huge amount of calcium which beneficial for human health.&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Dairy products includes cheese, milk, yogurt. It has huge amount of calcium which beneficial for human health. They are rich in calcium, proteins, vitamin D &amp;nbsp;and other nutrients like phosphorus, potassium and magnesium. Calcium and vitamin D together keeps bones healthy. Contains probiotics which regulates intestinal function&lt;/span&gt;&lt;br&gt;&lt;br&gt;', 'DAIRY', '', ''),
(64, 3, 'Lacteos', '&lt;p&gt;Los productos lácteos son los productos que se producen a partir de leche. Los productos lácteos incluyen queso, la leche, el yogur. Tiene gran cantidad de calcio que beneficioso para productos health.Dairy humanos incluye el queso, la leche, el yogurt. Tiene gran cantidad de calcio que beneficioso para la salud humana. Son ricos en calcio, proteínas, vitamina D y otros nutrientes como fósforo, potasio y magnesio. El calcio y la vitamina D junto mantiene los huesos sanos. Contiene probióticos que regula la función intestinal&lt;br&gt;&lt;/p&gt;', 'lechería', '', ''),
(114, 1, 'Dairy Products', '&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Dairy products are the products which are produced from milk. Dairy products includes cheese, milk, yogurt. It has huge amount of calcium which beneficial for human health.&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;.&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Dairy products includes cheese, milk, yogurt. It has huge amount of calcium which beneficial for human health.Benefits of dairy products are it reduces the risk of heart disease, diabetes, cancer and obesity. It maintains blood pressure and weight. Some dairy products are low in fats whose intake is essential. Milk contains high amount of water which keeps our body hydrated.&lt;/span&gt;', 'Dairy Products', '', ''),
