(233, 4, 'الفاكهة العضوية والنباتية', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;الفواكه والخضروات العضوية غالبا ما تكون طازجة وطعمه أفضل. لديها العديد من النقاط الإيجابية وتستهلك طاقة أقل، ويقلل من تآكل التربة ويزيد من التربة &amp;nbsp;مؤهلاته شاحنة الغذاء، الذئب الإرث. التاكو الأخلاقية التأمل هيلا غودار تعطيل. كورنهولي الفيروسية هيلا &amp;nbsp;تيلدا فاني صور شخصية حزمة &amp;nbsp;غير متناظرة حزب الفن 8 بت. لديهم المزيد من المواد المغذية ومضادات الأكسدة. هناك تقييد استخدام المبيدات والأسمدة الكيماوية. لا تستخدم المواد الكيميائية حتى لا يكون هناك أقل التربة. تلوث الهواء والماء.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'الفاكهة العضوية والنباتية', '', ''),
(233, 1, 'Organic Fruit &amp; Vegetable', '&lt;p&gt;Organic Fruits and Vegetables are often fresh and tastes best. it has many positive points and consumes less energy, reduces soil erosion and increases soil fertility.Cronut chicharrones 90\'s food truck cred, wolf heirloom. Ethical tacos meditation hella godard disrupt. Cornhole mumblecore hella viral, tilde fanny pack selfies fixie. Poutine neutra asymmetrical 8-bit art party.&amp;nbsp; They have more nutrients and antioxidants. There is restricted use of pesticides and chemical fertilizers. No chemicals are used so there is less soil. air and water pollution.&lt;/p&gt;', 'Organic Fruit &amp; Vegetable', '', ''),
(233, 3, 'Frutas y Vegetales orgánicos', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Frutas y verduras orgánicas son a menudo fresca y sabe mejor. que tiene muchos puntos positivos y consume menos energía, reduce la erosión del suelo y aumenta suelo chicharrones fertility.Cronut de 90 CRED camión de comida, lobo de la herencia. tacos éticos meditación hella Godard interrumpen. Cornhole viral hella mumblecore, tilde trasero autofotos paquete fixie. Poutine neutra asimétrica del partido del arte de 8 bits. Ellos tienen más nutrientes y antioxidantes. Hay un uso restringido de pesticidas y fertilizantes químicos. No hay productos químicos se utilizan para que haya menos suelo. contaminación del aire y del agua.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Frutas y Vegetales orgánicos', '', ''),
(114, 4, 'منتجات الألبان', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;منتجات الألبان هي المنتجات التي يتم إنتاجها من الحليب. وتشمل منتجات الألبان والجبن والحليب واللبن. لديها كمية كبيرة من الكالسيوم الذي مفيد للمنتجات health..Dairy الإنسان تشمل الجبن والحليب واللبن. لديها كمية كبيرة من الكالسيوم الذي مفيدة للhealth.Benefits الإنسان من منتجات الألبان هي أنه يقلل من خطر الإصابة بأمراض القلب والسكري والسرطان والسمنة. فإنه يحافظ على ضغط الدم والوزن. بعض منتجات الألبان منخفضة في الدهون التي تناول أمر ضروري. يحتوي الحليب على كمية عالية من المياه التي تحافظ على الجسم رطب.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'منتجات الألبان', '', ''),
(62, 3, 'Comestibles y el grapas', '&lt;p style=&quot;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Growcery y grapas son las cosas que son utilizados por las personas en la rutina diaria o la vida día a día. Los alimentos básicos se enriquecen en carbohidratos, grasas y minerales y chicharrones proteins.Cronut de 90 CRED camión de comida, herencia de lobo. tacos éticos meditación hella Godard interrumpen. Cornhole hella mumblecore viral Ellos son la buena fuente de hidratos de carbono, proteínas, grasas e fuente minerals.Good de energía.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Comestibles y el grapas', '', ''),
(62, 4, 'البقالة والسلع', '&lt;p style=&quot;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp;والسلع هي الأشياء التي يستخدمها الناس في الروتين اليومي أو الحياة اليومية. يتم إثراء المواد الغذائية الأساسية من الكربوهيدرات والدهون والمعادن و مؤهلاته شاحنة الغذاء، الذئب الإرث. التاكو الأخلاقية التأمل هيلا غودار تعطيل. كورنهولي هيلا الفيروسية فهي مصدر جيد للكربوهيدرات، البروتينات، والدهون ومصدر &amp;nbsp;من الطاقة.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'البقالة والسلع', '', ''),
(115, 1, 'Butter &amp; Cream', '&lt;br&gt;', 'Butter &amp; Cream', '', ''),
(115, 3, 'Butter &amp; Cream', '&lt;br&gt;', 'Butter &amp; Cream', '', ''),
(115, 4, 'Butter &amp; Cream', '&lt;br&gt;', 'Butter &amp; Cream', '', ''),
(73, 1, 'Vegetables', '&lt;p&gt;Vegetables are everyday usage which is consumed by humans as a food. They can be eaten raw or cooked. Vegetables are low in fat and carbohydrates but rich in fibres, minerals and vitamins which gives nutrition to human body and keeps them healthy.Originally, vegetables came from the wild by hunter gatherers and entered as cultivation in several parts of the world.Nowadays, mostly all the vegetables are grown worldwide as climate permits.They are low in fats and calories but rich in water and fiber which is very essential for a healthy body . They helps in keeping our immunity system strong.&lt;/p&gt;', 'Vegetables', '', ''),
(73, 3, 'vegetales', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Las verduras son el uso cotidiano que se consume por los seres humanos como un alimento. Se pueden comer crudas o cocidas. Las verduras son bajas en grasas y carbohidratos, pero rica en fibras, minerales y vitaminas que proporciona la nutrición para el cuerpo humano y los mantiene healthy.Originally, vegetales proceden de la naturaleza por cazadores-recolectores y se anotarán como cultivo en varias partes de los world.Nowadays, en su mayoría todas las verduras se cultivan en todo el mundo como el clima permits.They son bajos en grasas y calorías, pero rico en agua y fibra que es muy esencial para un cuerpo sano. Que ayuda a mantener nuestro sistema inmunitario fuerte.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'vegetales', '', ''),
(108, 1, 'Bread &amp; Eggs', '&lt;p&gt; Bread and Eggs is one of the most popular and mostly liked by everyone. They have various health benefits. They both are enriched with nutrients, Fibres, carbohydrates.Cronut chicharrones 90\'s food truck cred, wolf heirloom. Ethical tacos meditation hella godard disrupt. Cornhole mumblecore hella viral, tilde fanny pack selfies fixie. Poutine neutra asymmetrical 8-bit art party.&amp;nbsp;&amp;nbsp;Bread can be eaten as a snack or in preparing other dishes. It is a rich source of fiber which helps in maintaining healthy digestive system and protect from cancer. Protein is abundantly found in eggs which is a good source of energy.&amp;nbsp;&lt;/p&gt;', 'Bread &amp; Eggs', '', ''),
(108, 3, 'Pan y huevos', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;El pan y los huevos es uno de los más populares y sobre todo del agrado de todos. Tienen varios beneficios para la salud. Ambos están enriquecidos con credibilidad camión de alimentos nutrientes, fibras, chicharrones carbohydrates.Cronut de 90, lobo de la herencia. tacos éticos meditación hella Godard interrumpen. Cornhole viral hella mumblecore, tilde trasero autofotos paquete fixie. Poutine neutra asimétrica del partido del arte de 8 bits. El pan se puede comer como un aperitivo o en la preparación de otros platos. Es una rica fuente de fibra, que ayuda a mantener el sistema digestivo saludable y protege del cáncer. Las proteínas se encuentran en abundancia en los huevos, que es una buena fuente de energía.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Pan y huevos', '', ''),
(108, 4, 'الخبز والبيض', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;الخبز والبيض هي واحدة من أكثر شعبية ويحب معظمها من قبل الجميع. أنها لها فوائد صحية مختلفة. يتم إثراء كلاهما مع المواد الغذائية، والالياف، &amp;nbsp;مؤهلاته شاحنة الغذاء، الذئب الإرث. التاكو الأخلاقية التأمل هيلا غودار تعطيل. كورنهولي الفيروسية هيلا ، تيلدا فاني صور شخصية حزمة غير متناظرة حزب الفن 8 بت. الخبز يمكن أن تؤكل كوجبة خفيفة أو في إعداد أطباق أخرى. وهو مصدر غني من الألياف التي تساعد في الحفاظ على صحة الجهاز الهضمي وحماية من السرطان. من البروتين بكثرة في البيض والذي هو مصدر جيد للطاقة.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'الخبز والبيض', '', '');
