(275, 3, 'Cheese', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Cheese is a nutritious for health which is basically made from milk of cow or buffalo. It has many health benefits and is enriched with proteins and fibres. Keep the cheese in conditions in which it matures. Cheese should be wrapped in waxed paper loosely so that it won\'t loose it\'s humidity. Chilled cheese should be kept out of&amp;nbsp;refrigerator&amp;nbsp;before consuming it.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;As cheese contains living organisms so it should not be cut off or it should be prevented from being dry.&lt;/span&gt;&lt;/p&gt;', 'Cheese', '', ''),
