(259, 1, 'Fresh Vegetables', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Vegetables are everyday usage which is consumed by humans as a food. They can be eaten raw or cooked. Originally, vegetables came from the wild by hunter gatherers and entered as cultivation in several parts of the world.Nowadays, mostly all the vegetables are grown worldwide as climate permits.It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old.&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Vegetables are low in fat and carbohydrates but rich in fibres, minerals and vitamins which gives nutrition to human body and keeps them healthy.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Fresh Vegetables', '', ''),
(259, 3, 'Vegetales frescos', '&lt;p&gt;Las verduras son el uso cotidiano que se consume por los seres humanos como un alimento. Se pueden comer crudas o cocidas. Originalmente, los vegetales proceden de la naturaleza por cazadores-recolectores y se anotarán como cultivo en varias partes de los world.Nowadays, en su mayoría todas las verduras se cultivan en todo el mundo como permits.It climático tiene sus raíces en una pieza de la literatura clásica latina de 45 aC, por lo que es más de 2000 años old.Vegetables son bajos en grasas y carbohidratos, pero rica en fibras, minerales y vitaminas que proporciona la nutrición al cuerpo humano y los mantiene sanos.&lt;br&gt;&lt;/p&gt;', 'Vegetales frescos', '', ''),
