(266, 1, 'Organic Fruits', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Organic Fruits &amp;nbsp;are wonderful gift of nature to mankind; indeed, they are life-enhancing medicines packed with vitamins, minerals, anti-oxidants and many phyto-nutrients.Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words.&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;. They are an absolute feast to our sight, not just because of their color and flavor but for their unique nutrition-profile that help human body free from diseases and keep it healthy&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Organic Fruits', '', ''),
