INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(6, 1, 'Delivery Information', '&lt;p&gt;\r\n	Delivery Information&lt;/p&gt;\r\n', '', '', ''),
(6, 3, 'Delivery Information', '&lt;p&gt;\r\n	Delivery Information&lt;/p&gt;\r\n', '', '', ''),
(4, 1, 'About Us', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Company Overview&lt;/span&gt;&lt;/p&gt;&lt;p&gt;FATbit is a team of website designers, developers and marketers helping businesses &amp;amp; online investors realize the true power of web. As a professional web design company, we have successfully completed more than 2000 web projects across the map, and are determined to make web design &amp;amp; development services affordable for all.&amp;gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;11 years of industry experience and exemplary work has earned us the title of \'best website design company India\' from our global clients. We are not just exceptionally good with our designs but also work dedicatedly towards empowering businesses and organizations on web. Backed by values like futuristic thinking, personalized attention, result oriented innovation, exceeding client expectation, and competitive pricing, we are indeed a rapidly growing spearhead of the entire ball game. Our best web designers and programmers will walk miles with you to take your business to the next level and make success your mandatory trait, while assuring you an entire year\'s technical support for FREE.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Affordable Web Design Solutions&lt;/span&gt;&lt;/p&gt;&lt;p&gt;We design to impress&lt;/p&gt;&lt;p&gt;We research, plan, and design custom websites that are rich in user experience.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Hire dedicated web designers in India to build a unique online brand identity.&lt;/li&gt;&lt;li&gt;Responsive Website Design&lt;/li&gt;&lt;li&gt;Dominate desktops, tablets &amp;amp; smartphones with a responsive website. Partner with our company to design a mobile friendly site at best price for better reach and impact.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Ecommerce Design&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Hire eCommerce website design agency to compete with top online stores. Our affordable eCommerce packages can help you sell more from your shopping website.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Why Hire Us?&lt;/span&gt;&lt;/p&gt;&lt;p&gt;In the role of premium web design agency, we have created business websites and web based solutions for established global brands. We have also acquainted small businesses and young startups with sales and leads generation potential of web. Companies throughout the world choose us as their offshore website design &amp;amp; programming partner because we bring following advantages to their project&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Exceptional &amp;amp; Cost Effective Solutions&lt;/li&gt;&lt;li&gt;FREE technical support for 1 Year&lt;/li&gt;&lt;li&gt;Industry experience of more than 11 years&lt;/li&gt;&lt;li&gt;Oriented Innovation with futuristic thinking&lt;/li&gt;&lt;li&gt;Specialization in custom design &lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;What Makes us Best in Web Design Development?&lt;/span&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Highly talented team of UX designers, experienced website programmers, best web analysts, conversion experts,project managers. We have an expert for your every need.&lt;/li&gt;&lt;li&gt;Immunity from Google algorithm updates &amp;amp; better SE rankings. Our design &amp;amp; development process makes websites dominate search engine results  attract relevant traffic.&lt;/li&gt;&lt;li&gt;Website designs that are user experience focused &amp;amp; conversion optimized. Our expert designers specialize in sites that generate more sales and business leads without added costs.&lt;/li&gt;&lt;li&gt;Free website consultation and professional guidance for every query. Whether you need marketing assistance or expert advice, we are here to help you with every doubt.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;From website redesign to custom development, we have best solutions &amp;amp; packages for everything. For unique needs, we are ready to go custom. &lt;/p&gt;&lt;p&gt;Experienced web developers proficient in open source technologies like WordPress, Joomla, Drupal and Magento. With FATbit, cost effective solutions are guaranteed.&lt;/p&gt;&lt;ul&gt;              &lt;/ul&gt;', 'About Us', '', ''),
(5, 1, 'Terms &amp; Conditions', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;FATbit Technologies - Terms and Conditions&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;(Terms 1st to 21st are Standard Terms)&lt;/span&gt;&lt;/p&gt;&lt;p&gt;1. Contract: The client’s approval for work to commence shall be deemed a contractual agreement between the client and FATbit Technologies. The approval for the work can be through either an email confirming back the quote (with the quote document attached) or the quote document signed by the client. INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(3, 3, 'Privacy Policy', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Privacy Policy&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;What information do we collect?&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;We collect information from you when you fill out a form. When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address, phone number or credit card information. You may, however, visit our site anonymously.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;What do we use your information for?&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Any of the information we collect from you may be used in one of the following ways:&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To personalize your experience&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;(your information helps us to better respond to your individual needs)&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To improve our website&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;(we continually strive to improve our website offerings based on the information and feedback we receive from you)&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To improve customer service&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;(your information helps us to more effectively respond to your customer service requests and support needs)&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To process transactions&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To administer a contest, promotion, survey or other site feature&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To send periodic emails&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;The email address you provide for order processing, may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, related product or service information, etc.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;How do we protect your information?&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Do we use cookies?&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Yes (Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information We use cookies to understand and save your preferences for future visits and compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future. We may contract with third-party service providers to assist us in better understanding our site visitors. These service providers are not permitted to use the information collected on our behalf except to help us conduct and improve our business.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Do we disclose any information to outside parties?&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;California Online Privacy Protection Act Compliance&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Because we value your privacy we have taken the necessary precautions to be in compliance with the California Online Privacy Protection Act. We therefore will not distribute your personal information to outside parties without your consent.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Childrens Online Privacy Protection Act Compliance&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;We are in compliance with the requirements of COPPA (Childrens Online Privacy Protection Act), we do not collect any information from anyone under 13 years of age. Our website, products and services are all directed to people who are at least 13 years old or older.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Online Privacy Policy Only&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;This online privacy policy applies only to information collected through our website and not to information collected offline.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Terms and Conditions&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Please also visit our Terms and Conditions section establishing the use, disclaimers, and limitations of liability governing the use of our website at http://www.fatbit.com&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Your Consent&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;By using our site, you consent to our online privacy policy.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Changes to our Privacy Policy&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;If we decide to change our privacy policy, we will post those changes on this page.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Contacting Us&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;If there are any questions regarding this privacy policy you may contact us using the information below.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;http://www.fatbit.com&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Plot 268 (Sector-82)&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;JLPL Industrial Area,&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Mohali,Punjab,India&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;+1 469 844 3346&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;ISO 9001:2008 certified company&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Get in Touch&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;FATbit Technologies/Ably Soft Pvt Ltd.&lt;/span&gt;&lt;/p&gt;\r\n', 'Privacy policy', '', ''),
(5, 3, 'Terms &amp; Conditions', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;FATbit Technologies - Terms and Conditions&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px; text-align: center;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;(Terms 1st to 21st are Standard Terms)&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;1. Contract: The client’s approval for work to commence shall be deemed a contractual agreement between the client and FATbit Technologies. The approval for the work can be through either an email confirming back the quote (with the quote document attached) or the quote document signed by the client. INSERT INTO `oc_information_to_layout` (`information_id`, `store_id`, `layout_id`) VALUES
