(62, 4, 'Bag of Apples', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Bag of apples contains both red and golden apples. Both types of apples are rich in carbohydrates and are beneficial for health and skin too.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Bag of Apples', '', ''),
