(53, 1, 'Red Apple', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Red Apples are rich in carbohydrates and fats. It has red skin with juicy off white flesh. It has a mils sweet taste with little bit of sourness. It is available year-round. It contains Vitamin A and Vitamin C with little bit of sodium which is beneficial for health and skin.Daily consumption of apple helps human beings to stay healthy.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Red Apple', '', ''),
(53, 3, 'Red Apple', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Red Apples are rich in carbohydrates and fats. It has red skin with juicy off white flesh. It has a mils sweet taste with little bit of sourness. It is available year-round. It contains Vitamin A and Vitamin C with little bit of sodium which is beneficial for health and skin.Daily consumption of apple helps human beings to stay healthy.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Red Apple', '', ''),
