(60, 3, 'Golden apple', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Golden apple is a tropical fruit. It has shiny golden skin and has soft and juicy flesh. These&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;apples provides a huge range of health and beauty benefits, especially when compared to red apples. &amp;nbsp;Golden apples, on the other hand, are more the sweet and sour type. It has sugary,juicy and little bitter flavor. It is rich in carbohydrates and delicious to eat. It improves immunity and has countless health benefits. Consuming green apples gives healthy and glowing skin.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Golden apple', '', ''),
(60, 4, 'Golden apple', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Golden apple is a tropical fruit. It has shiny golden skin and has soft and juicy flesh. These&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;apples provides a huge range of health and beauty benefits, especially when compared to red apples. &amp;nbsp;Golden apples, on the other hand, are more the sweet and sour type. It has sugary,juicy and little bitter flavor. It is rich in carbohydrates and delicious to eat. It improves immunity and has countless health benefits. Consuming green apples gives healthy and glowing skin.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Golden apple', '', ''),
(55, 4, 'Pear', '&lt;h4 style=&quot;font-family: \'Open Sans\', sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;font-size: 12px; line-height: 17.1428px;&quot;&gt;Pear includes white or cream-colored flesh. They often contain brown colored speckles on their outer surface. They are juicy, crispy and has a sweet taste with grainy texture. A ripe pear is hard but not as hard as rock which contains a rich aroma when ripe. It includes carbohydrates, Vitamins A, C, K, E, Folate, B2, B1. Important phytochemicals in pears include beta-carotene, quercetin, chlorogenic acid and pectin.Product image shown is for representation purpose only, the actually product may vary based on season, produce &amp;amp; availability.&lt;/span&gt;&lt;br&gt;&lt;/h4&gt;', '', 'Pear', '', ''),
(52, 3, 'Green Apple', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Green apples provides a huge range of health and beauty benefits, especially when compared to red apples. &amp;nbsp;Green apples, on the other hand, are more the sweet and sour type (this is popularly classified as cooking apples). Green Apple has green skin. It has sugary,juicy and little bitter flavor. It is rich in carbohydrates and delicious to eat. It improves immunity and has countless health benefits. Consuming green apples gives healthy and glowing skin.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Green Apple', '', ''),
(52, 4, 'Green Apple', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Green apples provides a huge range of health and beauty benefits, especially when compared to red apples. &amp;nbsp;Green apples, on the other hand, are more the sweet and sour type (this is popularly classified as cooking apples). Green Apple has green skin. It has sugary,juicy and little bitter flavor. It is rich in carbohydrates and delicious to eat. It improves immunity and has countless health benefits. Consuming green apples gives healthy and glowing skin.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Green Apple', '', ''),
