(96, 4, 'Amul Cheese Spread', '&lt;p&gt;Manufactured from deliciously soft cheddar cheese, Amul Cheese Spread makes your breakfast tastier and healthier. Consume it with a variety of options like toasts and pancakes or simply enjoy it with a glass of your favourite beverage. Around 12% of protein and 100g of calorific value make it even more tempting and healthy.&lt;br&gt;&lt;br&gt;&lt;/p&gt;', '', 'Amul Cheese ', '', ''),
(58, 3, 'Grapes', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Grapes are rich in vitamin C, vitamin &amp;nbsp;K and polyphenolic pyhto chemical compound reseveratrol which is rich in antioxidants. They are rich in natural water and sugars.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Product image is only for representative purpose, it may vary from actual product based on availability and season.&lt;/p&gt;', '', 'Grapes', '', ''),
