(79, 3, 'Brown Bread', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Details:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Brown Bread are made with the significant amount of wheat and whole grain flour. It includes dark colored ingredients such as coffee. It reduces risk of heart diseases and lowers the risk of weight gain.It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Ingredients:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Molasses, Whole Grain Flour, Salt, Sugar, Yeast, Glutten, Water, Vegetable Fat, Yeast, Calcium Propionate, Dough Conditioner.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Instructions:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keep in refrigrator.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Place it in cool and dry place.&lt;/p&gt;', '', 'Brown Bread', '', ''),
(77, 4, 'Cabbage', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Description:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Cabbage is a leafy vegetable which has round shape and has many iterative layers. It contains vitamins k, C and B6.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Benefits:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;It has many health benefits such as it helps in fighting against obesity, headaches, stomach pain, constipations, skin and eye disorders.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Directions:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Keep Refrigerated.&lt;/p&gt;&lt;p&gt;Can be consumed within a week if kept in cool and dry place.&lt;/p&gt;', '', 'Cabbage', '', ''),
