(77, 3, 'Cabbage', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Description:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Cabbage is a leafy vegetable which has round shape and has many iterative layers. It contains vitamins k, C and B6.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Benefits:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;It has many health benefits such as it helps in fighting against obesity, headaches, stomach pain, constipations, skin and eye disorders.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Directions:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keep Refrigerated.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Can be consumed within a week if kept in cool and dry place.&lt;/p&gt;', '', 'Cabbage', '', ''),
(54, 3, 'Basket Apples', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Details:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Apples have oval and pear shape. It\'s outer peels comes in different colors like red, golden, green and yellow depending upon the cultivator type. They are crispy and have juicy off white pulp which has a mixture of mild sweet and sour flavour. It\'s seeds are inedible because they are bitter in taste.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Ingredients:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Vitamins, Carbohydrates, water, Vitamins&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Instructions:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keep it in cool and dry place.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Keep it in refrigerator to consume more then a week.&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;e.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Basket Apples', '', ''),
(86, 3, 'Diaper Changing Mat', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Thick and flat mat design to be place on the floor for children while playing, drawing or watching TV. Protects children from the hardness and coldness of the floor and cushion their fall in case they slip or trip. Can be used in Preschools, day care&amp;nbsp;centers&amp;nbsp;and nurseries.&amp;amp;ere are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Key Feature:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Absorbent Power and Thick.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Easily Washable&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Brand Information:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;The Mee Mee brand of Mother and Baby Care products is owned by Me n Moms Pvt Ltd. Me n Mom is a leading importer, consolidator and marketer of infant products in India. Their products are manufactured at the best factories internationally and offer great value for money. Mee Mee offers the widest variety of attractive options of baby care and maternity products to enabling new mothers to nurture and take best care of their adorable babies during their earliest most important formative building block years.&lt;/p&gt;', '', 'Diaper Changing Mat', '', ''),
