(101, 4, 'Britannia Bread', '&lt;p&gt;A lip-smacking wholesome bread made from 100% whole grains. It contains oats and ragi, and baked with linseed, sunflower, soybean, sesame and melon for that delicious blend of nutrition and taste.&lt;br&gt;&lt;/p&gt;', '', 'Britannia Bread', '', ''),
