(99, 1, 'Amul Pizza Cheese ', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18.5714px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);&quot;&gt;Amul Pizza Cheese - Mozzarella is a great source of milk protein, is 100% vegetarian and is very nutritious. It melts uniformly and smoothly along with your baked pizzas, thus beautifully engulfing all other ingredients of the pizza surface. This Amul Pizza Cheese - Mozzarella 200 gm pack can be easily availed from Askmegrocery!&lt;/span&gt;&lt;/p&gt;', '', 'Cheese', '', ''),
(99, 3, 'Amul Pizza Cheese ', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18.5714px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);&quot;&gt;Amul Pizza Cheese - Mozzarella is a great source of milk protein, is 100% vegetarian and is very nutritious. It melts uniformly and smoothly along with your baked pizzas, thus beautifully engulfing all other ingredients of the pizza surface. This Amul Pizza Cheese - Mozzarella 200 gm pack can be easily availed from Askmegrocery!&lt;/span&gt;&lt;/p&gt;', '', 'Cheese', '', ''),
(98, 3, 'Baby Biotique Soap', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Baby Biotique soap is blended with natural ingredients like almond, margosa, coconut oils which helps in washing away all the impurities from skin and make the skin soft, supple and glowy.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Key Features:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Blended with natural almonds, turmeric, coconut oil and margosa.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Recommendation:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Recommended only for sensitive skin&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Brand Information:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Biotique’s baby care deals with skincare and haircare products that are made from pure natural ingredients to pamper and protect baby’s delicate skin. Biotique offers products that would form a protective layer on baby’s sensitive skin to keep it healthy and nurtured from head to toe. All products in Biotique\'s baby care range are Pediatrician approved.&lt;/p&gt;', '', 'Baby Biotique Princess Soap', '', ''),
(98, 4, 'Baby Biotique Soap', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Baby Biotique soap is blended with natural ingredients like almond, margosa, coconut oils which helps in washing away all the impurities from skin and make the skin soft, supple and glowy.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Key Features:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Blended with natural almonds, turmeric, coconut oil and margosa.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Recommendation:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Recommended only for sensitive skin&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Brand Information:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Biotique’s baby care deals with skincare and haircare products that are made from pure natural ingredients to pamper and protect baby’s delicate skin. Biotique offers products that would form a protective layer on baby’s sensitive skin to keep it healthy and nurtured from head to toe. All products in Biotique\'s baby care range are Pediatrician approved.&lt;/p&gt;', '', 'Baby Biotique Princess Soap', '', ''),
