(74, 4, 'Mango', '&lt;p&gt;Mangoes, the king of fruits. This is a seasonal fruit and arrives in summer. It is enriched with antioxidants which helps in protecting against cholesterol and colon. It has many benefits like improves eye sight, clears skin, improves digestion and helps in fighting against heat stroke.&lt;/p&gt;', '', 'Mango', '', ''),
(80, 3, 'Eggs', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Details:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Eggs are enriched with proteins. Both white and yolk of an egg are rich in nutrients - proteins, vitamins and minerals. The yolk contains cholesterol and soluble fat . More then half of the protein is contained in egg white. They are also a good source of vitamins D, B6, B12 and minerals like zinc, iron and copper.making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Ingredients:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Organic Whole Eggs&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Directions:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Keep refrigrated at 45 &amp;nbsp;degrees to prevent them from bacteria.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Handle it with care.&lt;br&gt;&lt;/span&g