(126, 4, 'Coconess Coconut Oil', '&lt;p&gt;Coconut oil, or copra oil, is an edible oil extracted from the kernel or meat of mature coconuts harvested from the coconut palm (Cocos nucifera). It has various applications. Because of its high saturated fat content, it is slow to oxidize and, thus, resistant to rancidification, lasting up to six months at 24 °C (75 °F) without spoiling.[1]&lt;br&gt;&lt;br&gt;Numerous health authorities advise against regular consumption of coconut oil due to its high levels of saturated fat (similar to that of animal fat) having potential to increase risk of cardiovascular disease.&lt;br&gt;&lt;/p&gt;', '', 'Coconess Coconut Oil', '', ''),
