(128, 1, 'Jivo Canola oil', '&lt;p&gt;Jivo Wellness was formed in September 2010 by establishing its first State of Art rotary EOP plant with a production capacity of over 1000 metric tonnes per month in Kundli, Haryana.The plant was inaugurated by Mr Gerry.Ritz (Agriculture minister of Canada) with an idea to serve humanity &amp;amp; to change the country\'s nutritional attributes by introducing canola oil as a mother nature\'s gift to mankind in India.&lt;br&gt;&lt;/p&gt;', '', 'Jivo Canola oil', '', ''),
