(129, 1, 'Delmonte Olive Oil', '&lt;p&gt;Olive oil is a fat obtained from the olive (the fruit of Olea europaea; family Oleaceae), a traditional tree crop of the Mediterranean Basin. The oil is produced by pressing whole olives and is commonly used in cooking, cosmetics, pharmaceuticals, and soaps, and as a fuel for traditional oil lamps. Olive oil is used throughout the world and is often associated with Mediterranean cuisine and diet.&lt;br&gt;&lt;/p&gt;', '', 'Delmonte Olive Oil', '', ''),
