(137, 4, 'Himalaya Almond', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;It is enriched with natural extracts of almond and rose which moisturizes dry skin and keeps it healthy and glowy. Almond oil helps in moisturizing dry skin and rose cools the skin and keep it fresh naturally.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Himalaya Almond', '', ''),
