(138, 4, 'Veet Hair Removal', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;The heavenly blended with Beauty Oils will leave your skin more moisturized and silky smooth. The Velvet Rose fragrance will envelop your skin, leaving it delicately scented.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Beauty oils are known for their oxygenating and cell regenerating properties, making them the perfect ingredient for holistic natural skincare.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;The Velvet Rose fragrance leaves your skin delicately scented, making your hair removal experience more pleasurable than ever before.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 1.42857; font-weight: bold;&quot;&gt;Directions for Use:&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Read precautions before use. Apply directly onto the skin with the spatula, spreading the cream evenly to fully to cover the hair.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Leave the cream on the skin for 3 minutes timed carefully, and then gently use the head of the spatula to test a small area. If hair comes away easily, remove the rest of the cream with the spatula. If needed, leave the cream on for a bit longer Without Exceeding 6 Minutes for Veet.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Rinse Your Skin thoroughly with water after use and pat dry gently.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Instructions:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Best before 24 months from the date of manufacturing&lt;/p&gt;', '', 'Veet Hair Removal', '', ''),
