(139, 4, 'Venus Satin Care', '&lt;p&gt;Venus razor blades are spaced close together which adjust to a woman’s natural contours. This way, each razor blade stays in contact with the skin for a curve-hugging, close shave. The Venus Embrace Refillable razor uses 5 blades surrounded by a Ribbon of Moisture for extra glide.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Suggested for use:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Arms, Under arms and Legs&lt;/p&gt;', '', 'Venus Satin Care', '', ''),
