(159, 3, 'Cascade Dishwasher', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Cascade Dishwasher is used to clean the dishes.It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Ingredients:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Sodium Carbonate, Sodium Silicate and Enzymes.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Warnings:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keep out of reach of &amp;nbsp;children and eyes. &amp;nbsp;Do not put it on skin or clothing. First aid treatment: Contains sodium carbonate, sodium silicate and enzymes. If swallowed, give a glassful of water and call a poison control center or doctor immediately. Do not induce vomiting. If in eyes, rinse with water for 15 minutes. If on skin, rinse well with water.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Directions to use:&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;1 Concentrated Pouch = 1 Load&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp;Dry Hands Before Handling&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp;Do Not Unwrap Or Puncture Pac (It Dissolves Quickly In Water)&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp;Place One Pac In The Main Dispenser Cup And Close Dispenser Door&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp;Let It Do The Cleaning&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Reseal Tub After Each Use Storage: Shelf Life: 180 days.&lt;/span&gt;&lt;/p&gt;', '', 'Cascade Dishwasher', '', ''),
