(183, 4, 'Fresh Fruit Pack', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;These fruits are enriched with vitamins and minerals and contains high quantity of water which prevents from de-hydration and keeps the body fresh and cool.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Fresh Fruit Pack', '', ''),
(183, 1, 'Fresh Fruit Pack', '&lt;p&gt;These fruits are enriched with vitamins and minerals and contains high quantity of water which prevents from de-hydration and keeps the body fresh and cool.&amp;nbsp;&lt;/p&gt;', '', 'Fresh Fruit Pack', '', ''),
(183, 3, 'Fresh Fruit Pack', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;These fruits are enriched with vitamins and minerals and contains high quantity of water which prevents from de-hydration and keeps the body fresh and cool.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Fresh Fruit Pack', '', ''),
(179, 1, 'Green Gram', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Green Gram sprouts are healthy to consume. They are enriched with proteins and fibers, vitamins, calcium and potassium. The sprouted beans are enriched in nutrients. It\'s regular consuming helps in maintaining healthy body and nutrition.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Green Gram', '', ''),
(77, 1, 'Cabbage', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Description:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Cabbage is a leafy vegetable which has round shape and has many iterative layers. It contains vitamins k, C and B6.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Benefits:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;It has many health benefits such as it helps in fighting against obesity, headaches, stomach pain, constipations, skin and eye disorders.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Directions:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keep Refrigerated.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Can be consumed within a week if kept in cool and dry place.&lt;/p&gt;', '', 'Cabbage', '', ''),
(175, 3, 'Organic Mango', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp;Organic Mangoes, the king of fruits. This is a seasonal fruit and arrives in summer. It is enriched with antioxidants which helps in protecting against cholesterol and colon. It has many benefits like improves eye sight, clears skin, improves digestion and helps in fighting against heat stroke.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Mango', '', ''),
(176, 1, 'Organic Coconut', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;The organic coconuts are healthy. They are not just good in taste, but also healthy when it comes to health benefits. These organic coconuts help in building the immune system of the body and helps in growth of the body. The organic coconuts are completely safe and organic.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Coconut', '', ''),
(184, 4, 'Musk Melon', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Musk Melon is enriched in vitamins, minerals and potassium. It is round in shape with musky smell and has inner flesh in orange color. Consuming melon helps in preventing the body from de-hydration.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Benefits:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;It helps in reducing the weight.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Prevents from heat.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;It is good for skin.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;How to Use:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;It can be eaten fresh.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Must be placed in cool and dry place.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keep in refrigerator.&lt;/p&gt;', '', 'Musk Melon', '', ''),
(184, 1, 'Musk Melon', '&lt;p&gt;Musk Melon is enriched in vitamins, minerals and potassium. It is round in shape with musky smell and has inner flesh in orange color. Consuming melon helps in preventing the body from de-hydration.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Benefits:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;It helps in reducing the weight.&lt;/p&gt;&lt;p&gt;Prevents from heat.&lt;/p&gt;&lt;p&gt;It is good for skin.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;How to Use:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;It can be eaten fresh.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Must be placed in cool and dry place.&lt;/p&gt;&lt;p&gt;Keep in refrigerator.&lt;/p&gt;', '', 'Musk Melon', '', '');
