(193, 3, 'La Opala diva Dazzle púrpura', 'Se compone de ópalo, libre de ceniza de hueso. - Material La Opala y es resistente a manchas de material resistente, no poroso y no tóxico. Por lo tanto lo que es higiénico de usar. - Peso ligero: fácil de usar.', '', 'Laopala Diva Dazzle Purple', 'La Opala diva Dazzle púrpura 2', ''),
(193, 4, 'لا سے Opala دوا کی چکاچوند جامنی', '&lt;p&gt;ایس ای compone ڈی ópalo، اتارنا، مفت ڈی ceniza ڈی hueso. - مواد لا سے Opala Y ES resistente ایک manchas ڈی مواد resistente، کوئی poroso Y کوئی tóxico. براہ بیشک سے Tanto سے Lo Que سوں higiénico ڈی USAR. - پیسو ligero: آسان ڈی USAR.&lt;br&gt;&lt;/p&gt;', '', 'لا سے Opala دوا کی چکاچوند جامنی', 'لا سے Opala دوا کی چکاچوند جامنی 2', ''),
(193, 1, 'Laopala Diva Dazzle Purple', '&lt;p&gt;It is made up of opal, free from bone ash. - La Opala material &amp;nbsp;and is Stain Resistant, non porous &amp;amp; non toxic material. Thus making it hygienic to use. - Lightweight:Easy to use.&lt;br&gt;&lt;/p&gt;', '', 'Laopala Diva Dazzle Purple', 'Laopala Diva Dazzle Purple 1', 'Laopala Diva Dazzle Purple 2'),
(194, 4, 'Boscia سے Cuidado DE LA Piel کی', '&lt;p&gt;ڈار ایک ایس یو Piel کی اقوام متحدہ brillo saludable کون Melocotón Leche Hidratante ڈی لکمی کون SPF 24 PA ++. سے Esta crema کے hidratante contiene 7 agentes hidratantes، vitaminas esenciales، 4 Y 3 antioxidantes پیرا proteger ای hidratar لا Piel کی.&lt;br&gt;&lt;/p&gt;', '', 'Boscia سے Cuidado DE LA Piel کی 1', 'Boscia سے Cuidado DE LA Piel کی 2', 'protección DE LA Piel کی'),
(194, 1, 'Boscia Skin Care ', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: verdana, arial, helvetica, sans-serif; font-size: small; line-height: normal;&quot;&gt;Give your skin a healthy glow with Lakme\'s Peach Milk Moisturizer with SPF 24 PA++. This moisturizer contains 7 hydrating agents, 4 essential vitamins, and 3 anti-oxidants to protect and moisturize your skin.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Boscia Skin care1', 'Boscia Skin care2', 'skin care'),
(194, 3, 'Boscia Cuidado de la Piel', '&lt;p&gt;Dar a su piel un brillo saludable con Melocotón Leche Hidratante de Lakme con SPF 24 PA ++. Esta crema hidratante contiene 7 agentes hidratantes, vitaminas esenciales, 4 y 3 antioxidantes para proteger e hidratar la piel.&lt;br&gt;&lt;/p&gt;', '', 'Boscia cuidado de la piel 1', 'Boscia cuidado de la piel 2', 'protección de la piel'),
(195, 4, 'Kaya کی جلد کریم', '&lt;p&gt;فیئرنیس رینج روشن چمک جلد کے لئے Kaya کی خصوصی جلد کی دیکھ بھال کی حکومت ہے. مختلف قوی actives کے کا انوکھا ملاپ moisturize اور جلد کو جوان کرنے کے لئے ڈیزائن کیا گیا ہے.&lt;br&gt;&lt;/p&gt;', '', 'فیئرنیس پرورش دن کریم', 'جسمانی سکن خصوصی دیکھ بھال', 'Kaya کی جلد کی خصوصی دیکھ بھال کی مصنوعات'),
(195, 1, 'Kaya  Skin cream', '&lt;p&gt;&lt;span style=&quot;color: rgb(96, 96, 96); font-family: Arial, Helvetica, sans-serif; line-height: 18px;&quot;&gt;Fairness&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(96, 96, 96); font-family: Arial, Helvetica, sans-serif; line-height: 18px;&quot;&gt;range is Kaya\'s special skin care regime for brighter glowing skin.&amp;nbsp; Its unique combination of various potent actives has been designed to moisturize and rejuvenate the skin.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Fairness nourishing day cream', 'Kaya Skin special care', 'Kaya Skin special care product'),
(195, 3, 'Crema para la piel Kaya', '&lt;p&gt;gama equidad es régimen de cuidado de la piel especial de Kaya para la piel que brilla intensamente brillante. Su combinación única de varios principios activos potentes ha sido diseñado para hidratar y rejuvenecer la piel.&lt;br&gt;&lt;/p&gt;', '', 'Equidad crema de día nutritiva', 'Kaya piel un cuidado especial', 'Piel Kaya producto de cuidado especial'),
(196, 4, 'فائبر کراکری', '&lt;p&gt;بھارت کی واحد پریمیم سے curated لائن گھر کی سجاوٹ سٹور. رات کے کھانے کے سیٹ کے پریمیم اور ڈیزائنر رینج، ڈھیلے برتن،&lt;br&gt;&lt;/p&gt;', '', 'فائبر کراکری سیٹ', 'رات کے کھانے کے سیٹ کے پریمیم اور ڈیزائنر رینج، ڈھیلے برتن،', ''),
(196, 1, 'Fiber crockery', '&lt;p&gt;&amp;nbsp;India\'s only premium curated online home decor store. Premium and designer range of dinner sets, loose dinnerware,&lt;br&gt;&lt;/p&gt;', '', 'Fiber Crockery set', ' Premium and designer range of dinner sets, loose dinnerware,', 'Crockery'),
(196, 3, 'vajilla de fibra', '&lt;p&gt;prima única de la India curada tienda de decoración para el hogar en línea. gama Premium y diseñador de vajillas, servicio de mesa suelta,&lt;br&gt;&lt;/p&gt;', '', 'vajilla de fibra', 'gama Premium y diseñador de vajillas, servicio de mesa suelta,', ''),
(197, 4, 'كارشر FP303 600 وات الطابق الملمع', '&lt;p&gt;الملمع الطابق تقدم حلا كاملا لرعاية الأمثل والحفاظ على قيمة لمنصات جودة تلميع floors.High الصلبة ومنتجات الرعاية المختلفة للجميع الأرضيات الحق في الجمع&lt;br&gt;&lt;/p&gt;', '', 'كارشر FP303 600 وات الطابق الملمع', '', ''),
(197, 1, 'Karcher FP303 600-Watt Floor Polisher', 'The floor polisher offers a complete solution for the optimal care and conservation of value for hard floors.High quality polishing pads and various care products for everyone flooring the right combination', '', 'Karcher FP303 600-Watt Floor', '', ''),
(197, 3, 'Limpiadores para pisos y fenilos...', '&lt;p&gt;El pulidor de piso ofrece una solución completa para el cuidado y la conservación óptima de valor para los tampones para pulir la calidad floors.High duros y diversos productos de cuidado para todos suelos de la combinación correcta&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores para pisos y fenilos...', '', ''),
(119, 3, 'Almond', '&lt;p&gt;Almonds are storehouses of nutrition of all the tree nuts, they have the highest amounts of proteins, fibers, calcium and vitamins B2 B3. They are naturally low in sugar and unhealthy fats. Almonds help prevent cardiovascular diseases, promote gastrointestinal health, aids in weight loss, and helps prevent hair loss.&lt;br&gt;&lt;/p&gt;', '', 'Almond', '', ''),
(85, 3, 'Mamy poko Pants', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Key Features:&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Avoids irritation and rashes&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keeps Skin Dry&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;High POWER OF ABSORBING LIQUID&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Baby feels fresh and cheerful all day long&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Soft elastic with comfortable fit&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Items Included:&lt;/span&gt;&amp;nbsp;48 pieces of pamper pants&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mamy poko Pants', '', ''),
