(203, 4, 'ناتو غنية بالمياه المعدنية الطبيعية', '&lt;p&gt;ناتو غنية - المياه المعدنية الطبيعية النقية من جبال الهيمالايا. المعادن الطبيعية المحفوظة من جبال الهيمالايا.&lt;br&gt;&lt;/p&gt;', '', 'مياه معدنية', '', ''),
(203, 1, 'Naturich Natural Mineral Water', '&lt;p&gt;&lt;span style=&quot;color: rgb(90, 90, 91); font-family: Arial, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, sans-serif;&quot;&gt;Naturich - Pure Natural Mineral Water from Himalayas. Preserved natural minerals from the Himalayas.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mineral Water', '', ''),
(203, 3, 'Naturich Agua Mineral Natural', '&lt;p&gt;Naturich - Agua mineral natural pura del Himalaya. Minerales naturales preservados de los Himalayas.&lt;br&gt;&lt;/p&gt;', '', 'Agua mineral', '', ''),
(204, 4, 'زجاجة المياه المعدنية ريال عماني', '&lt;p&gt;نحن نقدم ريال عماني زجاجة المياه المعدنية لعملائنا&lt;br&gt;&lt;/p&gt;', '', 'مياه معدنية', '', ''),
(204, 1, ' RO Mineral Water Bottle', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 17px;&quot;&gt;We are offering RO Mineral Water Bottle to our clients.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mineral Water', '', ''),
(204, 3, 'Botella de agua mineral RO', '&lt;p&gt;Estamos ofreciendo RO Botella de agua mineral a nuestros clientes&lt;br&gt;&lt;/p&gt;', '', 'Agua mineral', '', ''),
(205, 4, 'سلطة فول تنبت مع البقدونس وزيت الزيتون', '&lt;p&gt;براعم الفاصوليا المختلطة ، براعم الغرام ، الخيار ، طماطم الكرز ، البقدونس ، اشارات الخس ، البقدونس مع زيت الزيتون ، صلصة الليمون&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لتذوق السلطة', '', ''),
(205, 1, 'Bean sprout salad with parsley and olive oil dressing', '&lt;p&gt;Mixed bean sprouts, gram sprouts, cucumber, cherry tomato, parsley, hint of lettuce, parsley with olive oil, lemon dressing&lt;br&gt;&lt;/p&gt;', '', 'Ready To Eat Salads', '', ''),
(205, 3, 'Ensalada de brotes de frijoles con aderezo de perejil y aceite de oliva', '&lt;p&gt;Brotes de soja mezclados, brotes de gram, pepino, tomate cherry, perejil, un toque de lechuga, perejil con aceite de oliva, aderezo de limón&lt;br&gt;&lt;/p&gt;', '', 'Ensaladas listas para comer', '', ''),
(206, 3, 'César Veg', '&lt;p&gt;Lechuga, picatostes, queso parmesano con aderezo César Calorías con aderezo&lt;br&gt;&lt;/p&gt;', '', 'Ensaladas listas para comer', '', ''),
(206, 4, 'قيصر الخضار', '&lt;p&gt;خس ، خبز محمص ، جبنة بارميزان مع صلصة سيزر السعرات الحرارية مع خلع الملابس&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لتذوق السلطة', '', ''),
(207, 3, 'Lechuga y hierba requesón', '&lt;p&gt;Lechuga variada, queso cottage con hierbas, pimientos, tomates cherry con aderezo de mostaza y miel&lt;br&gt;&lt;/p&gt;', '', 'Ensaladas listas para comer', '', ''),
(207, 4, 'خس و جبنة عشب', '&lt;p&gt;خس مشكل ، جبنة كستناء عشبية ، فلفل ألوان ، طماطم كرزية مع صوص الخردل بالعسل&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لتذوق السلطة', '', ''),
(208, 3, 'Ensalada del Medio Oriente con aderezo de menta limón Za\'atar', '&lt;p&gt;Surtido de lechuga, tomate, rábano, pimientos rojos, pepino, perejil con aderezo de menta y limón za\'atar&lt;br&gt;&lt;/p&gt;', '', 'Ensaladas listas para comer', '', ''),
(208, 4, 'سلطة الشرق الأوسط مع صلصة الزعتر بالليمون والنعناع', '&lt;p&gt;خس ، طماطم ، فجل ، فلفل أحمر ، خيار ، بقدونس مع صلصة زعتر ليمون بالنعناع&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لتذوق السلطة', '', ''),
(209, 3, 'COCA-COLA', '&lt;p&gt;Coca-Cola es el refresco más popular y de mayor venta en la historia, así como una de las marcas más reconocibles en el mundo.&lt;br&gt;&lt;/p&gt;', '', 'Listo para beber', '', ''),
(209, 4, 'كوكا كولا', '&lt;p&gt;كوكا كولا هي المشروب الغازي الأكثر شعبية والأكثر مبيعا في التاريخ ، فضلا عن واحدة من العلامات التجارية الأكثر شهرة في العالم.&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لشرب', '', ''),
(210, 4, 'شبح', '&lt;p&gt;تم إطلاقه في عام 1970 ، وهو مشروب غازي بنكهة الليمون والليمون الرائد في العالم. يباع العفريت في أكثر من 190 دولة ويحتل المرتبة رقم 3 في المشروبات الغازية في جميع أنحاء العالم.&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لشرب', '', ''),
(210, 1, 'SPRITE', '&lt;p&gt;&lt;span style=&quot;color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;Introduced in 1970, Sprite is the world\'s leading lemon-lime flavored soft drink. Sprite is sold in more than 190 countries and ranks as the No. 3 soft drink worldwide.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ready To Drink', '', ''),
(210, 3, 'DUENDE', '&lt;p&gt;Introducido en 1970, Sprite es el refresco con sabor a lima-limón líder en el mundo. Sprite se vende en más de 190 países y se clasifica como el No. 3 en el mundo.&lt;br&gt;&lt;/p&gt;', '', 'Listo para beber', '', ''),
(211, 3, 'FANTA', '&lt;p&gt;Introducida en 1950, Fanta es la segunda marca más antigua de The Coca-Cola Company y nuestra segunda marca más grande fuera de los EE. UU. Fanta Orange es el sabor líder, pero casi todas las frutas cultivadas están disponibles como sabor Fanta en alguna parte.&lt;br&gt;&lt;/p&gt;', '', 'Listo para beber', '', ''),
(211, 4, 'خليل', '&lt;p&gt;تأسست فانتا عام 1950 ، وهي ثاني أقدم علامة تجارية لشركة كوكا كولا وثاني أكبر علامة تجارية خارج الولايات المتحدة. فانتا أورانج هي النكهة الرائدة ولكن كل الفاكهة المزروعة تتوفر كنكهة فانتا في مكان ما.&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لشرب', '', ''),
(212, 3, 'DIETA COKE', '&lt;p&gt;Diet Coke, también conocido como Coca-Cola light en algunos mercados, es una bebida sin azúcar y sin calorías. Se introdujo por primera vez en los Estados Unidos el 9 de agosto de 1985, como la primera marca nueva desde 1886 en utilizar Coca-ColaTrademark.&lt;br&gt;&lt;/p&gt;', '', 'Listo para beber', '', ''),
(212, 4, 'كولا للحمية', '&lt;p&gt;نظام &quot;دايت كوك&quot; ، المعروف أيضًا باسم &quot;كوكا كولا&quot; في بعض الأسواق ، هو مشروب غازي خالي من السكر والكالوريات. تم تقديمه لأول مرة في الولايات المتحدة في 9 أغسطس 1985 ، كأول علامة تجارية جديدة منذ عام 1886 لاستخدام كوكا كولتراديمارك.&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لشرب', '', ''),
(213, 3, 'ROJO, NARANJA, AMARILLO Y (ALGUNOS) VERDURAS VERDES', '&lt;p&gt;Estas coloridas verduras son una de las mejores fuentes de carotenoides. Este poderoso antioxidante es vital para la salud de los ojos y resiste bien la cocción a altas temperaturas.&lt;br&gt;&lt;/p&gt;', '', 'Listo para cocinar verduras', '', ''),
(213, 4, 'الأحمر والبرتقالي والأصفر والوردي الأخضر (بعض)', '&lt;p&gt;هذه الخضار الملونة هي واحدة من أفضل مصادر الكاروتينات. هذا مانع للتأكسد قوي أمر حيوي لصحة العين - وهو يقف بشكل جيد للطهي في حرارة عالية.&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لطهي الخضار', '', ''),
(214, 3, 'VERDURAS VERDES HOJAS', '&lt;p&gt;Los vegetales crudos y frondosos contienen ácido oxálico, un compuesto orgánico que evita que su cuerpo absorba el calcio y el hierro saludables que sirven, explica Levinson.&lt;br&gt;&lt;/p&gt;', '', 'Vegetales listos para cocinar', '', ''),
(214, 4, 'ليفي غرين ريغز', '&lt;p&gt;يحتوي الخضر الخام المورق على حمض الأكساليك ، وهو مركب عضوي يمنع الجسم من امتصاص الكالسيوم الصحي والحديد الذي يقدمه ، ويوضح ليفنسون.&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لطهي الخضار', '', ''),
(215, 3, 'VEGGIAS PÚRPURAS', '&lt;p&gt;Los vegetales morados contienen fitoquímicos llamados antocianinas que son antiinflamatorios y pueden reducir el riesgo de enfermedad cardíaca y cáncer &quot;, dice Pine.&lt;br&gt;&lt;/p&gt;', '', 'Listo para cocinar verduras', '', ''),
(215, 4, 'خامات بيربل', '&lt;p&gt;تحتوي الخضراوات البنفسجية على مواد كيميائية كيميائية تسمى الأنثوسيانين المضادة للالتهابات وقد تقلل من خطر الإصابة بأمراض القلب والسرطان.&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لطهي الخضار', '', ''),
(216, 3, 'VEGETALES CRUCIFEROS', '&lt;p&gt;Vístase con una cucharada de aceite para ayudar a su cuerpo a absorber las vitaminas solubles en grasa de los vegetales.&lt;br&gt;&lt;/p&gt;', '', 'Vegetales listos para cocinar', '', ''),
(216, 4, 'كروكيفيروسوس غريغس', '&lt;p&gt;ارتدي ملعقة كبيرة من الزيت لمساعدة جسمك على امتصاص الفيتامينات القابلة للذوبان في الدهون.&lt;br&gt;&lt;/p&gt;', '', 'على استعداد لطهي الخضار', '', ''),
(217, 3, 'Cereza pelada', '&lt;p&gt;Esta cereza pelada de aspecto venoso&lt;br&gt;&lt;/p&gt;', '', 'Cortar &amp; amp; Frutas peladas', '', ''),
(217, 4, 'الكرز المقشر', '&lt;p&gt;هذا الكرز مقشر عنقي&lt;br&gt;&lt;/p&gt;', '', 'قص &amp; أمبير ؛ ثمار مقشرة', '', ''),
(218, 3, 'sandía pelada', '&lt;p&gt;Esta sandía pelada te hará decir &quot;no sé cómo me siento sobre esto&quot;.&lt;br&gt;&lt;/p&gt;', '', 'Cortar &amp; amp; Frutas peladas', '', ''),
(218, 4, 'مقشر البطيخ', '&lt;p&gt;هذا البطيخ المقشر الذي سيجعلك تقول &quot;أتساءل كيف أشعر حول هذا&quot;.&lt;br&gt;&lt;/p&gt;', '', 'قص &amp; أمبير ؛ ثمار مقشرة', '', ''),
(218, 1, ' Peeled watermelon', '&lt;h3 class=&quot;subbuzz__title  xs-mb1 bold&quot; style=&quot;box-sizing: inherit; margin-right: 0px; margin-bottom: 1rem; margin-left: 0px; padding: 0px; line-height: 1.2;&quot;&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-family: &amp;quot;Proxima Nova&amp;quot;, Helvetica, Arial, sans-serif; font-size: 19.5px; font-weight: 600;&quot;&gt;This peeled watermelon that will make you say &quot;idk how I feel about this&quot;.&lt;/span&gt;&lt;br&gt;&lt;/h3&gt;', '', 'Cut &amp;amp; Peeled Fruits', '', ''),
(219, 3, 'Cuña pelada', '&lt;p&gt;Esta cuña pelada de clementina que parece ... squidgy.&lt;br&gt;&lt;/p&gt;', '', 'Cortar &amp; amp; Frutas peladas', '', ''),
(219, 4, 'إسفين مقشر', '&lt;p&gt;هذا الإسفنج المقشر من الكليمنتين الذي يبدو.&lt;br&gt;&lt;/p&gt;', '', 'قص &amp; أمبير ؛ ثمار مقشرة', '', ''),
(220, 3, 'Paquetes faciales de mango para una piel sana este verano', '&lt;p&gt;Los mangos son de gran importancia para los budistas. Lo consideran sagrado porque el Buda estaba acostumbrado a descansar en los exuberantes huertos de mangos.&lt;br&gt;&lt;/p&gt;', '', 'Mangos', '', ''),
(221, 4, 'مانجو بابادو مانجو فاكهة', '&lt;p&gt;في جنوب الهند ، تمت الإشارة إلى المانجو باسم آم كااي في التاميل ، والتي أصبحت أما كاي بسبب العديد من اللهجات المحلية في الجنوب. في مكان ما على طول الخط ، بدأت يشار إليها باسم مانجا.&lt;br&gt;&lt;/p&gt;', '', 'المانجو', '', ''),
(221, 1, 'Aam Papad Mango Fruit', '&lt;p&gt;.In South India, mangoes were referred to as aam-kaay in Tamil, which became maam-kaay owing to the many local dialects down south. Somewhere along the line, it started getting referred to as maanga.&lt;br&gt;&lt;/p&gt;', '', 'Mangoes', '', ''),
(221, 3, 'Mango papad fruta de mango', '&lt;p&gt;.En el sur de la India, los mangos se denominaban aam-kaay en tamil, que se convirtieron en ma am-kaay debido a los muchos dialectos locales que se encuentran hacia el sur. En algún lugar a lo largo de la línea, comenzó a ser conocido como maanga.&lt;br&gt;&lt;/p&gt;', '', 'Mangos', '', ''),
(222, 3, 'Comiendo mangos', '&lt;p&gt;Los marineros portugueses fueron atraídos con los mangos que tomaron la fruta y sus semillas y la introdujeron en muchos otros países que nunca habían probado la fruta.&lt;br&gt;&lt;/p&gt;', '', 'Mangos', '', ''),
(222, 4, 'تناول المانجو', '&lt;p&gt;كان البرتغاليون الذين يرتادون البحر يجذبهم المانجو لدرجة أنهم أخذوا الثمرة وبذورها وقدموها إلى العديد من البلدان الأخرى التي لم تذوق الفاكهة أبداً.&lt;br&gt;&lt;/p&gt;', '', 'المانجو', '', ''),
(223, 3, 'Tomates asados', '&lt;p&gt;Rocíe con aceite de oliva y vinagre balsámico. Espolvoree el ajo, el azúcar, la sal y la pimienta sobre los tomates.&lt;br&gt;&lt;/p&gt;', '', 'Patatas, cebollas y amp; Tomates', '', ''),
(223, 4, 'طماطم محمصة', '&lt;p&gt;رذاذ مع زيت الزيتون والخل البلسمي. يرش الثوم والسكر والملح والفلفل فوق الطماطم.&lt;br&gt;&lt;/p&gt;', '', 'البطاطس والبصل والطماطم', '', ''),
(224, 3, 'Tomates cherry asados', '&lt;p&gt;Mezcle los tomates ligeramente con aceite de oliva en una sartén. Extiéndalos en una capa y espolvoree generosamente con sal y pimienta kosher.&lt;br&gt;&lt;/p&gt;', '', 'Patatas, cebollas y amp; Tomates', '', ''),
(224, 4, 'تفحم الطماطم الكرز', '&lt;p&gt;إرم الطماطم بزيت الزيتون على وعاء. انتشرها في طبقة واحدة ورش بسخاء مع الملح والفلفل كوشير.&lt;br&gt;&lt;/p&gt;', '', 'البطاطس والبصل والطماطم', '', ''),
(225, 3, 'Patatas asadas con ajo', '&lt;p&gt;Cortar las papas por la mitad o cuartos y colocar en un recipiente con aceite de oliva, sal, pimienta y ajo; mezcle hasta que las papas estén bien cubiertas.&lt;br&gt;&lt;/p&gt;', '', 'Patatas, cebollas y amp; Tomates', '', ''),
(225, 4, 'بطاطس محمرة بالثوم', '&lt;p&gt;تُقطّع البطاطا إلى نصفين أو ربعين وتُوضع في وعاء مع زيت الزيتون والملح والفلفل والثوم. قذف حتى يتم طلاء البطاطا جيدا.&lt;br&gt;&lt;/p&gt;', '', 'البطاطس والبصل والطماطم', '', ''),
(226, 3, 'Coliflor', '&lt;p&gt;La coliflor ha tenido bastante resurgimiento en los últimos tiempos, ya que su versatilidad y capacidad para reemplazar muchos platos de granos ha ganado popularidad.&lt;br&gt;&lt;/p&gt;', '', 'Repollo, coliflor, brócoli', '', ''),
(226, 4, 'قرنبيط', '&lt;p&gt;لقد حققت القرنبيط عودة قوية في الآونة الأخيرة ، حيث اكتسبت تنوعها وقدرتها على استبدال العديد من أطباق الحبوب شعبية.&lt;br&gt;&lt;/p&gt;', '', 'الملفوف ، القرنبيط ، القرنبيط', '', ''),
(227, 3, 'Repollo', '&lt;p&gt;En estos días puede obtener su col llena de repollo con más de la variedad verde que domina los supermercados.&lt;br&gt;&lt;/p&gt;', '', 'Repollo, coliflor, brócoli', '', ''),
(227, 4, 'الكرنب', '&lt;p&gt;في هذه الأيام يمكنك الحصول على ملء الملفوف الخاص بك مع أكثر من التنوع الأخضر الذي يسيطر على محلات السوبر ماركت.&lt;br&gt;&lt;/p&gt;', '', 'الملفوف ، القرنبيط ، القرنبيط', '', ''),
(228, 3, 'Brócoli', '&lt;p&gt;Quizás la brassica favorita de todos, tome unos minutos para repasar los aspectos básicos de la cocina de este vegetal.&lt;br&gt;&lt;/p&gt;', '', 'Repollo, coliflor, brócoli', '', ''),
(228, 4, 'بروكلي', '&lt;p&gt;ربما كل شخص يفضل براسيكا ، يستغرق بضع دقائق لتنظيف أساسيات طبخ هذه الخضروات.&lt;br&gt;&lt;/p&gt;', '', 'الملفوف ، القرنبيط ، القرنبيط', '', ''),
(229, 3, 'Coles de Bruselas', '&lt;p&gt;El tostado, tal vez la forma más popular de preparar este vegetal, ha demostrado que es uno de los vegetales más sabrosos que disfrutamos una vez que el clima se enfría.&lt;br&gt;&lt;/p&gt;', '', 'Repollo, coliflor, brócoli', '', ''),
(229, 4, 'كرة قدم', '&lt;p&gt;وقد أثبت التحميص ، وربما الطريقة الأكثر شعبية لإعداد هذه الخضار ، أنها واحدة من الخضار اللذيذة التي نتمتع بها عندما يبرد الطقس.&lt;br&gt;&lt;/p&gt;', '', 'الملفوف ، القرنبيط ، القرنبيط', '', ''),
(230, 3, 'Maíz bebe', '&lt;p&gt;Este es un producto de todo el año, a menudo importado de México, y está disponible en variedades blancas y amarillas.&lt;br&gt;&lt;/p&gt;', '', 'Verduras de bebé', '', ''),
(230, 4, 'ذرة الطفل', '&lt;p&gt;هذا هو منتج على مدار العام مستورد في أغلب الأحيان من المكسيك ومتوفر في أصناف بيضاء وصفراء.&lt;br&gt;&lt;/p&gt;', '', 'خضروات اطفال', '', ''),
(231, 3, 'Apio de bebé', '&lt;p&gt;Una cosecha de otoño e invierno, el apio bebé es de alrededor de 7 pulgadas de largo con un fuerte sabor de apio.&lt;br&gt;&lt;/p&gt;', '', 'Verduras de bebé', '', ''),
(231, 4, 'كرفس اطفال', '&lt;p&gt;محصول الخريف والشتاء ، الكرفس الطفل هو حوالي 7 بوصات طويلة مع نكهة قوية الكرفس.&lt;br&gt;&lt;/p&gt;', '', 'خضروات اطفال', '', ''),
(232, 3, 'Berenjena francesa', '&lt;p&gt;Febrero a noviembre vía el sur de California. Comúnmente llamada judías verdes, esta sabrosa variedad de judías verdes se desarrolló y popularizó en Francia y recientemente ha ganado atractivo en los Estados Unidos.&lt;br&gt;&lt;/p&gt;', '', 'Verduras de bebé', '', ''),
(232, 4, 'الطفل الفاصوليا الخضراء الفرنسية', '&lt;p&gt;من فبراير إلى نوفمبر عبر جنوب كاليفورنيا. تسمى عادةً بشرائط التريكو ، وقد تم تطوير هذه السلالة اللذيذة من الفاصوليا الخضراء وشاعتها في فرنسا ، وقد اكتسبت مؤخراً جاذبية في الولايات المتحدة.&lt;br&gt;&lt;/p&gt;', '', 'خضروات اطفال', '', ''),
(233, 4, 'زجاجة القرع', '&lt;p&gt;مع اسم مألوف ، تأتي القرع بأشكال وأحجام مختلفة. يعد لحم القرع مليئًا بالماء والمذاق الطري ، نظرًا لكونه واحدًا من أكثر الخضار صحية حوله.&lt;br&gt;&lt;/p&gt;', '', 'القرع ، القرع أفخاذ', '', ''),
(233, 1, ' Bottle Gourd', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;With the common household name \'Lauki\', Bottle gourds come in different shapes and sizes. Considered as one of the healthiest vegetables around, the flesh of bottle gourds are full of water and taste slightly bitter.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Gourds, Pumpkins &amp;amp; Drumsticks', '', ''),
(233, 3, 'Calabaza de botella', '&lt;p&gt;Con el nombre común común \'Lauki\', las calabazas Bottle vienen en diferentes formas y tamaños. Considerado como uno de los vegetales más saludables, la carne de las calabazas está llena de agua y tiene un sabor ligeramente amargo.&lt;br&gt;&lt;/p&gt;', '', 'Calabazas, calabazas y amp; Baquetas', '', ''),
(234, 3, 'Calabaza amarga', '&lt;p&gt;Las más amargas entre todas las frutas, las calabazas amargas vienen con una piel áspera, llena de baches y verde. La carne translúcida blanquecina sabe crujiente con la combinación de las semillas amargas que están presentes en el interior.&lt;br&gt;&lt;/p&gt;', '', 'Calabazas, Pumpkins Drumsticks', '', ''),
(234, 4, 'القرع المر', '&lt;p&gt;الأكثر مرارة بين جميع الفواكه ، والقرع المريرة تأتي مع الجلد الخام ، وعرة وخضراء. يذوق اللحم الشفاف الأبيض الفاتح مقرمشة مع مزيج من البذور المريرة الموجودة في الداخل.&lt;br&gt;&lt;/p&gt;', '', 'القرع ، القرع أفخاذ', '', ''),
(235, 3, 'Calabaza verde', '&lt;p&gt;Fresho te trae corte de calabaza verde con carne de color crema a amarillo y semillas planas y comestibles&lt;br&gt;&lt;/p&gt;', '', 'Calabazas, calabazas y amp; Baquetas', '', ''),
(235, 4, 'القرع الأخضر', '&lt;p&gt;الطازجة يا يجلب لك قطع الأخضر اليقطين مع اللحم الأصفر إلى دسم والبذور مسطحة ، الصالحة للأكل&lt;br&gt;&lt;/p&gt;', '', 'القرع ، القرع أفخاذ', '', ''),
(236, 3, 'Palillo de tambor', '&lt;p&gt;Los palillos tienen vainas largas, oscuras y desiguales que corren a lo largo y pulpa carnosa dentro de la vaina que recubre cada semilla. Estas vainas tienen un ligero sabor amargo combinado con una leve dulzura.&lt;br&gt;&lt;/p&gt;', '', 'Calabazas, calabazas y amp; Baquetas', '', ''),
(236, 4, 'مضرب', '&lt;p&gt;تحتوي الفاصولياء على قرون طويلة وعرة اللون خضراء داكنة تمتد على طولها ولبها اللحم داخل الجراب المغطى بكل بذرة. هذه القرون لها طعم مرير خافت جنبا إلى جنب مع حلاوة طفيفة.&lt;br&gt;&lt;/p&gt;', '', 'القرع ، القرع أفخاذ', '', ''),
(237, 3, 'Torta del bosque negro', '&lt;p&gt;Hecho con crema fresca batida y mezclas de chocolate, Blackforest es el sabor de pastel más codiciado, y el favorito de todos los tiempos de casi todos. Envíe este manjar recién horneado a sus seres queridos hoy. Adecuado para cumpleaños, aniversarios y más ocasiones, etc.&lt;br&gt;&lt;/p&gt;', '', 'Tortas', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(237, 4, 'كيكة الغابة السوداء', '&lt;p&gt;مصنوعة من الكريمة المخفوقة الطازجة ومزيج من الشيكولاتة ، بلاك فورست هي أكثر نكهات الكعكة المفضلة ، والمفضلة لجميع الأشخاص تقريباً. أرسل هذا الطبق الطازج إلى أحبائك اليوم. مناسبة لعيد الميلاد ، والمناسبات السنوية ، والمزيد من المناسبات ، إلخ.&lt;br&gt;&lt;/p&gt;', '', 'كيك', '', ''),
(238, 3, 'Tentador pastel de trufa', '&lt;p&gt;Este pastel es un ejemplo perfecto de \'Belleza Mentiras en Simplicidad\'. Con su base blanda y delicioso glaseado de chocolate, esta trufa de chocolate es un dulce digno de baba para todas las veces que desees disfrutar de algo delicioso.&lt;br&gt;&lt;/p&gt;', '', 'Tortas', '', ''),
(238, 4, 'اغراء كعكة الكمأة', '&lt;p&gt;هذه الكعكة هي مثال مثالي على &quot;الجمال يكمن في البساطة&quot;. مع قاعدته الطينية وشوكولاتةه الفاتنة ، إن هذا التورتة الشوكولا هو ملعقة لذيذة لجميع الأوقات التي ترغب في الخوض فيها بشيء لذيذ.&lt;br&gt;&lt;/p&gt;', '', 'كيك', '', ''),
(239, 3, 'Placer artístico del chocolate', '&lt;p&gt;Esta trufa de chocolate es todo lo que necesitas para agregar un toque especial. La base chocolateada y suave terminó perfectamente con crema de chocolate y el diseño artístico es seguro para complacer a todos en la multitud.&lt;br&gt;&lt;/p&gt;', '', 'Tortas', '', ''),
(239, 4, 'متعة الشوكولاته الفنية', '&lt;p&gt;هذه الشوكولاتة الكمأة هي كل ما تحتاجه لإضافة لمسة خاصة. اكتمال قاعدة الشوكولاتة طريفة تماما مع كريم الشوكولاتة والتصميم الفني ومن المؤكد أن إرضاء الجميع في الحشد.&lt;br&gt;&lt;/p&gt;', '', 'كيك', '', ''),
(240, 3, 'Galletas de mantequilla', '&lt;p&gt;Galletas de mantequilla Danisa&lt;br&gt;&lt;/p&gt;', '', 'Magdalenas, galletas, bizcochos', '', ''),
(240, 4, 'بسكويت الزبدة', '&lt;p&gt;دانيسا زبدة الكوكيز&lt;br&gt;&lt;/p&gt;', '', 'فطائر وكوكيز وبسكويت', '', ''),
(241, 3, 'BRITANNIA PREMIUM BAKE RUSK', '&lt;p&gt;BRITANNIA PREMIUM BAKE RUSK PACKET&lt;br&gt;&lt;/p&gt;', '', 'Magdalenas, galletas, bizcochos', '', ''),
(241, 4, 'برانتانا بيكميوم بيك راسك', '&lt;p&gt;بريتنيو بريميوم باك راكس بوكت&lt;br&gt;&lt;/p&gt;', '', 'فطائر وكوكيز وبسكويت', '', ''),
(242, 3, 'Hornear Rusk', '&lt;p&gt;El bizcocho tostado más sabroso de Britannia.Toma un trozo de bizcocho tostado en tu té y observa cómo se empapa en la cantidad correcta de té, y luego muerde ese trozo de crujiente jugoso.&lt;br&gt;&lt;/p&gt;', '', 'Magdalenas, galletas, bizcochos', '', ''),
(242, 4, 'خبز راسك', '&lt;p&gt;أظن ، وشع الذبابة من قبل بريتانيا. قم بتقطيع شريحة من الشوربة في الشاي الخاص بك ورؤيتها نقع في كمية مناسبة من الشاي ، ثم المضي قدما لدغة في ذلك دعوة الشظية من تشون تشى نيس العصير.&lt;br&gt;&lt;/p&gt;', '', 'فطائر وكوكيز وبسكويت', '', ''),
(243, 3, 'Galleta rellena de Choco', '&lt;p&gt;Galleta rellena Milano Choco&lt;br&gt;&lt;/p&gt;', '', 'Magdalenas, galletas, bizcochos', '', ''),
(243, 4, 'شوكو شغل البسكويت', '&lt;p&gt;ميلانو شوكو شغل البسكويت&lt;br&gt;&lt;/p&gt;', '', 'فطائر وكوكيز وبسكويت', '', ''),
(244, 3, 'Cuajada de cuajada', '&lt;p&gt;Milky Mist Curd Farm Fresh es un rico suministro de calcio y proteínas. Preparado con leche tonificada pasteurizada de mejor calidad para proporcionarle el ancho y la textura adecuados.&lt;br&gt;&lt;/p&gt;', '', 'Cuajada', '', ''),
(244, 4, 'حماقة الرائب', '&lt;p&gt;حليبي ميست كورد فارم فريش هو مصدر غني بالكالسيوم والبروتينات. تم إعداده من حليب منعم أفضل جودة لتزويدك بالعرض والملمس المناسبين.&lt;br&gt;&lt;/p&gt;', '', 'تخثر', '', ''),
(245, 3, 'Nestlé A + Dahi', '&lt;p&gt;Nestlé es una marca que ha existido desde su creación en 1866. Con una historia de innovación y evolución, esta marca crea una serie de productos que forman parte de nuestra vida cotidiana.&lt;br&gt;&lt;/p&gt;', '', 'Cuajada', '', ''),
(245, 4, 'نستله أ + ضاحي', '&lt;p&gt;نستله هي علامة تجارية منذ إنشائها في عام 1866. مع تاريخ من الابتكار والتطور ، تخلق هذه الماركة عددًا من المنتجات التي تشكل جزءًا من حياتنا اليومية.&lt;br&gt;&lt;/p&gt;', '', 'تخثر', '', ''),
(246, 1, 'Nestle A+ Slim Dahi', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Nestle A+ Slim Dahi contains Low Fat and NO added preservatives. Choosing a low-fat diet &amp;amp; physical activities can help meet your fitness goals, so that you Keep Fit, and Look Good.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Curd', '', ''),
(246, 3, 'Nestlé A + Slim Dahi', '&lt;p&gt;Nestlé A + Slim Dahi contiene bajos en grasa y SIN conservantes añadidos. Elegir una dieta baja en grasas y actividades físicas puede ayudarlo a cumplir sus objetivos de acondicionamiento físico, para que se mantenga en forma y luzca bien.&lt;br&gt;&lt;/p&gt;', '', 'Cuajada', '', ''),
(246, 4, 'نستله أ + سليم ضاحي', '&lt;p&gt;نستله + + ضاحي داهي يحتوي على قليل من الدهون والمواد الحافظة المضافة. يمكن أن يساعد اتباع نظام غذائي منخفض الدهون ونشاطات بدنية على تلبية أهداف اللياقة البدنية الخاصة بك ، حتى تتمكن من الحفاظ على لياقتك البدنية ، و تبدو جيدة.&lt;br&gt;&lt;/p&gt;', '', 'تخثر', '', ''),
(247, 3, 'Madre Dairy Dahi', '&lt;p&gt;Nuestra cuajada se arregla utilizando los mejores estándares de calidad para desinfectarla. Es regularmente espeso, confiable y natural sin el uso de conservantes.&lt;br&gt;&lt;/p&gt;', '', 'Cuajada', '', ''),
(247, 4, 'الأم ألبان ضاحي', '&lt;p&gt;يتم ترتيب خثارة لدينا باستخدام أفضل معايير الجودة مما يجعلها تطهير. هو عادة سميكة وموثوقة وطبيعية تفتقر إلى استخدام أي مواد حافظة.&lt;br&gt;&lt;/p&gt;', '', 'تخثر', '', ''),
(248, 3, 'Dabur Hommade', '&lt;p&gt;Dabur Hommade va más allá de su popular gama de pastas de cocina para elevar los gustos de las recetas caseras de la India con Lemoneez.&lt;br&gt;&lt;/p&gt;', '', 'Concentrados', '', ''),
(248, 4, 'دابور هوماد', '&lt;p&gt;يتخطى دابر هوم أكثر من مجموعته الشهيرة من معاجين الطهي لرفع أذواق الوصفات الهندية محلية الصنع مع ليمونيز.&lt;br&gt;&lt;/p&gt;', '', 'مركزات', '', ''),
(249, 3, 'Minute Maid Juice Concentrate', '&lt;p&gt;Agua, azúcar, concentrado de jugo de limón fresco&lt;br&gt;&lt;/p&gt;', '', 'Concentrados', '', ''),
(249, 4, 'تركيز عصير الخازيه', '&lt;p&gt;الماء والسكر والتركيز من عصير الليمون الطازج&lt;br&gt;&lt;/p&gt;', '', 'مركزات', '', ''),
(250, 3, 'Nilgiri Natural', '&lt;p&gt;Proporciona protección a su familia mediante la reducción de los efectos secundarios de los productos químicos, su fórmula natural previene los insectos y gérmenes de los mosquitos y hace que su ambiente sea animado.&lt;br&gt;&lt;/p&gt;', '', 'Concentrados', '', ''),
(250, 4, 'نيلجيري ناتشورال', '&lt;p&gt;يوفر الحماية لعائلتك عن طريق الحد من الآثار الجانبية للكيماويات ، إنها تركيبة طبيعية تمنع الحشرات والجراثيم من البعوض وتجعل بيئتك حية.&lt;br&gt;&lt;/p&gt;', '', 'مركزات', '', ''),
(251, 3, 'CONCENTRADOS DE JUGOS', '&lt;p&gt;La calidad y la disponibilidad están garantizadas según las especificaciones acordadas y un contrato durante todas las temporadas.&lt;br&gt;&lt;/p&gt;', '', 'Concentrados', '', ''),
(251, 4, 'مركزات عصير', '&lt;p&gt;الجودة والتوافر مضمونان على أساس مواصفات متفق عليها وعقد طوال الفصول.&lt;br&gt;&lt;/p&gt;', '', 'مركزات', '', ''),
(252, 3, 'Ponche de mango y piña', '&lt;p&gt;Un enfriador refrescante que se puede disfrutar en cualquier momento, el Quick Fruit Punch se puede preparar en minutos con jugos de frutas listos y helado de vainilla.&lt;br&gt;&lt;/p&gt;', '', 'Jugos de Mango', '', ''),
(252, 4, 'مانجو وأناناس بانش', '&lt;p&gt;مبرد منعش يمكن الاستمتاع به في أي وقت ، يمكن تحضير فاكهة الثمرة السريعة في دقائق باستخدام عصائر الفواكه الجاهزة والآيس كريم الفانيليا.&lt;br&gt;&lt;/p&gt;', '', 'عصائر المانجو', '', ''),
(253, 3, 'Chiles verdes de mango', '&lt;p&gt;¡Un delicioso sorbete dulce y picante helado!&lt;br&gt;&lt;/p&gt;', '', 'Jugos de Mango', '', ''),
(253, 4, 'مانجو جرين تشيليز سوربيت', '&lt;p&gt;حلويات شهية حلوة ومتبلة لذيذة!&lt;br&gt;&lt;/p&gt;', '', 'عصائر المانجو', '', ''),
(254, 3, 'Mango Pasta', '&lt;p&gt;Esta es una ensalada de mangos y pasta poco convencional. El aderezo de esta ensalada tiene un color de sol muy agradable y definitivamente será un éxito cuando se sirve a los huéspedes.&lt;br&gt;&lt;/p&gt;', '', 'Jugos de Mango', '', ''),
(254, 4, 'مانجو باستا', '&lt;p&gt;هذه سلطة غير تقليدية من المانجو والمكرونة. لخلطة هذه السلطة لها لون مشرق للغاية وسوف تكون بالتأكيد ضربة عند تقديمها للضيوف.&lt;br&gt;&lt;/p&gt;', '', 'عصائر المانجو', '', ''),
(255, 3, 'Ponche de frutas', '&lt;p&gt;Una de las bebidas de bienvenida más populares servidas en la mayoría de las fiestas, el Fruit Punch presenta una deliciosa combinación de colores y sabores.&lt;br&gt;&lt;/p&gt;', '', 'Jugos de Mango', '', ''),
(255, 4, 'لكمة الفاكهة', '&lt;p&gt;واحدة من المشروبات الترحيبية الأكثر شعبية تقدم في معظم الحفلات ، تتميز لكمة الفاكهة بمزيج رائع من الألوان والنكهات.&lt;br&gt;&lt;/p&gt;', '', 'عصائر المانجو', '', ''),
(256, 3, 'Minute Maid', '&lt;p&gt;El Minute Maid OJ era sabroso y no demasiado ácido. El sabor general era un poco acuoso pero dulce.&lt;br&gt;&lt;/p&gt;', '', 'Naranja y amp; Jugo de manzana', '', ''),
(256, 4, 'خادمة دقيقة', '&lt;p&gt;وكان خادمة دقيقة اللذيذ وليس حمضية جداً. كان الطعم العام قليلا المائي ولكن الحلو.&lt;br&gt;&lt;/p&gt;', '', 'عصير التفاح البرتقالي', '', ''),
(257, 3, 'Tropicana', '&lt;p&gt;Tal vez esto fue solo un efecto placebo de la marca, pero casi sabía como si hubiera una fruta de la pasión o sabor de mango agregado al jugo de naranja.&lt;br&gt;&lt;/p&gt;', '', 'Naranja y amp; Jugos de manzana', '', ''),
(257, 4, 'تروبيكانا', '&lt;p&gt;ربما كان هذا مجرد تأثير همي للعلامة التجارية ، لكنه كاد يتذوق مثل وجود فاكهة أو نكهة مانجو تضاف إلى عصير البرتقال.&lt;br&gt;&lt;/p&gt;', '', 'عصائر التفاح البرتقالية', '', ''),
(258, 3, 'Batido de Pastel de Manzana', '&lt;p&gt;Todo el sabor y la decadencia de la tarta de manzana, sin el alboroto de hacer una masa de tarta&lt;br&gt;&lt;/p&gt;', '', 'Naranja y amp; Jugos de manzana', '', ''),
(258, 4, 'فطيرة التفاح عصير', '&lt;p&gt;كل نكهة وانحطاط فطيرة التفاح ، ناقص ضجة صنع قشرة فطيرة&lt;br&gt;&lt;/p&gt;', '', 'عصائر التفاح البرتقالية', '', ''),
(259, 3, 'Ginger Hard Apple', '&lt;p&gt;Este cóctel afrutado, brillante, burbujeante y de grandes lotes obtiene su toque característico de la sidra dura&lt;br&gt;&lt;/p&gt;', '', 'Naranja y amp; Jugos de manzana', '', ''),
(259, 4, 'الزنجبيل هارد أبل', '&lt;p&gt;هذا الكوكتيل الفوار ، المشرق ، الشمبانيا ، ذو الأحجام الكبيرة يحصل على ركلة توقيعه من عصير التفاح الصلب&lt;br&gt;&lt;/p&gt;', '', 'عصائر التفاح البرتقالية', '', ''),
(260, 3, 'Bebida Frooti', '&lt;p&gt;Asegura que pueda disfrutar adecuadamente del sabor de los mangos mejor cultivados durante todo el año.&lt;br&gt;&lt;/p&gt;', '', 'Otros jugos', '', ''),
(260, 4, 'فروتى شرب', '&lt;p&gt;يضمن لك الحصول على المتعة من مذاق المانجو الأفضل نموًا على مدار العام.&lt;br&gt;&lt;/p&gt;', '', 'عصائر أخرى', '', ''),
(261, 3, 'Appy Juice', '&lt;p&gt;Appy Fizz consiste en jugo de manzana espumoso y se utiliza como base para cócteles y es una bebida muy apreciada desde los primeros años de vida.&lt;br&gt;&lt;/p&gt;', '', 'Otros jugos', '', ''),
(261, 4, 'عصير التفاح', '&lt;p&gt;يتكون الفوران من عصير التفاح الفوار ويستخدم كأساس الكوكتيل وهو مشروب مشهور مع الحياة المبكرة.&lt;br&gt;&lt;/p&gt;', '', 'عصائر أخرى', '', ''),
(262, 3, 'Agua de coco', '&lt;p&gt;El agua de coco es agua de coco natural embotellada que contiene toda la bondad del agua de coco natural.&lt;br&gt;&lt;/p&gt;', '', 'Otros jugos', '', ''),
(262, 4, 'ماء جوز الهند', '&lt;p&gt;ماء جوز الهند هو ماء جوز الهند الطبيعي المعبأ الذي يحفظ كل خير من ماء جوز الهند الطبيعي.&lt;br&gt;&lt;/p&gt;', '', 'عصائر أخرى', '', ''),
(263, 3, 'Bolsas de té verde Lipton', '&lt;p&gt;El té verde se produce cuando las hojas recién desplumadas se calientan, enrollan / cortan y luego se secan. Las catequinas en las hojas frescas se conservan durante el proceso del té verde, lo que hace que el té verde sea rico en catequinas.&lt;br&gt;&lt;/p&gt;', '', 'Té verde', '', ''),
(263, 4, 'أكياس شاي ليبتون الخضراء', '&lt;p&gt;يتم إنتاج الشاي الأخضر عندما يتم تسخين الأوراق الطازجة أو المدرفلة / المقطوفة ثم يتم تجفيفها. يتم الحفاظ على الكاتيكين في الأوراق الطازجة أثناء عملية الشاي الأخضر ، مما يجعل الشاي الأخضر غني بمضادات الاكسدة.&lt;br&gt;&lt;/p&gt;', '', 'شاي أخضر', '', ''),
(264, 3, 'Tetley Green Tea', '&lt;p&gt;Tetley Green Tea Pure Original Long Leaf&lt;br&gt;&lt;/p&gt;', '', 'Té verde', '', ''),
(264, 4, 'تيتلي جرين تي', '&lt;p&gt;تيتلي جرين تيي بيور أوريجينال لونج ليف&lt;br&gt;&lt;/p&gt;', '', 'شاي أخضر', '', ''),
(265, 3, 'b b Royal Green Tea', '&lt;p&gt;También aumenta el metabolismo que quema calorías y reduce el contenido de grasa en el cuerpo. Beber té verde a diario refresca tu cuerpo y te mantiene saludable.&lt;br&gt;&lt;/p&gt;', '', 'Té verde', '', ''),
(265, 4, 'ب ب الشاي الاخضر الملكي', '&lt;p&gt;كما أنه يزيد من الفوقية التي تحرق السعرات الحرارية ويقلل من محتوى الدهون في الجسم. شرب الشاي الأخضر بشكل يومي ينعش جسمك ويحافظ على صحتك.&lt;br&gt;&lt;/p&gt;', '', 'شاي أخضر', '', ''),
(266, 3, 'Tetley Green Tea', '&lt;p&gt;Tetley Green Tea con refrescante sabor puro y original&lt;br&gt;&lt;/p&gt;', '', 'Té verde', '', ''),
(266, 4, 'تيتلي جرين تي', '&lt;p&gt;تيت لي الشاي الأخضر مع النكهة الأصلية النقية المنعشة&lt;br&gt;&lt;/p&gt;', '', 'شاي أخضر', '', ''),
(267, 3, 'Especial Premium de Cothas Coffee', '&lt;p&gt;El café Cothas te ofrece lo mejor de ambos mundos; el rico sabor y aroma del café de filtro habitual junto con la confianza y la superioridad de un producto verdaderamente de clase mundial.&lt;br&gt;&lt;/p&gt;', '', 'Café molido', '', ''),
(267, 4, 'كوثاس قهوة بريميوم سبيشال', '&lt;p&gt;يوفر لك سرير المهد أفضل ما في العالمين. المذاق الغني والرائحة من قهوة الفلتر المعتادة مع الثقة والتفوق لمنتج عالمي بحق.&lt;br&gt;&lt;/p&gt;', '', 'البن المطحون', '', ''),
(268, 3, 'Café Leo', '&lt;p&gt;Sus granos de café molidos ligeramente tostados ayudan a crear la decocción perfecta para una taza sabrosa, rica y suave que ayuda a rejuvenecer tus sentidos. El empaque nitro mantiene su sabor y aroma frescos y brinda notas sabrosas y de buen gusto. Comience el día con una taza de café fresco y aromático Bru Green Label Coffee.&lt;br&gt;&lt;/p&gt;', '', 'Café molido', '', ''),
(268, 4, 'ليو القهوة', '&lt;p&gt;تساعد حبوب البن المطحونة قليلاً على صنع ديكوتيون مثالي لكوب غني ولذيذ يساعد على تجديد حواسك. تحافظ عبوات نيترو فلو على نكهة ورائحة طازجة توفر ملاحظات غنية وذات ذوق رفيع. ابدأ يومك مع فنجان من قهوة برو جرين ليبل المنعشة والعطرية.&lt;br&gt;&lt;/p&gt;', '', 'البن المطحون', '', ''),
(269, 3, 'Café clásico - Matinee Sundowner', '&lt;p&gt;Classic te trae una mezcla única de granos de Arábica directamente desde las exóticas plantaciones de café hasta tus tazas de café. Experimente la autenticidad del café de calidad premium a través de su rico aroma y gran sabor en su taza diaria para disfrutar con la compañía de sus amigos y familiares.&lt;br&gt;&lt;/p&gt;', '', 'Café molido', '', ''),
(269, 4, 'القهوة الكلاسيكية - ماتي ني سوند المالك', '&lt;p&gt;يقدم لك كلاسيك مزيجًا فريدًا من حبوب أرابيكا مباشرة من مزارع البن الغريبة إلى أكواب القهوة الخاصة بك. جرب أصالة القهوة ذات الجودة الممتازة من خلال روائحها الغنية ومذاقها الرائع في الكوبة اليومية التي يمكنك الاستمتاع بها مع أصدقائك وأفراد عائلتك.&lt;br&gt;&lt;/p&gt;', '', 'البن المطحون', '', ''),
(270, 3, 'Café clásico perfecto', '&lt;p&gt;Classic te trae una mezcla única de granos de Arábica directamente desde las exóticas plantaciones de café hasta tus tazas de café. Experimente la autenticidad del café de calidad premium a través de su rico aroma y gran sabor en su taza diaria para disfrutar con la compañía de sus amigos y familiares.&lt;br&gt;&lt;/p&gt;', '', 'Café molido', '', ''),
(270, 4, 'قهوة كلاسيكية مثالية', '&lt;p&gt;يقدم لك كلاسيك مزيجًا فريدًا من حبوب أرابيكا مباشرة من مزارع البن الغريبة إلى أكواب القهوة الخاصة بك. جرب أصالة القهوة ذات الجودة الممتازة من خلال روائحها الغنية ومذاقها الرائع في الكوبة اليومية التي يمكنك الاستمتاع بها مع أصدقائك وأفراد عائلتك.&lt;br&gt;&lt;/p&gt;', '', 'البن المطحون', '', ''),
(271, 3, 'Té de hierbas Ayusya - Bienestar', '&lt;p&gt;Energiza tu día y mantenerte en forma. Ayuda a perder peso y grasas extra. Ayuda a aliviar la tiroides y ayuda a aliviar el asma. Lleva a cabo su sistema de inmunidad. Purifica tu sangre&lt;br&gt;&lt;/p&gt;', '', 'Té de hierbas', '', ''),
(271, 4, 'شاي الاعشاب - العافية', '&lt;p&gt;ينشط يومك ويحافظ على لياقتك. يساعد على فقدان الوزن والدهون الزائدة. يساعد على التخلص من الغدة الدرقية ، ويساعد على التخلص من الربو ، ويعزز نظام المناعة لديك. ينقي الدم.&lt;br&gt;&lt;/p&gt;', '', 'شاي اعشاب', '', ''),
(272, 3, 'Té de hierbas Teabox - Hibiscus Lemongrass', '&lt;p&gt;Los tés se sellan en la fuente dentro de las 48 horas posteriores a la cosecha. Una tisana artesanal con sabores primaverales robustos. Su licor aterciopelado tiene notas de sabor distintivo de tarta y cítricos con un toque de especias.&lt;br&gt;&lt;/p&gt;', '', 'Té de hierbas', '', ''),
(272, 4, 'الشاي مربع الشاي العشبية - الكركديه عشبة الليمون', '&lt;p&gt;يتم ختم الشاي في المصدر في غضون 48 ساعة من الحصاد. تيسان مصنوع يدوياً بنكهات ربيع قوية. ويحمل خميره المخملي نكهات مميزة من التارت والحمضيات مع لمسة من التوابل.&lt;br&gt;&lt;/p&gt;', '', 'شاي اعشاب', '', ''),
(273, 3, 'Té de hierbas de Octavius - indio', '&lt;p&gt;Esta es una bebida absolutamente natural con una preparación antigua libre de cafeína, que proporciona un alivio instantáneo del resfriado común, tos, dolor de garganta, dolor de cabeza y dolor de cuerpo.&lt;br&gt;&lt;/p&gt;', '', 'Té de hierbas', '', ''),
(273, 4, 'اوكتافيوس شاي الاعشاب - الهندي', '&lt;p&gt;يعد هذا مشروبًا طبيعيًا تمامًا مع إعداد قديم خالٍ من الكافيين ، والذي يمنح الراحة الفورية من نزلات البرد والسعال والتهاب الحلق والصداع وألم الجسم.&lt;br&gt;&lt;/p&gt;', '', 'شاي اعشاب', '', ''),
(274, 3, 'Sri Sri Ayurveda Herbal T - Dadhakri', '&lt;p&gt;Ayuda digestiva, Ir reduce kapha y revive la sed. Cada taza de té de hierbas Madhukari asegura el mismo aroma y sabor de frescura.&lt;br&gt;&lt;/p&gt;', '', 'Té de hierbas', '', ''),
(274, 4, 'سري سري ايورفيدا هيربال تي - داداكري', '&lt;p&gt;مساعدة في الجهاز الهضمي ، تقلل من الكافا وتعيد العطش ، كل كوب من شاي مادو العشبي يضمن نفس نكهة الطعم والذوق.&lt;br&gt;&lt;/p&gt;', '', 'شاي اعشاب', '', ''),
(275, 3, 'Té de hierbas Teabox - Ginger Mint', '&lt;p&gt;Con un ligero color amarillo limón y un aroma medio a menta y notas de jengibre, este té es de cuerpo medio y bien redondeado. Las notas de jengibre fresco y menta son prominentes a lo largo de la copa.&lt;br&gt;&lt;/p&gt;', '', 'Té de hierbas', '', ''),
(275, 4, 'شاي شاي شاي أعشاب - زنجبيل بالنعناع', '&lt;p&gt;مع لون أصفر ليمون خفيف ورائحة متوسطة من أوراق النعناع والزنجبيل ، هذا الشاي متوسط الجسم ومتموج بشكل جيد طوال الوقت. تلاحظ من الزنجبيل الطازج والنعناع بارز طوال طول الكأس.&lt;br&gt;&lt;/p&gt;', '', 'شاي اعشاب', '', ''),
(276, 3, 'Tetley Tea - Regular', '&lt;p&gt;Tetley Original Black Tea&lt;br&gt;&lt;/p&gt;', '', 'Bolsas de té', '', ''),
(276, 4, 'تي تي لاي الشاي - العادية', '&lt;p&gt;تيت لي الشاي الأسود الأصلي&lt;br&gt;&lt;/p&gt;', '', 'أكياس الشاي', '', ''),
(276, 1, 'Tetley Tea - Regular', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Tetley Original Black Tea&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Tea Bags', '', ''),
(277, 3, 'Tetley Masala Tea', '&lt;p&gt;Tetley Original Black Tea&lt;br&gt;&lt;/p&gt;', '', 'Bolsas de té', '', ''),
(277, 4, 'تيتلي ماسالا الشاي', '&lt;p&gt;تيت لي الشاي الأسود الأصلي&lt;br&gt;&lt;/p&gt;', '', 'أكياس الشاي', '', ''),
(278, 3, 'Wagh Bakri Assam Tea', '&lt;p&gt;Es rico en antioxidantes y está empaquetado en innovadoras bolsas sin cámara de doble cámara. Por lo tanto, además de garantizar los beneficios de salud, también promete seguridad.&lt;br&gt;&lt;/p&gt;', '', 'Bolsas de té', '', ''),
(278, 4, 'واغ بكري اسام الشاي', '&lt;p&gt;وهي غنية بمضادات الأكسدة ومعبأة في أكياس مبتكرة مزدوجة خالية من التيلة. وهكذا ، وبصرف النظر عن ضمان الفوائد الصحية ، فإنه يعد أيضا السلامة.&lt;br&gt;&lt;/p&gt;', '', 'أكياس الشاي', '', ''),
(279, 3, 'Tetley Tea - Jengibre', '&lt;p&gt;Tetley Black Tea con sabor natural de jengibre&lt;br&gt;&lt;/p&gt;', '', 'Bolsas de té', '', ''),
(279, 4, 'الشاي تيتلي - الزنجبيل', '&lt;p&gt;شاي أسود مع نكهة الزنجبيل الطبيعية&lt;br&gt;&lt;/p&gt;', '', 'أكياس الشاي', '', ''),
(280, 3, 'Chana Dal', '&lt;p&gt;Popular es nuestra gama de productos básicos de economía doméstica que ofrece su gran calidad y variedad a precios consistentemente bajos.&lt;br&gt;&lt;/p&gt;', '', 'Chana Dal', '', ''),
(280, 4, 'شانا دال', '&lt;p&gt;شعبية هي مجموعة الاقتصاد المنزلي لدينا من المواد الغذائية التي تقدم نوعية كبيرة ومتنوعة بأسعار منخفضة باستمرار.&lt;br&gt;&lt;/p&gt;', '', 'شانا دال', '', ''),
(281, 3, 'bb Royal Organic', '&lt;p&gt;Organic Channa Dal juega la parte vital mientras acompaña arroz o rotis. Es uno de los mejores dals para mejorar el sabor y la pureza después de prepararlo. Lo mejor de Channa Dal es que se pueden completar múltiples platos.&lt;br&gt;&lt;/p&gt;', '', 'Chana Dal', '', ''),
(281, 4, 'ب ب الملكي العضوي', '&lt;p&gt;تلعب شانا دال العضوية الجزء الحيوي أثناء مرافقة الأرز أو الدوار. وهو واحد من أفضل الدال لتحسين الطعم والنقاء بعد إعداده. أرقى شيء عن تشانا دال هو أطباق متعددة يمكن إكمالها.&lt;br&gt;&lt;/p&gt;', '', 'شانا دال', '', ''),
(282, 3, 'bb Royal Channa Dal sin pulir', '&lt;p&gt;Channa dal contiene un sabor dulce suave cuando está cocido y es rico en nutrientes.&lt;/p&gt;&lt;p&gt;El dal sin pulir siempre es una opción más saludable. Puede que no luzca brillante pero le da sabor y aroma natural. Se puede hacer fácilmente en una pasta y el tiempo de cocción también es menor en comparación con los dátiles pulidos.&lt;/p&gt;', '', 'Chana Dal', '', ''),
(282, 4, 'ب ب الملكي تشانا دال غير منقسم', '&lt;p&gt;يحتوي تشانا دال على طعم حلو معتدل عند طهي الطعام وغني بالمغذيات.&lt;/p&gt;&lt;p&gt;دائمًا ما يكون الدال غير المصقول خيارًا صحيًا. قد لا يبدو لامع ولكنه يعطي طعم ورائحة طبيعية. يمكن أن يتم تحويلها إلى معجون بسهولة كما أن وقت الطهي أقل مقارنة بالديلس اللامع.&lt;/p&gt;', '', 'شانا دال', '', ''),
(220, 4, 'باقات المانجو الوجه للبشرة الصحية هذا الصيف', '&lt;p&gt;المانجو ذات أهمية كبيرة للبوذيين. يعتبرونها مقدسة لأن بوذا اعتاد على الراحة في بساتين المانجو الخضراء.&lt;br&gt;&lt;/p&gt;', '', 'المانجو', '', ''),
(283, 3, 'bb Royal Toor Dal', '&lt;p&gt;dal es la forma más utilizada de la lenteja. Se usa en recetas famosas. Contiene una textura espesa gelatinosa o carnosa, y tarda un poco más en cocinar que moong o masoor dal. Está bien para la salud y cumple la energía.&lt;br&gt;&lt;/p&gt;', '', 'Otros Dals', '', ''),
(283, 4, 'ب ب رويال تور دال', '&lt;p&gt;دال هو الشكل الأكثر استخداما للعدس. يتم استخدامه في وصفات الشهيرة. يحتوي على مادة جيلاتينية سميكة أو لحمية ، ويأخذ وقتًا أطول في الطهي من موونج أو ماسور دال. إنه جيد للصحة ويفي بالطاقة.&lt;br&gt;&lt;/p&gt;', '', 'غيرها من دالس', '', ''),
(284, 3, 'Royal Urad Dal', '&lt;p&gt;Urad Whole tiene piel urad dal son de color blanco cremoso y algo sosa. Tiene buen gusto y tiene una importancia significativa como una dieta básica en varias partes del país.&lt;br&gt;&lt;/p&gt;', '', 'Otros Dals', '', ''),
(284, 4, 'رويال أوراد دال', '&lt;p&gt;كله هو دال البشرة دسم بيضاء ورقيقة بعض الشيء. له ذوق رفيع ويحمل أهمية كبيرة كغذاء أساسي في عدة أجزاء من البلاد.&lt;br&gt;&lt;/p&gt;', '', 'غيرها من دالس', '', ''),
(285, 3, 'Lentejas masoor reales', '&lt;p&gt;Masoor Dal es una de las lentejas indias más conocidas. Este dal es sin piel y de color rojo.&lt;br&gt;&lt;/p&gt;', '', 'Otros Dals', '', ''),
(285, 4, 'العدس الملكي', '&lt;p&gt;ماسور دال هو واحد من العدس الهندي الأكثر شهرة. هذا دال هو مع عدم وجود الجلد والأحمر في اللون.&lt;br&gt;&lt;/p&gt;', '', 'غيرها من دالس', '', ''),
(286, 3, 'Popular Moong Dal', '&lt;p&gt;Los frijoles Moong son un alimento popular entre los vegetarianos ya que contienen muchas proteínas y fibra. Es uno de los dals más fáciles de digerir y por esta razón a menudo se administra a personas que se recuperan de una enfermedad, especialmente un malestar estomacal.&lt;br&gt;&lt;/p&gt;', '', 'Moong Dal', '', ''),
(286, 4, 'شعبية مونغ دال', '&lt;p&gt;مونج الفول هو الغذاء الشعبي بين النباتيين لأنه يحتوي على الكثير من البروتينات والألياف. وهو من أسهل الطرق للهضم ، ولهذا السبب غالباً ما يتم إعطاؤه للأشخاص الذين يتعافون من المرض ، وخاصةً اضطراب المعدة.&lt;br&gt;&lt;/p&gt;', '', 'موونج دال', '', ''),
(287, 3, 'Royal Organic', '&lt;p&gt;Moong dal obtendrá de los frijoles Mung. La división moong dal se utiliza en curry indio. Tiene un alto contenido en fibra y proteínas, además de bajo en grasa. Se cultiva sin el uso de pesticidas, fertilizantes artificiales o productos químicos.&lt;br&gt;&lt;/p&gt;', '', 'Moong Dal', '', ''),
(287, 4, 'العضوية الملكية', '&lt;p&gt;سوف تحصل على مونج من حبوب مونج. يتم استخدام الانقسام في الكاري الهندي. وهو غني بالألياف والبروتين ، بخلاف انخفاض الدهون. يزرع هذا بدون استخدام المبيدات أو الأسمدة الصناعية أو الكيماويات.&lt;br&gt;&lt;/p&gt;', '', 'موونج دال', '', ''),
(288, 3, 'Royal Moong Dal', '&lt;p&gt;Moong dal es una de las lentejas más populares que se comen en toda la India. Repleto de proteínas, los paquetes de BB Royal moong dal ofrecen la mejor selección de lentejas que se evidencia por el brillo de las lentejas.&lt;br&gt;&lt;/p&gt;', '', 'Moong Dal', '', ''),
(288, 4, 'رويال مونغ دال', '&lt;p&gt;مونج دال هو واحد من العدس الأكثر شعبية يؤكل في جميع أنحاء الهند. معبأة مع البروتين ، ب ب الملكي حزم مونج دلال تقديم أرقى مجموعة من العدس الذي يتضح من تألق على العدس.&lt;br&gt;&lt;/p&gt;', '', 'موونج دال', '', ''),
(289, 3, 'Haldiram salino - Moong Dal', '&lt;p&gt;Haldirams Moong Dal se hace usando la excelencia de moong y otros elementos. Y tiene un sabor y olor de alta calidad. Este bocadillo salado favorito de todos los tiempos está preparado con lentejas fritas de moong.&lt;br&gt;&lt;/p&gt;', '', 'Moong Dal', '', ''),
(289, 4, 'الكركم الكباش المملح - موونج دال', '&lt;p&gt;الكوم هالدي يتم صنع مونج دال باستخدام التميز في موونج وغيرها من العناصر. ولها طعم ورائحة عالية الجودة. يتم إعداد هذا وجبة خفيفة مملحة المفضلة كل الوقت من العد مونج المقلية.&lt;br&gt;&lt;/p&gt;', '', 'موونج دال', '', ''),
(290, 3, 'DELON Body Wash', '&lt;p&gt;Organic Now BODY WASH usa la naturaleza para tomar, reutilizar y proteger su piel. Este BODY WASH refrescante y perfumado le da a tu piel todos los beneficios del jugo de hoja de Aloe Vera orgánico, dejándolo suave, suave y saludable.&lt;br&gt;&lt;/p&gt;', '', 'Jabón y amp; Gel de baño', '', ''),
(290, 4, 'ديل على هيئة يغسل', '&lt;p&gt;يستخدم الآن الماء العضوي الحيوي المصنوع من الطبيعة الطبيعة لأخذ وتنشيط وحماية بشرتك. يمنحك هذا المستحضر المعطر والمنعش لبشرتك جميع فوائد عصير الألوة فيرا العضوي ، مما يجعله ناعمًا وسلسًا وصحيًا.&lt;br&gt;&lt;/p&gt;', '', 'صابون وغسول جسم', '', ''),
(291, 3, 'Dove Body Wash', '&lt;p&gt;Reponga la humedad en su piel seca con la nutrición de la loción para el cuerpo Dove Go Fresh. Esta loción para manos y cuerpo de Dove, de rápida absorción, consiste en un refrescante aroma de pepino y té verde, junto con una refrescante sensación de mentol que revitaliza tu piel.&lt;br&gt;&lt;/p&gt;', '', 'Jabón y amp; Gel de baño', '', ''),
(291, 4, 'دوف غسول الجسم', '&lt;p&gt;قم بتجديد الرطوبة في بشرتك الجافة مع تغذية غسول الجسم دوف جو فريش. يحتوي غسول اليد والجسم الممتص من دوف على خيار منعش ورائحة الشاي الأخضر ، بالإضافة إلى إحساس منعش بارد ينشط بشرتك!&lt;br&gt;&lt;/p&gt;', '', 'صابون وغسول جسم', '', ''),
(292, 3, 'Jovees Body Wash', '&lt;p&gt;Este gel suave e hidratante para el cuerpo es lujoso y súper esponjoso, por lo que su piel se siente sedosa y suave. Es no secante y perfecto para uso diario.&lt;br&gt;&lt;/p&gt;', '', 'Jabón y amp; Gel de baño', '', ''),
(292, 4, 'جوفز بودي واش', '&lt;p&gt;هذا غسول الجسم اللطيف والمرطب هو كريم فخم فاخر ، مما يجعل بشرتك تشعر بالنعومة والنعومة. انها غير تجفيف والكمال للاستخدام اليومي.&lt;br&gt;&lt;/p&gt;', '', 'صابون وغسول جسم', '', ''),
(293, 3, 'Dettol Body Wash', '&lt;p&gt;Dettol Cool pH balanceado Bodywash con fragancia mentolada crujiente proporciona a Dettols una protección confiable contra los gérmenes de una amplia gama de gérmenes no vistos. Limpia y protege tu piel manteniéndote saludable todos los días.&lt;br&gt;&lt;/p&gt;', '', 'Jabón y amp; Gel de baño', '', ''),
(293, 4, 'ديتول غسول الجسم', '&lt;p&gt;ديتول بارد مع غسول الجسم متوازن مع رائحة المنثول متموج يوفر حماية موثوقة جرثومة حماية الجرثومة من مجموعة واسعة من الجراثيم الغيب. ينظف ويحمي بشرتك تبقيك بصحة جيدة كل يوم.&lt;br&gt;&lt;/p&gt;', '', 'صابون وغسول جسم', '', ''),
(294, 3, 'Park Avenue Deo Talc', '&lt;p&gt;Park Avenue Storm Freshness Deo Talc tiene un potente efecto desodorizante que te mantiene fresco y combate el olor corporal durante todo el día.&lt;br&gt;&lt;/p&gt;', '', 'Dios &amp; amp; cuentos', '', ''),
(294, 4, 'بارك الجادة ديو التلك', '&lt;p&gt;عطر بارك أفينيو ستورم من ديو تالك له تأثير قوي على إزالة الرائحة والذي يبقيك طازجًا ويحارب رائحة الجسم طوال اليوم.&lt;br&gt;&lt;/p&gt;', '', 'الله اند حكايات', '', ''),
(295, 3, 'Talco Navratna', '&lt;p&gt;Navratna Cool Tal - Duniya ka sabse chhota AC, viene como un refrescante descanso de las ofertas de la categoría de talco ordinario, ya que proporciona los beneficios dobles de Cooling + Fragrance.&lt;br&gt;&lt;/p&gt;', '', 'Dios &amp; amp; cuentos', '', ''),
(295, 4, 'ناف راتنا تالاك', '&lt;p&gt;كول التلك ، ويأتي بمثابة استراحة منعشة من العروض من فئة التلك العادية ، لأنه يوفر فوائد مزدوجة للتبريد + العطر.&lt;br&gt;&lt;/p&gt;', '', 'الله اند حكايات', '', ''),
(296, 3, 'Wild Stone Deo Talc', '&lt;p&gt;Talco Deo de piedra silvestre con fragancia ultra masculina creado especialmente por los maestros perfumistas.&lt;br&gt;&lt;/p&gt;', '', 'Dios &amp; amp; cuentos', '', ''),
(296, 4, 'وايلد ستون ديو التلك', '&lt;p&gt;حبر بري مع حجر تركي مميز مصنوع من قبل خبراء العطور.&lt;br&gt;&lt;/p&gt;', '', 'الله اند حكايات', '', ''),
(297, 3, 'Loción Corporal Vlcc', '&lt;p&gt;Crema de masaje VLCC Pista (200 g): crema efectiva de acción múltiple para protección celular e hidratación.&lt;br&gt;&lt;/p&gt;', '', 'Lociones para el cuerpo &amp; amp; Cremas', '', ''),
(297, 4, 'الخامس ل ج ج الجسم غسول', '&lt;p&gt;كريم ل.بي.سي سي بيستا (200 جم): كريم متعدد الفعالية يمنح الحماية الخلوية والترطيب.&lt;br&gt;&lt;/p&gt;', '', 'مرطبات الجسم والكريمات', '', ''),
(298, 3, 'Cuidados Intensivos con Vaselina', '&lt;p&gt;¿Te has preguntado alguna vez cómo conseguir una piel radiante? Cuando la piel está radiante, ayuda a aumentar la confianza en sí mismo y asegura que la piel esté sana, tanto por dentro como por fuera.&lt;br&gt;&lt;/p&gt;', '', 'Lociones para el cuerpo &amp; amp; Cremas', '', ''),
(298, 4, 'فازلين العناية المركزة', '&lt;p&gt;هل سبق لك أن تساءلت عن كيفية الحصول على بشرة متوهجة؟ عندما يكون الجلد مشعًا ، يساعد على تعزيز الثقة بالنفس ويضمن أن البشرة تتمتع بصحة جيدة ، من الداخل والخارج.&lt;br&gt;&lt;/p&gt;', '', 'مرطبات الجسم والكريمات', '', ''),
(299, 3, 'Shea Nourishing Whip', '&lt;p&gt;Ligera y esponjosa, esta loción de crema batida, no grasosa y de rápida absorción, con ingredientes naturales ricos y aterciopelados, se alisa fácilmente sobre la piel, dejándola bien hidratada, suave y flexible. Adecuado para tipos de piel muy secos.&lt;br&gt;&lt;/p&gt;', '', 'Lociones para el cuerpo &amp; amp; Cremas', '', ''),
(299, 4, 'شيا نوريشينغ سوط', '&lt;p&gt;هذا المستحضر الخفيف والممتلئ ، الذي يحتوي على كريمات مخفوقة وغير دهنية ، مع مكونات طبيعية غنية ومخمرة ، ينعم بسهولة على البشرة ، مما يجعلها تشعر بالرطوبة والنعومة والنضارة. مناسبة لأنواع البشرة الجافة جدا.&lt;br&gt;&lt;/p&gt;', '', 'مرطبات الجسم والكريمات', '', ''),
(300, 3, 'Lakme Melocotón Leche', '&lt;p&gt;¿Su piel pierde humedad a medida que pasa el día? Lakme te ofrece un humectante que es una mezcla de melocotones y leche sanos, que nutre la piel profundamente sin que parezca grasosa.&lt;br&gt;&lt;/p&gt;', '', 'Lociones para el cuerpo &amp; amp; Cremas', '', ''),
(300, 4, 'حليب الخوخ في لاك', '&lt;p&gt;هل بشرتك تفقد الرطوبة مع مرور اليوم؟ لاك لي يجلب لك المرطب الذي هو مزيج من الخوخ والحليب النافع ، والذي يغذي الجلد بعمق دون أن يبدو زيتيًا.&lt;br&gt;&lt;/p&gt;', '', 'غسول مرطبات الجسم', '', ''),
(301, 3, 'Apollo Pharmacy Dental', '&lt;p&gt;Apollo Pharmacy Dental Floss Picks proporciona una sensación de limpieza completa cada vez que usa hilo dental. Su fino hilo sedoso con textura, se desliza fácilmente entre los dientes para eliminar la suciedad y combatir el mal aliento, la placa y la caries dental.&lt;br&gt;&lt;/p&gt;', '', 'Cuidado dental', '', ''),
(301, 4, 'صيدلية أبولو طب الأسنان', '&lt;p&gt;تقدم لك هذه المجموعة شعوراً نظيفاً بالكامل في كل مرة تنظف فيها الخيط. خيطه الرقيق الحريري مع انتزاع محكم ، ينزلق بسهولة بين الأسنان لإزالة الحطام ومحاربة رائحة الفم الكريهة ، البلاك وتسوس الأسنان.&lt;br&gt;&lt;/p&gt;', '', 'العناية بالأسنان', '', ''),
(302, 3, 'Pasta de dientes Colgate', '&lt;p&gt;Colgate strong Teeth es la pasta de dientes anticaída No. 1 de Indias. Su protección Calci-lock ayuda a bloquear el calcio en los dientes y los mantiene protegidos de las caries.&lt;br&gt;&lt;/p&gt;', '', 'Cuidado dental', '', ''),
(302, 4, 'كولجيت معجون الأسنان', '&lt;p&gt;كولجيت أسنان قوية هي إندياس رقم 1 معجون أسنان مضاد للتجويف. تساعد حماية قفل الكالسي في قفل الكالسيوم في الأسنان وتحميهم من التسوس.&lt;br&gt;&lt;/p&gt;', '', 'العناية بالأسنان', '', ''),
(303, 3, 'Future Organics - Polvo de dientes', '&lt;p&gt;India ha sido bendecida con hierbas mágicas, que tienen propiedades medicinales y curativas. Te traemos un polvo de dientes, que además de hacer maravillas para las encías y los dientes, puede ayudar a combatir la obesidad.&lt;br&gt;&lt;/p&gt;', '', 'Pasta de dientes y amp; Polvo', '', ''),
(303, 4, 'فيوتشر اورجانيكس بودرة الاسنان', '&lt;p&gt;وقد تم نعمة الهند مع الأعشاب السحرية ، ولها خصائص طبية وشفاء. نقدم لكم مسحوقاً سنياً ، بصرف النظر عن عجائب لثتك وأسنانك ويمكن أن تساعد في مكافحة السمنة&lt;br&gt;&lt;/p&gt;', '', 'معاجين الأسنان وأمبير. مسحوق', '', ''),
(304, 3, 'Pasta de dientes Sensodyne', '&lt;p&gt;Alivio clínicamente probado y protección diaria para los dientes sensibles. Sensodyne Alivia la sensibilidad al construir una barrera protectora que bloquea la sensibilidad causada por el calor, frío, dulce y otros factores desencadenantes de contacto.&lt;br&gt;&lt;/p&gt;', '', 'Pasta de dientes y amp; Polvo', '', ''),
(304, 4, 'سنسوداين معجون الأسنان', '&lt;p&gt;الحماية المثبتة سريريا والحماية اليومية للأسنان الحساسة. يخفف الحساسية عن طريق بناء حاجز وقائي يمنع الحساسية التي تسببها المشغلات الساخنة والباردة والحلوة وغيرها.&lt;br&gt;&lt;/p&gt;', '', 'معاجين الأسنان وأمبير. مسحوق', '', ''),
(305, 3, 'Pasta de dientes de acacia Dabar', '&lt;p&gt;La pasta dental Babool es una pasta de dientes natural llena de los beneficios medicinales del árbol de Babul \'Acacia Arabia\'. El extracto de hierbas de Babul en esta pasta de dientes ayuda a evitar la hinchazón y el sangrado de las encías, manteniendo las encías fuertes y los dientes firmes.&lt;br&gt;&lt;/p&gt;', '', 'Pasta de dientes y amp; Polvo', '', ''),
(305, 4, 'معجون اسنان دابر اكاسيا', '&lt;p&gt;بابول معجون الأسنان هو معجون أسنان طبيعي مليء بالمزايا الطبية لشجرة بابول &quot;أكاسيا أرابيا&quot;. يساعد مستخلص بابول العشبي في معجون الأسنان هذا على تجنب انتفاخ اللثة ونزيفها ، والحفاظ على لثتك قوية وأسنانها متينة.&lt;br&gt;&lt;/p&gt;', '', 'معاجين الأسنان وأمبير. مسحوق', '', ''),
(306, 3, 'Sensodyne Sensitive Toothbrush', '&lt;p&gt;Especialmente diseñado para personas con dientes sensibles. Cepillo de dientes Sensodyne Proporciona una limpieza efectiva de los dientes. Mango ergonómico amplio asegura un agarre cómodo y un mejor alcance&lt;br&gt;&lt;/p&gt;', '', 'Cepillos de dientes', '', ''),
(306, 4, 'سين سوديني حساسه الاسنان', '&lt;p&gt;مصممة خصيصا للأشخاص ذوي الأسنان الحساسة. فرشاة الأسنان توفر تنظيف فعال للأسنان. مقبض مريح واسع يضمن قبضة مريحة ووصولاً أفضل&lt;br&gt;&lt;/p&gt;', '', 'فرشاة الأسنان', '', ''),
(307, 3, 'Cepillo de dientes Colgate - ZigZag', '&lt;p&gt;Colgate Zig Zag viene con cerdas de zigzag multiangulares diseñadas para llegar a lo profundo entre los dientes para eliminar la placa de manera efectiva. Las cerdas medianas redondeadas al final se sienten suaves en los dientes y las encías.&lt;br&gt;&lt;/p&gt;', '', 'Cepillos de dientes', '', ''),
(307, 4, 'كولجيت - فرشاة الأسنان - زيجزاج', '&lt;p&gt;كولجيت زاج يأتي مع شعيرات منعرج متعرج متعددة الزاوية مصممة للوصول إلى عمق بين الأسنان لإزالة البلاك بشكل فعال. شعيرات نهاية المنتهية المستديرة تبدو لطيفة على الأسنان واللثة.&lt;br&gt;&lt;/p&gt;', '', 'فرشاة الأسنان', '', ''),
(308, 3, 'Oral-B cepillo de dientes Pro', '&lt;p&gt;Oral-B es la marca de cepillos de dientes Worlds No1 que brinda a usted y a su familia soluciones revolucionarias de cepillado con la mejor tecnología de su clase para garantizar que usted y su familia obtengan una boca más saludable y limpia.&lt;br&gt;&lt;/p&gt;', '', 'Cepillos de dientes', '', ''),
(308, 4, 'أورال-بي فرشاة الأسنان برو', '&lt;p&gt;أورال-بي هي ماركة فرشاة أسنان رقم 1 في العالم والتي تقدم لك ولعائلتك حلول تنظيف الأسنان الثورية بأفضل التقنيات في فئتها لضمان حصولك وعائلتك على فم صحة ونظافة.&lt;br&gt;&lt;/p&gt;', '', 'فرشاة الأسنان', '', ''),
(309, 3, 'Cepillo de dientes Colgate - Kids Barbie', '&lt;p&gt;El cepillo de dientes Colgate Kids Barbie viene con el personaje favorito de su hijo para que el cepillado sea emocionante y divertido. Especialmente diseñado para niños de 5 años o más, las cerdas extra suaves del cepillo para niños trabajan suavemente en sus dientes y encías en desarrollo.&lt;br&gt;&lt;/p&gt;', '', 'Cepillos de dientes', '', ''),
(309, 4, 'كولجيت - فرشاة أسنان - باربي', '&lt;p&gt;تأتي فرشاة أسنان كولجيت كيدز باربي مع شخصيتك المفضلة لدى طفلك لجعل عملية تنظيف الأسنان مثيرة وممتعة. مصممة خصيصًا للأطفال من عمر 5 سنوات فما فوق ، تعمل الفرشاة الناعمة الإضافية لفرشاة الأطفال برفق على أسنانهم ولثتهم النامية.&lt;br&gt;&lt;/p&gt;', '', 'فرشاة الأسنان', '', ''),
(310, 3, 'Fem Creme Bleach', '&lt;p&gt;Una cura completa de los rayos dañinos del sol, FEM te trae el primer blanqueador De-Tan. Con FEM De-Tan Bleach, ahora puede salir del día con confianza.&lt;br&gt;&lt;/p&gt;', '', 'Bleach y amp; Depiladores', '', ''),
(310, 4, 'فيم كريم بليتش', '&lt;p&gt;علاج كامل من أشعة الشمس الضارة ، فام يجلب لك أول دي تان التبييض. مع التبييض ، يمكنك الآن الخروج لليوم بثقة.&lt;br&gt;&lt;/p&gt;', '', 'التبييض مزيلات الشعر', '', ''),
(311, 3, 'Oxy Life Creme Bleach', '&lt;p&gt;Combata 5 problemas de la piel con el poder del oxígeno. Elimina las manchas oscuras. Mejora el tono de la piel. Refuerza la piel opaca. Elimina las células muertas de la piel. Ilumina el bronceado.&lt;br&gt;&lt;/p&gt;', '', 'Bleach y amp; Depiladores', '', ''),
(311, 4, 'اوكسي الحياة كريم التبييض', '&lt;p&gt;حارب 5 مشاكل جلدية مع قوة الأكسجين - إزالة البقع الداكنة - يجعل لون البشرة حتى - يخفي بشرة مملة - ينقي خلايا الجلد الميتة - تضيء أشعة الشمس.&lt;br&gt;&lt;/p&gt;', '', 'التبييض و مزيلات الشعر', '', ''),
(312, 3, 'Veet Crema depilatoria', '&lt;p&gt;Veets Hair Removal Cream es su respuesta a una piel suave, impecable y sin vello. Contiene extractos de Camellia Seed Oil 100% naturales que suavizan la piel sin causar mucha irritación e hidratan en el proceso.&lt;br&gt;&lt;/p&gt;', '', 'Bleach y amp; Depiladores', '', ''),
(312, 4, 'فيت لإزالة الشعر كريم', '&lt;p&gt;كريم فيتس لإزالة الشعر هو جوابك على بشرة ناعمة خالية من العيوب وخالية من الشعر. يحتوي على 100٪ من خلاصة زيت بذور كاميليا الطبيعية التي تعمل على تنعيم بشرتك دون التسبب في الكثير من التهيج وترطيبها في هذه العملية.&lt;br&gt;&lt;/p&gt;', '', 'التبييض و مزيلات الشعر', '', ''),
(313, 3, 'Dettol Handwash - Skin Care', '&lt;p&gt;El jabón líquido Dettol para el cuidado de la piel ha sido especialmente formulado para uso diario. Combate el crecimiento de gérmenes y bacterias y deja tus manos frescas y limpias.&lt;br&gt;&lt;/p&gt;', '', 'Protección de la piel', '', ''),
(313, 4, 'ديتول هاندواش - العناية بالبشرة', '&lt;p&gt;تم تصميم غسول ديتول سائل للعناية بالجلد خصيصًا للاستخدام اليومي. إنه يحارب نمو الجراثيم والبكتيريا ويترك يديك تشعر بالانتعاش والنظافة.&lt;br&gt;&lt;/p&gt;', '', 'العناية بالبشرة', '', ''),
(314, 3, 'Bajaj Nomarks', '&lt;p&gt;La nueva crema Bajaj Nomarks para piel normal es una formulación segura para la piel ayurvédica con la bondad de la cúrcuma, el limón y el aceite de germen de trigo.&lt;br&gt;&lt;/p&gt;', '', 'Protección de la piel', '', ''),
(314, 4, 'باجاج نوماركس', '&lt;p&gt;كريم بيجاج نيوماركس الجديد للبشرة العادية هو تركيبة آمنة للبشرة الايورفيدا مع الخير من زيت الكركم والليمون والقمح الجرثومية.&lt;br&gt;&lt;/p&gt;', '', 'العناية بالبشرة', '', ''),
(315, 3, 'Entonces loción de protección solar', '&lt;p&gt;No es una novedad que la exposición al sol sea uno de los principales culpables del envejecimiento de la piel. Los estudios han demostrado que la exposición a los rayos UV es responsable de hasta el 90 por ciento de los signos visibles del envejecimiento de la piel.&lt;br&gt;&lt;/p&gt;', '', 'Protección de la piel', '', ''),
(315, 4, 'لذلك لوسيون الشمس', '&lt;p&gt;لا يوجد خبر بأن التعرض لأشعة الشمس هو أحد أهم المتسببين في شيخوخة الجلد. وقد أظهرت الدراسات أن التعرض للأشعة فوق البنفسجية هو المسؤول عن ما يصل إلى 90٪ من العلامات الظاهرة لشيخوخة الجلد.&lt;br&gt;&lt;/p&gt;', '', 'العناية بالبشرة', '', ''),
(114, 3, 'Chana Dal ', '&lt;p&gt;Chana dal is baby chickpeas that has been split and polished. It looks and tastes like small kernels of sweet corn, and is one of the most popular ingredients in Indian cuisine. &lt;br&gt;Chana dal is delicious, nutritious and easily digested. Apart from being used in soups, salads, curries, dal preparations, savouries, sweets and rice dishes, the legumes are also roasted and powdered into chickpea flour (besan), another ingredient that is widely used in almost every province of India. &lt;br&gt;&lt;/p&gt;', '', 'Chana Dal ', '', ''),
(316, 3, 'bb Popular Anacardo / Kaju', '&lt;p&gt;Anacardo - Roto (4 pc) contiene buenas cantidades de fibra dietética, aceite y antioxidantes. Son ricos en ácidos grasos monoinsaturados y minerales como potasio, hierro, fósforo, zinc, cobre y selenio.&lt;br&gt;&lt;/p&gt;', '', 'Anacardos', '', ''),
(316, 4, 'ب ب الشعبي الكاجو / كاجو', '&lt;p&gt;الكاجو - المكسور (4 أجزاء) يحتوي على كميات جيدة من الألياف الغذائية والزيوت والمواد المضادة للاكسدة. هم الأثرياء في الأحماض الدهنية الأحادية غير المشبعة والمعادن مثل البوتاسيوم والحديد والفوسفور والزنك والنحاس والسيلينيوم.&lt;br&gt;&lt;/p&gt;', '', 'الكاجو', '', ''),
(317, 3, 'Anacardo / Kaju Whole Premium', '&lt;p&gt;Los anacardos son semillas de la fruta del anacardo. Es blanco, suave y carnoso. Se endurece y cambia a un blanco más oscuro una vez tostado, y tiene un rico sabor por lo que es la nuez más sabrosa. Estos son ricos en ácidos grasos monoinsaturados y minerales como hierro, potasio, fósforo, cobre, zinc y selenio.&lt;br&gt;&lt;/p&gt;', '', 'Anacardos', '', ''),
(317, 4, 'الكاجو / كاجو كاملة قسط', '&lt;p&gt;الكاجو هي بذور فاكهة شجرة الكاجو. إنه أبيض وناعم ولحمي. يتقلب ويتحول إلى اللون الأبيض الداكن المحمص مرة واحدة ، ولها نكهة غنية مما يجعلها الجوز الأكثر فلافورسومي. وهي غنية بالأحماض الدهنية الأحادية غير المشبعة والمعادن مثل الحديد والبوتاسيوم والفوسفور والنحاس والزنك والسيلينيوم.&lt;br&gt;&lt;/p&gt;', '', 'الكاجو', '', ''),
(318, 3, 'Orgánico - Anacardo / Kaju entero', '&lt;p&gt;Anacardo entero se mejora con alto contenido calórico y de grasa. Contiene varias ventajas para la salud debido a su rico contenido mineral.&lt;br&gt;&lt;/p&gt;', '', 'Anacardos', '', ''),
(318, 4, 'العضوية - الكاجو / كاجو الجامع', '&lt;p&gt;يتم تحسين الكاجو الجامع بمحتوى عالي من السعرات الحرارية والدهون. يحتوي على العديد من المزايا الصحية بسبب محتواها الغني بالمعادن.&lt;br&gt;&lt;/p&gt;', '', 'الكاجو', '', ''),
(319, 3, 'Racine / Raisim - Indio', '&lt;p&gt;Las pasas de uva indias tienen un sabor delicioso, alto valor nutritivo y frescura. Estas pasas se usan en cocinas y platos apetecibles en todo el mundo.&lt;br&gt;&lt;/p&gt;', '', 'Pasas', '', ''),
(319, 4, 'راسين / راسيم - هندي', '&lt;p&gt;الزبيب الهندي له طعم لذيذ ، قيمة غذائية عالية ونضارة. وتستخدم هذه الزبيب في المطبخ والأطباق مستساغ في جميع أنحاء العالم.&lt;br&gt;&lt;/p&gt;', '', 'زبيب', '', ''),
(320, 3, 'Pasas / kishmish - negro, sin semillas', '&lt;p&gt;Black Seedless Raisin, la variedad más famosa de uva seca, es ampliamente conocida por su sabor azucarado y sabor jugoso.&lt;br&gt;&lt;/p&gt;', '', 'Pasas', '', ''),
(320, 4, 'الزبيب / كيش ميش - أسود ، بدون بذور', '&lt;p&gt;من المعروف على نطاق واسع أن بذور الزبيب أقل من الزبيب ، وهي أشهر أنواع العنب المجففة ، وذوقها ذو النكهة السكرية ونكهة العصير.&lt;br&gt;&lt;/p&gt;', '', 'زبيب', '', ''),
(321, 3, 'Bilios / munc', '&lt;p&gt;Abjosh es uvas secas que tienen un aspecto arrugado para ellos. Son dulces y son muy queridos por los jóvenes y viejos por igual. Los abjosh suelen ser de un color diferente al de las pasas verdes habituales.&lt;br&gt;&lt;/p&gt;', '', 'Pasas', '', ''),
(321, 4, 'الآن جوش / منكا', '&lt;p&gt;أبجوش هو العنب المجفف الذي له مظهر متجعد له. هم حلو ويحبهم الشباب والكبار على حد سواء. عادة ما يكون لون أبجوش بلون مختلف عن الزبيب الأخضر المعتاد.&lt;br&gt;&lt;/p&gt;', '', 'زبيب', '', ''),
(322, 3, 'Aceite de coco paracaídas', '&lt;p&gt;El aceite de paracaídas de coco proporciona una miniaturización y nutrición amplias para mantener el cabello suave, flexible y nutrido. Te trae la bondad natural del coco.&lt;br&gt;&lt;/p&gt;', '', 'Aceite de coco', '', ''),
(322, 4, 'زيت جوز الهند بالمظلات', '&lt;p&gt;يمنح زيت الشعر بزيت جوز الهند بالمظلات تعويضاً وافياً وتغذياً ليبقي الشعر ناعماً ومرناً ومغذياً. يجلب لك الخير الطبيعي لجوز الهند.&lt;br&gt;&lt;/p&gt;', '', 'زيت جوز الهند', '', ''),
(323, 3, 'Shudhi - Aceite de coco', '&lt;p&gt;KPL Shudhi Coconut Oil mantiene la resistencia a la insulina, reduciendo el peligro de la diabetes tipo 2. También se muestra para acelerar el metabolismo.&lt;br&gt;&lt;/p&gt;', '', 'Aceite de coco', '', ''),
(323, 4, 'الشوده - زيت جوز الهند', '&lt;p&gt;يحافظ زيت شودي جوز الهند على مقاومة الأنسولين ، مما يقلل من خطر الإصابة بالنوع الثاني من داء السكري. هو أيضا أظهر لتسريع الأيض.&lt;br&gt;&lt;/p&gt;', '', 'زيت جوز الهند', '', ''),
(324, 3, 'Aceite para el cabello con paracaídas Advansed - Coco', '&lt;p&gt;El aceite de paracaídas avanzado para el cabello de coco de Marico se ha hecho especialmente teniendo en cuenta las necesidades del cabello. Contiene aceites esenciales de ylang-ylang para darle una fragancia rica y profunda.&lt;br&gt;&lt;/p&gt;', '', 'Aceite de coco', '', ''),
(324, 4, 'زيت الشعر باراشوت أدفانسيد - جوز الهند', '&lt;p&gt;وقد قدمت زيت جوز الهند للشعر من ماريكو مع الأخذ في الاعتبار احتياجات الشعر. أنه يحتوي على الزيوت الأساسية من يلانج يلانج لإعطاء له رائحة غنية وعميقة.&lt;br&gt;&lt;/p&gt;', '', 'زيت جوز الهند', '', ''),
(325, 3, 'Aceite de coco orgánico - prensado en frío', '&lt;p&gt;ForGreen Aceite de coco orgánico prensado en frío: el aceite de coco es una rica fuente de ácido láurico, rico en antioxidantes, buen aceite de cocina, buenos nutrientes naturales para el cabello, muy buen aceite para masaje&lt;br&gt;&lt;/p&gt;', '', 'Aceite de coco', '', ''),
(325, 4, 'زيت جوز الهند العضوي - مضغوط على البارد', '&lt;p&gt;لزيت جوز الهند الأخضر المضغوط على البارد: زيت جوز الهند ، مصدر غني بحمض اللوريك ، غني بمضادات الأكسدة ، زيت الطهي الجيد ، مواد غذائية طبيعية جيدة للشعر ، زيت تدليك جيد جدا&lt;br&gt;&lt;/p&gt;', '', 'زيت جوز الهند', '', ''),
(326, 3, 'Aceite de mostaza de Patanjali', '&lt;p&gt;Aceite de semillas de mostaza. Sin aceite de Argemone. Las cocinas de toda la India usan extensamente aceite de mostaza para preparar sabrosas recetas y encurtidos.&lt;br&gt;&lt;/p&gt;', '', 'Aceite de mostaza', '', ''),
(326, 4, 'باتانجالي زيت الخردل', '&lt;p&gt;زيت بذور الخردل. خالية من الذهب جوهرة واحدة من النفط. تستخدم المطابخ في جميع أنحاء الهند زيت الخردل على نطاق واسع في إعداد الوصفات والمخللات اللذيذة.&lt;br&gt;&lt;/p&gt;', '', 'زيت الخردل', '', ''),
(327, 3, 'Emami saludable y sabroso', '&lt;p&gt;Fabricado por: EMAMI AGROTECH LIMITED&lt;br&gt;&lt;/p&gt;', '', 'Aceite de mostaza', '', ''),
(327, 4, 'إمامي صحي ولذيذ', '&lt;p&gt;المصنعة&lt;br&gt;&lt;/p&gt;', '', 'زيت الخردل', '', ''),
(328, 3, 'Nutty Yogi Organic Cold Pressed', '&lt;p&gt;Nutty Yogis Mustard Oil es 100% certificado orgánico, aceite de mostaza prensado en frío extraído de las semillas de mostaza más frescas y finas.&lt;br&gt;&lt;/p&gt;', '', 'Aceite de mostaza', '', ''),
(328, 4, 'الجوز يوغي العضوية ضغطت الباردة', '&lt;p&gt;زيت جوز الهند هو 100٪ من زيت الخردل العضوي المعتمد على البارد المستخرج من بذور الخردل الطازجة والرائعة.&lt;br&gt;&lt;/p&gt;', '', 'زيت الخردل', '', ''),
(329, 3, 'Nandini Pure Ghee', '&lt;p&gt;Un sabor de pureza, Nandini Ghee hecho de mantequilla pura. Es puro y fresco con un delicioso sabor. Ghee es la sustancia natural que proporciona nutrición.&lt;br&gt;&lt;/p&gt;', '', 'Ghee', '', ''),
(329, 4, 'نانديني نقي السمن', '&lt;p&gt;طعم النقاء ، أدلى نانديني السمن من الزبدة النقية. إنه نقي وطازج مع نكهة لذيذة. السمن هو المادة الطبيعية التي توفر التغذية.&lt;br&gt;&lt;/p&gt;', '', 'السمن', '', ''),
(330, 3, 'Madre lechera Pure Cow - Ghee', '&lt;p&gt;En Ayurveda, Cow ghee se cree que es el mejor para el consumo humano. Se considera como rasayana, un alimento que promueve la rejuvenecimiento y la longevidad.&lt;br&gt;&lt;/p&gt;', '', 'Ghee', '', ''),
(330, 4, 'الأم البقرة الصرفة البقرة - السمن', '&lt;p&gt;في الأيورفيدا ، يعتقد أن السمن البق هو الأفضل للاستهلاك البشري. وهو يعتبر بمثابة ريانا ، وهو غذاء يعيد الشباب إلى الأبد ويطيل عمره.&lt;br&gt;&lt;/p&gt;', '', 'السمن', '', ''),
(331, 3, 'Amul Pure Ghee', '&lt;p&gt;Mantequilla clarificada o Pure Ghee es un alimento básico en Indian Kitchens. Conocido por ser rico en antioxidantes y grasas trans, este producto de la casa de Amul se puede utilizar para cocinar y ayuda a las personas en el proceso de control de peso también.&lt;br&gt;&lt;/p&gt;', '', 'Ghee', '', ''),
(331, 4, 'امول بيور سمن', '&lt;p&gt;الزبدة الموضحة أو السمن النقي هو العنصر الرئيسي في المطابخ الهندية. من المعروف أنه غني بمضادات الأكسدة والدهون غير المشبعة ، ويمكن استخدام هذا المنتج من منزل أمول للطهي ويساعد الناس في عملية إدارة الوزن أيضًا.&lt;br&gt;&lt;/p&gt;', '', 'السمن', '', ''),
(332, 3, 'Patanjali Cow Ghee', '&lt;p&gt;Patanjali país vaca ghee es como amrit. No podemos confiar en el ghee de vaca que está disponible en los mercados. Puede dañar en lugar de beneficiarse.&lt;br&gt;&lt;/p&gt;', '', 'Ghee', '', ''),
(332, 4, 'باتانجالي البقرة السمن', '&lt;p&gt;باتانجالي بلد البقر السمن هو مثل عمريت. لا يمكننا أن نثق بسمن البقر الموجود في الأسواق. قد تضر بدلا من الفائدة.&lt;br&gt;&lt;/p&gt;', '', 'السمن', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(333, 3, 'Detergente para ropa Johnson Baby', '&lt;p&gt;Sabemos que debe proteger a su bebé de todo lo que es duro y, por lo tanto, debe hacer un esfuerzo adicional para que solo llegue a ella la persona más amable.&lt;br&gt;&lt;/p&gt;', '', 'Lavandería', '', ''),
(333, 4, 'جونسون بيبي منظفات الغسيل', '&lt;p&gt;نحن نعلم أنك بحاجة إلى حماية طفلك من أي شيء قاس ومن ثمّ عليك أن تخطو ذلك المجهود الإضافي بحيث لا يصل إليه سوى أكثرها رقة.&lt;br&gt;&lt;/p&gt;', '', 'غسيل ملابس', '', ''),
(334, 3, 'Natural Liquid - Detergente para ropa', '&lt;p&gt;Sabemos que debe proteger a su bebé de todo lo que es duro y, por lo tanto, debe hacer un esfuerzo adicional para que solo llegue a ella la persona más amable.&lt;br&gt;&lt;/p&gt;', '', 'Lavandería', '', ''),
(334, 4, 'السائل الطبيعي - منظفات الغسيل', '&lt;p&gt;نحن نعلم أنك بحاجة إلى حماية طفلك من أي شيء قاس ومن ثمّ عليك أن تخطو ذلك المجهود الإضافي بحيث لا يصل إليه سوى أكثرها رقة.&lt;br&gt;&lt;/p&gt;', '', 'غسيل ملابس', '', ''),
(335, 3, 'Natural Liquid - Detergente para ropa', '&lt;p&gt;Las nueces son ricas en espuma y son alternativas libres de químicos para varias limpiezas. Libre de SLS, SLES, sulfanatos, fosfatos, fragancias artificiales, color, blanqueador, brigthners ópticos, alérgenos, frutos secos 1.&lt;br&gt;&lt;/p&gt;', '', 'Lavandería', '', ''),
(335, 4, 'السائل الطبيعي - منظفات الغسيل', '&lt;p&gt;الصابون غنية بالرطوبة وهي بدائل كيميائية مجانية للتنظيف المتنوع. خالية من الكبريتات ، الفوسفات ، العطر الاصطناعي ، اللون ، بليتش ، بريجثورز البصرية ، مسببات الحساسية ، المكسرات 1.&lt;br&gt;&lt;/p&gt;', '', 'غسيل ملابس', '', ''),
(336, 3, 'Accesorios para bebés y limpiador líquido vegetal', '&lt;p&gt;Con Baby In Mind, Mee Mee Baby Accessories Vegetable Liquid Cleanser se ha realizado cuidadosamente con los más altos estándares de seguridad. El limpiador líquido está formulado con ingredientes comestibles.&lt;br&gt;&lt;/p&gt;', '', 'Lavandería', '', ''),
(336, 4, 'إكسسوارات الطفل و سائل منظف الخضار', '&lt;p&gt;مع بيبي إيند مايند ، ميبي ميك بيبي اكسسوارات محضرة سائل نباتي تمت صناعته بعناية بأعلى معايير السلامة. منظف سائل منظف بمكونات غذائية.&lt;br&gt;&lt;/p&gt;', '', 'غسيل ملابس', '', ''),
(337, 3, 'Detergente en polvo', '&lt;p&gt;El nuevo detergente Tide + with Extra Power, ahora con el Power of Bar añadido, ha sido desarrollado para brindarte una blancura brillante en tu ropa.&lt;br&gt;&lt;/p&gt;', '', 'Poder detergente y amp; Barras', '', ''),
(337, 4, 'مسحوق غسيل المنظفات', '&lt;p&gt;وقد تم تطوير المد الجديد + مع منظف الطاقة الإضافية ، والآن مع قوة إضافية من شريط ، لتجلب لك البياض الرائعة على ملابسك.&lt;br&gt;&lt;/p&gt;', '', 'قوة المنظفات &amp; أمبير ؛ الحانات', '', ''),
(338, 3, 'Barra de Detergente Rin', '&lt;p&gt;Con tantas tareas en la lista, ¡la ayuda de un experto siempre funciona! Deje sus problemas de lavandería en la barra de detergente Rin. Su tecnología NSD garantiza que la barra se mantenga seca, mientras que la forma fácil de mantener le proporciona un mejor agarre al lavar las manchas.&lt;br&gt;&lt;/p&gt;', '', 'Poder detergente y amp; Barras', '', ''),
(338, 4, 'رين المنظفات بار', '&lt;p&gt;مع العديد من المهام في القائمة ، تعمل مساعدة الخبراء دائمًا! اتركي مصبّات الغسيل في بار تنظيف المنظفات - تضمن تقنيتها بقاء البار جافًا بينما يمنحك الشكل السهل الاحتفاظ به قبضة أفضل أثناء غسل البقع.&lt;br&gt;&lt;/p&gt;', '', 'قوة المنظفات &amp; أمبير ؛ الحانات', '', ''),
(339, 3, 'BORGES Olive Oil - Extra Light', '&lt;p&gt;El Aceite de Oliva Borges Light Flavor tiene un sabor muy suave que permite que los sabores de otros ingredientes se presenten.&lt;br&gt;&lt;/p&gt;', '', 'Aceite de oliva', '', ''),
(339, 4, 'بورج زيت الزيتون - ضوء إضافي', '&lt;p&gt;بورجيس لايت بنكهة زيت الزيتون لديه طعم ناعم جدا يسمح بنكهات المكونات الأخرى خلال.&lt;br&gt;&lt;/p&gt;', '', 'زيت الزيتون', '', ''),
(340, 3, 'Frasco de Aceite de Oliva Puro', '&lt;p&gt;El aceite de oliva Figaro ha estado celebrando la bondad del aceite de oliva durante casi un siglo.&lt;br&gt;&lt;/p&gt;', '', 'Aceite de oliva', '', ''),
(340, 4, 'فيجارو زيت الزيتون النقي', '&lt;p&gt;يحتفل فيجارو زيت الزيتون بسمعة زيت الزيتون منذ قرن تقريبًا.&lt;br&gt;&lt;/p&gt;', '', 'زيت الزيتون', '', ''),
(341, 3, 'Aceite de oliva Farrell - Orujo', '&lt;p&gt;El aceite de orujo de oliva Farrell es liviano y neutro y es perfecto para cocinar y freír. Como no contiene ningún sabor, el aceite de orujo de oliva no altera el sabor de los alimentos que se organizan con él.&lt;br&gt;&lt;/p&gt;', '', 'Aceite de oliva', '', ''),
(341, 4, 'زيت الزيتون فاريل - بوميس', '&lt;p&gt;ثفل الزيتون زيت خفيف ومحايد ومثالي للاستعمال في الطهي والقلي. نظرًا لأنه لا يحتوي على أي نكهة ، لا يغير زيت زيتون الزيتون نكهة الطعام الذي يتم ترتيبه معه.&lt;br&gt;&lt;/p&gt;', '', 'زيت الزيتون', '', ''),
(342, 3, 'Aceite de oliva - puro, clásico', '&lt;p&gt;Borges es una marca muy conocida que produce productos alimenticios de alta calidad que incluyen aceites de oliva aromáticos y sabrosos que se clasifican según el nivel de presión que han disfrutado las aceitunas antes de ser embotelladas.&lt;br&gt;&lt;/p&gt;', '', 'Aceite de oliva', '', ''),
(342, 4, 'زيت الزيتون - النقي ، كلاسيك', '&lt;p&gt;بورخيس هي علامة تجارية معروفة تنتج منتجات غذائية عالية الجودة ، بما في ذلك زيت الزيتون العطري والرائج الذي يتم تصنيفه وفقًا لمستوى الصحافة التي تمتعت بها الزيتون قبل تعبئتها.&lt;br&gt;&lt;/p&gt;', '', 'زيت الزيتون', '', ''),
(343, 3, 'Harina de Maíz Real', '&lt;p&gt;La harina de maíz se mezcla bien con los ingredientes adicionales de los alimentos y se puede mezclar con la harina de trigo para disminuir el gluten de las tortas, pasteles, galletas y galletas saladas.&lt;br&gt;&lt;/p&gt;', '', 'Suavizadores y amp; Removedores de satén', '', ''),
(343, 4, 'طحين الذرة الملكي', '&lt;p&gt;يمتزج دقيق الذرة جيدًا مع المكونات الغذائية الإضافية ويمكن خلطه بدقيق القمح لتقليل الغلوتين في الكعك والحلويات والكعك والبسكويت.&lt;br&gt;&lt;/p&gt;', '', 'مطهر البقع المزيلات', '', ''),
(344, 3, 'Revive Starch Stiffener', '&lt;p&gt;Los refuerzos Revive Liquid Stiftner hacen que la tela se vea más respetable. No contiene detergente y, por lo tanto, no es necesario lavar la tela después del uso del refuerzo. Esto es simple de usar y amigable con la piel. Para lucir superior en ropa vieja.&lt;br&gt;&lt;/p&gt;', '', 'Almidón y amp; Whitners', '', ''),
(344, 4, 'احياء النشا قاسية واحدة', '&lt;p&gt;يساعد إحياء المقوِّس السائل في جعل النسيج يبدو أكثر احترامًا. هذا لا يحتوي على المنظفات ، وبالتالي لا يجب غسل النسيج بعد استخدام مقسي. هذا سهل الاستخدام وصديق للبشرة. لننظر متفوقة في الملابس القديمة.&lt;br&gt;&lt;/p&gt;', '', 'النشا &amp; أمبير ؛ نيت وايت', '', ''),
(345, 3, 'Refuerzo de tela anti bacterias', '&lt;p&gt;Revive es una marca reconocida en productos para el cuidado de telas. Continuando con su tradición, Revive ha creado un refuerzo de tejido Revived anti bacteriano.&lt;br&gt;&lt;/p&gt;', '', 'Almidón y amp; Whitners', '', ''),
(345, 4, 'مضاد للجراثيم النسيج', '&lt;p&gt;أقمشة البكتيريا هي علامة تجارية مشهورة في منتجات العناية بالأقمشة. مواكبة تقاليدها ، وقد حان احياء مع تثبيط النسيج المضادة للبكتيريا احياء.&lt;br&gt;&lt;/p&gt;', '', 'النشا &amp; أمبير ؛ نيت وايت', '', ''),
(346, 3, 'Faultless Spray Starch', '&lt;p&gt;Faultless Regular Starch es la fórmula exclusiva de almidón que se aplica constantemente en la ropa para recomendar el cuerpo que normalmente solo obtiene del lavado especializado. Las camisas y blusas salen nítidas y nítidas.&lt;br&gt;&lt;/p&gt;', '', 'Almidón y amp; Whitners', '', ''),
(346, 4, 'رذاذ النشا لا عيب فيه', '&lt;p&gt;النشا العادي الذي لا عيب فيه هو بخاخ الصيغة النشوية الحصرية بثبات على الملابس للتوصية بالجسم الذي تحصل عليه عادة فقط من غسيل متخصص. القمصان والبلوزات يخرج حادة وواضحة.&lt;br&gt;&lt;/p&gt;', '', 'النشا &amp; أمبير ؛ نيت وايت', '', ''),
(347, 3, 'Almidón pesado sin defectos', '&lt;p&gt;Faultless Heavy Starch (567 g) Original Scent se pulveriza de manera uniforme con su tecnología de botones. A cambio, ayudará a que sus camisas se vean profesionales y frescas todo el día.&lt;br&gt;&lt;/p&gt;', '', 'Almidón y amp; Whitners', '', ''),
(347, 4, 'النشا الثقيل لا عيب فيه', '&lt;p&gt;نشا ثقيل لا تشوبه شائبة (567 جم) بخاخه الأصلي ينساب بالتساوي مع تقنية زره. في المقابل ، سيساعد ذلك على أن تبدو قمصانك كاملة احترافية وطازجة طوال اليوم.&lt;br&gt;&lt;/p&gt;', '', 'النشا &amp; أمبير ؛ ذوي الخوذات البيضاء', '', ''),
(348, 3, 'Multani Mati de Sattin', '&lt;p&gt;Satinance multani matti es un excelente tónico y astringente para la piel. reduce la grasa y mientras nutre la piel, la mantiene suave y mugre.&lt;br&gt;&lt;/p&gt;', '', 'Suavizadores y amp; Removedores de satén', '', ''),
(348, 4, 'ساتين مولتانى ماتي', '&lt;p&gt;ساتي نان م مول تاني ماتي هو حبر الجلد ممتازة و الدواء القابض. يقلل من الزيت بينما يغذي البشرة ويحافظ على النعومة والأوساخ.&lt;br&gt;&lt;/p&gt;', '', 'مطهر بقع المزيلات', '', ''),
(349, 3, 'Removedor de manchas Vanish', '&lt;p&gt;Solo los detergentes no son suficientes para eliminar las manchas difíciles y la mayoría de las veces la mancha permanece en la ropa incluso después de un lavado con detergente.&lt;br&gt;&lt;/p&gt;', '', 'Suavizadores y amp; Removedores de satén', '', ''),
(349, 4, 'فانيش مزيل البقعه', '&lt;p&gt;المنظفات فقط ليست كافية لإزالة البقع الصعبة ومعظم الأوقات التي تبقى فيها البقع على الملابس حتى بعد غسلها باستخدام المنظفات.&lt;br&gt;&lt;/p&gt;', '', 'مطهر بقع المزيلات', '', ''),
(350, 3, 'Polvo de cúrcuma salvaje satinado', '&lt;p&gt;Radiancia y brillo Ayuda a eliminar el vello facial y las marcas de granos. Cuando se aplica antes de tomar un baño, da un brillo a la piel. Su forma natural de cuidar su piel reduce las imperfecciones y elimina el bronceado de la cara.&lt;br&gt;&lt;/p&gt;', '', 'Suavizadores y amp; Removedores de satén', '', ''),
(350, 4, 'مسحوق التوت البري الكركم', '&lt;p&gt;الإشراق والتوهج يساعد في إزالة شعر الوجه وعلامات البثرة ، عندما يوضع قبل الاستحمام ، فإنه يعطي توهجًا للبشرة. الطريقة الطبيعية لرعاية بشرتك تقلل من الشوائب وتزيل السمرة من الوجه.&lt;br&gt;&lt;/p&gt;', '', 'مطهر البقع المزيلات', '', ''),
(351, 3, 'Lavado de cara - Eliminación de color tostado Naranja', '&lt;p&gt;Enriquecido con ingredientes naturales como el extracto de cáscara de naranja, papaína y miel, tonifica, exfolia e hidrata efectivamente la piel desde la primera aplicación.&lt;br&gt;&lt;/p&gt;', '', 'Suavizadores y amp; Removedores de satén', '', ''),
(351, 4, 'غسل الوجه - تان إزالة البرتقال', '&lt;p&gt;غني بالمكونات الطبيعية مثل مستخلص قشر البرتقال ، بابين والعسل ، فهو ينشط البشرة ويقشر البشرة ويرطب البشرة مباشرة من أول تطبيق.&lt;br&gt;&lt;/p&gt;', '', 'مطهر بقع المزيلات', '', ''),
(352, 3, 'Cáscara de naranja y geranio', '&lt;p&gt;Satinance Natural Clay Pack hará que tu piel luzca suave y sirve como un removedor de marcas de acné, círculos oscuros, granos, etc.&lt;br&gt;&lt;/p&gt;', '', 'Suavizadores y amp; Removedores de satén', '', ''),
(352, 4, 'قشر البرتقال وجيرانيوم', '&lt;p&gt;ساتانانس ناتشورال كلاي باك ستجعل لون بشرتك خفيف و يعمل كمزيل لعلامات حب الشباب ، الهالات السوداء ، الزيتس ، الخ&lt;br&gt;&lt;/p&gt;', '', 'مطهر بقع المزيلات', '', ''),
(353, 3, 'Limpiador de baño - Limón', '&lt;p&gt;Harpic Bathroom Cleaner es un desinfectante para baños y un líquido limpiador que ayuda a eliminar las manchas más difíciles. Le brinda una limpieza inmejorable en suelos grasos y partículas y la frescura más fresca de Harpic para todo el baño.&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de inodoros', '', ''),
(353, 4, 'منظف الحمام - ليمون', '&lt;p&gt;هاربيك منظف الحمام هو مطهر حمام قوي وسائل تنظيف يساعد على إزالة أصعب البقع. يمنحك تنظيف لا يهزم على التربة الدهنية والجسيمات ونضارة هاربيش الطازجة للحمام بأكمله.&lt;br&gt;&lt;/p&gt;', '', 'منظفات المرحاض', '', ''),
(354, 3, 'Limpiador de inodoros - Ocean Fresh', '&lt;p&gt;El nuevo Domex Fresh &amp;amp; Clean es un limpiador de tocador premium que deja un aroma refrescante y brinda una fragancia duradera&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de inodoros', '', ''),
(354, 4, 'منظف مراحيض - المحيط فريش', '&lt;p&gt;كل جديد دومكس فريش آند كلين هو منظف مرحاض فاخر يترك خلفه رائحة منعشة ويقدم رائحة طويلة الأمد&lt;br&gt;&lt;/p&gt;', '', 'منظفات المرحاض', '', ''),
(355, 3, 'Limpiador de inodoros Germ &amp; Stain Blaster', '&lt;p&gt;Harpic Germ y Stain Blaster es un poderoso limpiador de inodoros, el más fuerte del lote Harpic que le brinda una limpieza inmejorable tanto por encima como por debajo de la línea de flotación y frescura floral para el inodoro.&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de inodoros', '', ''),
(355, 4, 'منظف مراحيض جرثومة وستاين بلاستر', '&lt;p&gt;الجرثومية الحادة والجراثيم هي منظف مراحيض قوي ، أقوى من القرعة الحركية التي تمنحك تنظيفًا لا مثيل له سواء فوق أو تحت مستوى الماء ونضارة الأزهار للمرحاض.&lt;br&gt;&lt;/p&gt;', '', 'منظفات المرحاض', '', ''),
(356, 3, 'Limpiador de inodoros - Bleach, White &amp; Shine', '&lt;p&gt;Harpic es la marca de limpieza de inodoros número 1 de la India, que es altamente recomendada por la Asociación Médica de la India.&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de inodoros', '', ''),
(356, 4, 'منظف مراحيض - بليتش ، وايت &amp; شاين', '&lt;p&gt;تنظيف العلامة التجارية التي ينصح بشدة من قبل الرابطة الطبية الهندية.&lt;br&gt;&lt;/p&gt;', '', 'منظفات المرحاض', '', ''),
(357, 3, 'Stain Blaster - Floral', '&lt;p&gt;Harpic Germ y Stain Blaster es un poderoso limpiador de inodoros, el más fuerte del lote Harpic que le brinda una limpieza inmejorable tanto por encima como por debajo de la línea de flotación y frescura floral para el inodoro.&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de pisos &amp; amp; Phenyls', '', ''),
(357, 4, 'صمة الناسف - الأزهار', '&lt;p&gt;هارمبيك جيرم وستاين بلاستر هي منظف مراحيض قوي ، وهو أقوى قطعة هاربيك التي تمنحك تنظيفًا لا مثيل له سواء فوق أو تحت مستوى الماء ونضارة الأزهار للمرحاض.&lt;br&gt;&lt;/p&gt;', '', 'منظفات الأرضيات والفينيل', '', ''),
(358, 3, 'Líquido de limpieza de baño - Floral', '&lt;p&gt;Marca de limpieza de inodoros que es altamente recomendada por la Asociación Médica de la India.&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de pisos &amp; amp; Phenyls', '', ''),
(358, 4, 'حمام تنظيف السائل - الأزهار', '&lt;p&gt;تنظيف المرحاض العلامة التجارية التي ينصح بشدة من قبل الرابطة الطبية الهندية.&lt;br&gt;&lt;/p&gt;', '', 'منظفات الأرضيات والفينيل', '', ''),
(359, 3, 'Phenyl - Organic Floor Cleaner', '&lt;p&gt;Phenyl limpia su casa de la manera en que debe limpiarse, de forma natural. la orina destilada de desi cow actúa como un agente antimicrobiano natural.&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de pisos &amp; amp; Phenyls', '', ''),
(359, 4, 'فينيل - منظف الأرضيات العضوية', '&lt;p&gt;فينيل ينظف منزلك بالطريقة التي ينبغي تنظيفها - بالطريقة الطبيعية. البول البقر المقطر بمثابة عامل مضاد للميكروبات الطبيعية.&lt;br&gt;&lt;/p&gt;', '', 'منظفات الأرضيات وفينييل', '', ''),
(360, 3, 'Floor Cleaner - 2-en-1 fenólico', '&lt;p&gt;El gran poder de Domex le da la confianza que necesita para erradicar todos los gérmenes conocidos. Con Domex, puede estar absolutamente seguro de que el trabajo está hecho.&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de pisos &amp; amp; Phenyls', '', ''),
(360, 4, 'منظف الأرضيات - 2 في 1 الفينول', '&lt;p&gt;تمنحك القوة الهائلة التي تتمتع بها دومكس الثقة التي تحتاجها في القضاء على جميع الجراثيم المعروفة. ومع ذلك ، يمكنك أن تكون متأكدًا تمامًا من إنجاز المهمة.&lt;br&gt;&lt;/p&gt;', '', 'منظفات الأرضيات وفينييل', '', ''),
(361, 3, 'Limpiador de vidrio y hogar', '&lt;p&gt;El limpiador de vidrio contiene una mezcla única de ingredientes que elimina fácilmente la suciedad persistente, las huellas dactilares y la acumulación de polvo en varias superficies de vidrio.&lt;br&gt;&lt;/p&gt;', '', 'Vidrio y amp; Otros limpiadores', '', ''),
(361, 4, 'الزجاج والمنظفات المنزلية', '&lt;p&gt;يحتوي منظف الزجاج على مزيج فريد من المكونات التي تزيل بسهولة الأوساخ المستعصية ، وبصمات الأصابع والغبار على أسطح الزجاج المختلفة.&lt;br&gt;&lt;/p&gt;', '', 'الزجاج &amp; أمبير ؛ منظفات اخرى', '', ''),
(362, 3, 'Justmop - Spray limpiador de vidrio', '&lt;p&gt;Herbal Glass Cleaner Spray Este Herbal Glass Cleaner está hecho de ingredientes derivados de plantas con la presencia de aceites esenciales que son resistentes a la suciedad, pero suaves para el hogar y la tierra.&lt;/p&gt;', '', 'Vidrio y amp; Otros limpiadores', '', ''),
(362, 4, 'جستم - رش منظف الزجاج', '&lt;p&gt;منظف زجاجي عشبي بخاخ هذا المنظف العشبي الزجاجي مصنوع من المكونات المشتقة من النباتات مع وجود الزيوت العطرية التي هي صعبة على الأوساخ ، ولكن لطيفة للمنزل والأرض.&lt;br&gt;&lt;/p&gt;', '', 'الزجاج &amp; أمبير ؛ منظفات اخرى', '', ''),
(363, 3, 'Limpiacristales multiusos con spray', '&lt;p&gt;Limpiador de agua integrado, agua sincronizada, limpiando, limpiando al mismo tiempo, ¡las ventanas se vuelven limpias! Ampliamente utilizado en ventanas de superficie plana, vidrio, espejos, pisos, automóviles, etc.&lt;br&gt;&lt;/p&gt;', '', 'Vidrio y amp; Otros limpiadores', '', ''),
(363, 4, 'منظف زجاجي متعدد الأغراض مع رذاذ', '&lt;p&gt;منظف المياه المتكامل ، المياه المتزامنة ، المسح ، التنظيف في الوقت نفسه ، تصبح النوافذ نظيفة! تستخدم على نطاق واسع في نوافذ السطح المسطح ، الزجاج ، المرايا ، الأرضيات ، السيارات ، إلخ.&lt;br&gt;&lt;/p&gt;', '', 'الزجاج &amp; أمبير ؛ منظفات اخرى', '', ''),
(364, 3, 'Limpiador de vidrio y superficie', '&lt;p&gt;Úselo en espejos, ventanas, refrigeradores, encimeras, baldosas de cerámica, acero inoxidable y linóleo.&lt;br&gt;&lt;/p&gt;', '', 'Vidrio y amp; Otros limpiadores', '', ''),
(364, 4, 'منظف الزجاج والسطح', '&lt;p&gt;تستخدم على المرايا ، النوافذ ، الثلاجات ، كونترتوب ، بلاط السيراميك ، الفولاذ المقاوم للصدأ ومشمع.&lt;br&gt;&lt;/p&gt;', '', 'الزجاج &amp; أمبير ؛ منظفات اخرى', '', ''),
(365, 3, 'Limpiacristales', '&lt;p&gt;Este es un limpiador para pisos y ventanas de tres usos.&lt;br&gt;&lt;/p&gt;', '', 'Vidrio y amp; Otros limpiadores', '', ''),
(365, 4, 'نافذة زجاج منظف', '&lt;p&gt;هذا هو ثلاثة في واحد استخدام الكلمة ونظافة النافذة.&lt;br&gt;&lt;/p&gt;', '', 'الزجاج &amp; أمبير ؛ منظفات اخرى', '', ''),
(366, 3, 'Limpiador de superficie desinfectante - cítricos', '&lt;p&gt;El producto está disponible en 8 fragancias diferentes y es perfecto para pisos, azulejos, fregaderos, encimeras de cocina y todas las demás superficies lavables en su hogar.&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de uso múltiple', '', ''),
(366, 4, 'منظف السطح المطهر - الحمضيات', '&lt;p&gt;يتوفر هذا المنتج في 8 عطور مختلفة وهو مثالي للأرضيات والبلاط والمغاسل وعدادات المطبخ وجميع الأسطح الأخرى القابلة للغسل في منزلك.&lt;br&gt;&lt;/p&gt;', '', 'جميع المنظفات الغرض', '', ''),
(367, 3, 'Cleaner - Vidrio y hogar', '&lt;p&gt;Colin Cleaner Glass and House tiene vinagre como ingrediente principal conocido por su fuerte acción limpiadora. Elimina el polvo de sus superficies y las hace spick y span.&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de uso múltiple', '', ''),
(367, 4, 'منظف - الزجاج والمنزلية', '&lt;p&gt;كولين منظف الزجاج والبيت عقد الخل كما هو العنصر الرئيسي المعروف لعمل تطهير قوي. إنه يزيل الغبار من أسطحك ويجعلهم ينزلق ويمتد.&lt;br&gt;&lt;/p&gt;', '', 'جميع المنظفات الغرض', '', ''),
(368, 3, 'Limpiador de uso múltiple - Limón fresco', '&lt;p&gt;Limpiador de uso múltiple - Lemon Fresh Cleans Grasa y suciedad en toda la casa&lt;br&gt;&lt;/p&gt;', '', 'Limpiadores de uso múltiple', '', ''),
(368, 4, 'منظف لجميع الاغراض - ليمون فريش', '&lt;p&gt;منظف لجميع الأغراض - ليمون فريش ينظف الشحوم والأوساخ في جميع أنحاء المنزل&lt;br&gt;&lt;/p&gt;', '', 'جميع المنظفات الغرض', '', ''),
(369, 3, 'Cubo de plástico - Color surtido', '&lt;p&gt;El cubo es conveniente de usar. Además, es muy resistente ya que utiliza un alto grado de plástico virgen. Ideal para lavar y trapear.&lt;br&gt;&lt;/p&gt;', '', 'Cubos, tinas y amp; Tazas', '', ''),
(369, 4, 'دلو من البلاستيك - لون متنوعة', '&lt;p&gt;دلو مريحة للاستخدام. أيضا ، إنه دائم للغاية حيث أنه يستخدم درجة عالية من البلاستيك البكر. من الناحية المثالية المستخدمة لغسل ومسح.&lt;br&gt;&lt;/p&gt;', '', 'دلاء وأحواض وأحواض الأقداح', '', ''),
(370, 3, 'Cubo profundo - Color surtido', '&lt;p&gt;Cubo de plástico Saaj de 20 litros hecho de 100 por ciento de material Virgen. Diseñado para mejorar su decoración del baño. Los productos están diseñados teniendo en cuenta lo estético y la practicidad.&lt;br&gt;&lt;/p&gt;', '', 'Cubos, tinas y amp; Tazas', '', ''),
(370, 4, 'دلو عميق - ألوان متنوعة', '&lt;p&gt;دلو بلاستيكي من صاج 20 لتر مصنوع من 100 في المئة من المواد العذراء. مصمم لتعزيز ديكور الحمام الخاص بك. المنتجات التي تم تصميمها مع الأخذ في الاعتبار الجمالية وكذلك العملية.&lt;br&gt;&lt;/p&gt;', '', 'دلاء وأحواض وأحواض الأقداح', '', ''),
(371, 3, 'Taza de todos los tiempos - rosa', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cubos, tinas y amp; Tazas', '', ''),
(371, 4, 'كل القدح - الوردي', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 'دلاء وأحواض وأحواض الأقداح', '', ''),
(372, 3, 'Taza de todos los tiempos - rosa', '&lt;p&gt;All Time Mug contiene un potente marco y sugiere un excelente valor funcional y estético. Se preparan utilizando baquelita y otros PVC de alta calidad que los hace duraderos&lt;br&gt;&lt;/p&gt;', '', 'Cubos, tinas y amp; Tazas', '', ''),
(372, 4, 'كل القدح - الوردي', '&lt;p&gt;يحتوي كل مجس الوقت على إطار قوي ويقترح قيمة وظيفية وجمالية ممتازة. يتم إعدادها باستخدام الباكليت وغيرها من بولي كلوريد الفينيل عالية الجودة مما يجعلها تدوم لفترة طويلة&lt;br&gt;&lt;/p&gt;', '', 'دلاء وأحواض وأحواض الأقداح', '', ''),
(373, 3, 'Botella con lonchera - rosa', '&lt;p&gt;Simple pero elegante, la botella de plástico rosa Tupperware con lonchera es imprescindible en su cocina. Cuenta con un diseño elegante y ostenta un tono de color rosa.&lt;br&gt;&lt;/p&gt;', '', 'Botella, almuerzo y amp; Contenedores', '', ''),
(373, 4, 'زجاجة مع صندوق الغداء - وردي', '&lt;p&gt;بسيطة وأنيقة ، يجب أن يكون لديك زجاجة من البلاستيك الوردي مع صندوق الغداء في مطبخك. يتميز بتصميم أنيق و يتكئ بظلال اللون الوردي.&lt;br&gt;&lt;/p&gt;', '', 'زجاجة ، غداء &amp; أمبير ؛ حاويات', '', ''),
(374, 3, 'Botella de agua, color surtido, caja deliciosa', '&lt;p&gt;Caja de almuerzo de acero inoxidable ecológico con bolsa de almuerzo y botella de agua de acero inoxidable, de la Casa de Sreeram. Prepare una comida balanceada rápida y fácilmente.&lt;br&gt;&lt;/p&gt;', '', 'Botella, almuerzo y amp; Contenedores', '', ''),
(374, 4, 'زجاجة ماء ، ألوان متنوعة ، صندوق لذيذ', '&lt;p&gt;صندوق غداء مصنوع من الفولاذ المقاوم للصدأ صديق للبيئة مع حقيبة غداء وزجاجة مياه من الفولاذ المقاوم للصدأ ، من بيت الإيمان. حزم وجبة متوازنة بسرعة وسهولة.&lt;br&gt;&lt;/p&gt;', '', 'زجاجة ، غداء &amp; أمبير ؛ حاويات', '', ''),
(375, 3, 'Juego de botella y contenedor con tapa - Negro', '&lt;p&gt;Haga que Tupperware Set de 2 piezas Extreme Set Bottle 750 ml y Box 500 ml sean parte de sus utensilios de cocina para poder transportar líquidos fácilmente mientras viaja.&lt;br&gt;&lt;/p&gt;', '', 'Botella, almuerzo y amp; Contenedores', '', ''),
(375, 4, 'مجموعة من زجاجة وعلبة مع غطاء - أسود', '&lt;p&gt;طقم تيبيروير من قطعتين طقم زجاجة أقصى سعة 750 مل وصندوق 500 مل جزء من أدوات المطبخ ليتمكن من حمل السوائل بسهولة أثناء السفر.&lt;br&gt;&lt;/p&gt;', '', 'زجاجة ، غداء &amp; أمبير ؛ حاويات', '', ''),
(376, 3, 'Arroz Popular - Steam, Gold Mussoorie', '&lt;p&gt;Sona Masoori Silky Steam Rice es arroz aromático liviano. Tiene precios asequibles y muy higiénico.&lt;br&gt;&lt;/p&gt;', '', 'Arroz crudo', '', ''),
(376, 4, 'الأرز الشعبي - البخار ، سونا ما سووري', '&lt;p&gt;لذلك نا ما هو جدا أوالي الأرز حريري البخار هو أرز خفيف الوزن العطرية. لديها أسعار معقولة وصحية للغاية.&lt;br&gt;&lt;/p&gt;', '', 'الأرز الخام', '', ''),
(377, 3, 'Arroz - Raw, Gold Mussoorie', '&lt;p&gt;Sona Masoori Raw Rice tiene granos finos y es de gran sabor cuando se cocina. Este arroz se cultiva sin ningún pesticida químico, lo que conserva su gran sabor y olor.&lt;br&gt;&lt;/p&gt;', '', 'Arroz crudo', '', ''),
(377, 4, 'الأرز - الخام ، سونا ما سووري', '&lt;p&gt;لذلك فإن الأرز الخام يحتوي على حبيبات ناعمة وذو مذاق رائع عند طهيه. يزرع هذا الأرز بدون أي مبيدات كيماوية وبالتالي يحتفظ بنكهته ورائحته الرائعة.&lt;br&gt;&lt;/p&gt;', '', 'الأرز الخام', '', ''),
(378, 3, 'Arroz crudo Arroz Masoori - Super Premium', '&lt;p&gt;Sona masoori es una variedad de arroz blanco indio. Es un arroz de grano medio y olor dulce que es trivial y bajo en almidón. Sona masoori se usa naturalmente en platos como biryani, sweet pongal, arroz frito e idlis.&lt;br&gt;&lt;/p&gt;', '', 'Arroz crudo', '', ''),
(378, 4, 'أرز ماسوري الخام - سوبر بريميوم', '&lt;p&gt;سونا ماسوري هي مجموعة متنوعة من الأرز الأبيض الهندي. إنه أرز متوسط الحبة ، ذو رائحة حلوة ، وهو قليل المذاق وقليل من النشا. تستخدم سونا ماسوري بشكل طبيعي في أطباق مثل البرياني ، البونغل الحلو ، الأرز المقلي و idlis.&lt;br&gt;&lt;/p&gt;', '', 'الأرز الخام', '', ''),
(379, 3, 'Arroz Crudo - Estanque, Bolsa de 25 kg', '&lt;p&gt;Sona Masoori es una variedad de arroz blanco indio. Es un arroz de grano medio y dulce que es trivial y bajo en almidón. Sona Masoori se utiliza de forma natural en platos como Biryani, Sweet Pongal, Fried Rice e Idlis.&lt;br&gt;&lt;/p&gt;', '', 'Arroz crudo', '', ''),
(379, 4, 'أرز خام - بركة ، كيس 25 كجم', '&lt;p&gt;سونا ماسوري هي مجموعة متنوعة من الأرز الهندي الأبيض. إنه حبة متوسطة ، الأرز الحلو الرائحة التي تافهة ومنخفضة في النشا. سونا يستخدم بشكل طبيعي في أطباق مثل البرياني ، والبن غال الحلو ، فرايد رايس وإدليس.&lt;br&gt;&lt;/p&gt;', '', 'الأرز الخام', '', ''),
(380, 3, 'Arroz Basmati - Fiesta Rozzana', '&lt;p&gt;India Gate Basmati Rice Feast Rozzana se define por sus largos granos y sorprendente sabor aromático.&lt;br&gt;&lt;/p&gt;', '', 'Arroz basmati', '', ''),
(380, 4, 'أرز بسمتي - عيد الروز', '&lt;p&gt;بوابة الهند يتم تعريف الأرز البسمتي الأرز عن طريق الحبوب الطويلة والنكهة العطرية المدهشة.&lt;br&gt;&lt;/p&gt;', '', 'أرز بسمتي', '', ''),
(381, 3, 'Royal Basmati Rice - Premium', '&lt;p&gt;El arroz Royal Premium Basmati deja una impresión duradera debido a su aroma, sabor y textura esponjosa. Popularmente conocido como Pusa de los estados Basmati-rice-bowl de Punjab, Haryana y Uttarakhand&lt;br&gt;&lt;/p&gt;', '', 'Arroz basmati', '', ''),
(381, 4, 'أرز بسمتي الملكي - بريميوم', '&lt;p&gt;أرز بسمتي الملكي المميز يترك انطباعًا دائمًا بسبب رائحته ونكهته وملمسه الناعم. المعروف شعبيا من الدول البسمتي والأرز وعاء من البنجاب ، هاريانا&lt;br&gt;&lt;/p&gt;', '', 'أرز بسمتي', '', ''),
(382, 4, 'الأرز طويل الحبة', '&lt;p&gt;أرز حبة إيلينا الطويل ، نوعية الأرز طويل الحبة الذي يثبت أنه الأفضل ، بالإضافة إلى الرائحة اللذيذة.&lt;br&gt;&lt;/p&gt;', '', 'أرز بسمتي', '', ''),
(382, 1, ' Long Grain Rice', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Elina Long Grain Rice, the quality of long grain rice that proves to be the best, along with pleasing aroma.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Basmati Rice', '', ''),
(382, 3, 'Arroz de grano largo', '&lt;p&gt;Elina Long Grain Rice, la calidad del arroz de grano largo que resulta ser la mejor, junto con un aroma agradable.&lt;br&gt;&lt;/p&gt;', '', 'Arroz basmati', '', ''),
(383, 3, 'Arroz Basmati - Tradicional', '&lt;p&gt;Incluso el arroz al vapor puede ser una obra aromática del arte culinario. Cada grano de Daawat Traditional Basmati Rice está envejecido a la perfección, reviviendo el esplendor de nuestra cocina real.&lt;br&gt;&lt;/p&gt;', '', 'Arroz basmati', '', ''),
(383, 4, 'ارز بسمتي - تقليدي', '&lt;p&gt;حتى الأرز المطهو على البخار يمكن أن يكون عملًا عطريًا لفن الطهي. كل ذرة من دوات أرز بسمتي التقليدي متقن إلى الكمال ، وإحياء روعة المطبخ الملكي.&lt;br&gt;&lt;/p&gt;', '', 'أرز بسمتي', '', ''),
(384, 3, 'Grano entero más fino - negro', '&lt;p&gt;Sin gluten, bajo en calorías, alto en proteínas y fibra.&lt;br&gt;&lt;/p&gt;', '', 'Granos enteros', '', ''),
(384, 4, 'أروع حبة كاملة - أسود', '&lt;p&gt;خالي من الغلوتين ، منخفض في السعرات الحرارية ، يحتوي على نسبة عالية من البروتين والألياف.&lt;br&gt;&lt;/p&gt;', '', 'كل الحبوب', '', ''),
(385, 3, 'Salsa - Mostaza de grano entero', '&lt;p&gt;Happy Chef mostaza de grano entero implica una receta original de francés cuando se combina con queso. Prepárese para disfrutar de la mejor gama de salsas y salsas.&lt;br&gt;&lt;/p&gt;', '', 'Granos enteros', '', ''),
(385, 4, 'صلصة - خردل حبوب كاملة', '&lt;p&gt;يحتوي خردل هابي شيف كامل الحبوب على وصفة فرنسية أصلية عند الجمع مع الجبن. احصل على استعداد لتنغمس نفسك في أفضل مجموعة من الصلصات والانخفاضات.&lt;br&gt;&lt;/p&gt;', '', 'كل الحبوب', '', ''),
(386, 3, 'Orgánico: trigo integral Multi Atta', '&lt;p&gt;Organic Multi Grain Atta tiene un alto contenido de proteína y ayuda a mantener su cuerpo sano y activo. Tiene abundantes minerales que juegan un papel decisivo en la mejora de la vitalidad general del cuerpo.&lt;br&gt;&lt;/p&gt;', '', 'Granos enteros', '', ''),
(386, 4, 'عضوي - حبوب القمح الكامل', '&lt;p&gt;يحتوي الحبة العضوية المتعددة الحبوب على نسبة عالية من البروتين ويساعد في الحفاظ على صحة وسلامة جسمك. لديها معادن وفيرة تلعب دورا حاسما في تحسين الحيوية العامة للجسم.&lt;br&gt;&lt;/p&gt;', '', 'كل الحبوب', '', ''),
(387, 3, 'Pasta - Grano entero, bolsa de 500 g', '&lt;p&gt;Disfrute de la nueva pasta Mamy Whole Grain recién lanzada&lt;br&gt;&lt;/p&gt;', '', 'Granos enteros', '', ''),
(387, 4, 'مكرونة - حبوب كاملة ، 500 جم حافظة', '&lt;p&gt;استمتع المعكرونة الجديدة ماماي كاملة الحبوب&lt;br&gt;&lt;/p&gt;', '', 'كل الحبوب', '', ''),
(388, 3, 'Capsicum - Verde, cultivado orgánicamente', '&lt;p&gt;Fresho Capsicum - Verde, cultivado orgánicamente&lt;br&gt;&lt;/p&gt;', '', 'Vegetales orgánicos', '', ''),
(388, 4, 'الفليفلة - الأخضر ، يزرع عضويًا', '&lt;p&gt;فلفل أبيض طازج - أخضر ، ناضج عضويًا&lt;br&gt;&lt;/p&gt;', '', 'الخضروات العضوية', '', ''),
(389, 3, 'Zanahoria - Cultivada orgánicamente', '&lt;p&gt;Zanahoria fresca - cultivada orgánicamente&lt;br&gt;&lt;/p&gt;', '', 'Vegetales orgánicos', '', ''),
(389, 4, 'الجزر - نمت عضويا', '&lt;p&gt;فريشو جزر - نمت بشكل عضوي&lt;br&gt;&lt;/p&gt;', '', 'الخضروات العضوية', '', ''),
(390, 3, 'Frijoles - Racimo, cultivado orgánicamente', '&lt;p&gt;Fresho Beans - Grupo orgánico cultivado orgánicamente&lt;br&gt;&lt;/p&gt;', '', 'Vegetales orgánicos', '', ''),
(390, 4, 'البقول - المجموعة ، نمت بشكل عضوي', '&lt;p&gt;فاصوليا طازجة - مجموعة، نمت عضويا&lt;br&gt;&lt;/p&gt;', '', 'الخضروات العضوية', '', ''),
(391, 3, 'Coliflor - Cultivada orgánicamente', '&lt;p&gt;Coliflor fresca - cultivada orgánicamente&lt;br&gt;&lt;/p&gt;', '', 'Vegetales orgánicos', '', ''),
(391, 4, 'القرنبيط - نمت بشكل عضوي', '&lt;p&gt;فريشو القرنبيط - نمت بشكل عضوي&lt;br&gt;&lt;/p&gt;', '', 'الخضروات العضوية', '', ''),
(392, 3, 'Organics &amp; Naturals Malt - Multi Millet, germinado', '&lt;p&gt;Dhatu Sprouted Millet Malt está hecho con mijo de cola de zorra, mijo marrón, mijo Kodo y mijo pequeño. Todos los cuatro tipos de mijo son germinados, secos, ligeramente tostados y molidos en frío para resaltar el aroma y retener la cantidad máxima de nutrientes.&lt;br&gt;&lt;/p&gt;', '', 'Brotes enteros Gram', '', ''),
(392, 4, 'اورجانيك &amp; ناتشورالز مالت - ملتي ميليت، برعم', '&lt;p&gt;يرصد دخن الشعير باستخدام الدخن الثعلب ، الدخن البني الأعلى ، الدخن الكودو والدخن الصغير. تنبت جميع الأنواع الأربعة من القوالب ، ويتم تجفيفها ، وتقليصها بشكل معتدل ، وتسخينها على البارد لإخراج الرائحة والاحتفاظ بالحد الأقصى من المغذيات.&lt;br&gt;&lt;/p&gt;', '', 'براعم كاملة جرام', '', ''),
(393, 3, 'Brotes - Gram Green', '&lt;p&gt;Los brotes de soja son los brotes jóvenes del frijol mungo con pequeñas hojas de color amarillo pálido a verde pálido unidas en un brote plateado blanco brillante.&lt;br&gt;&lt;/p&gt;', '', 'Brotes enteros Gram', '', ''),
(393, 4, 'براعم - غرام الأخضر', '&lt;p&gt;براعم الفاصوليا هي البراعم الشابة لحبة المونج ذات اللون الأصفر الشاحب الصغير إلى الأوراق الخضراء الشاحبة المرفقة على النار الأبيض اللامع اللامع.&lt;br&gt;&lt;/p&gt;', '', 'براعم كاملة جرام', '', ''),
(394, 3, 'Royal Fried Gram', '&lt;p&gt;Fried Gram puede consumirse en forma de semillas secas enteras o pueden separarse de la cáscara y dividirse en dos en un molino.&lt;br&gt;&lt;/p&gt;', '', 'Brotes enteros Gram', '', ''),
(394, 4, 'رويال فرايد غرام', '&lt;p&gt;يمكن أن تستهلك المقلية غرام في شكل بذور مجففة كاملة أو يمكن فصلها عن قشرتها وتقسيمها إلى اثنين في مطحنة.&lt;br&gt;&lt;/p&gt;', '', 'براعم كاملة جرام', '', ''),
(395, 3, 'Brotes - Channa Brown', '&lt;p&gt;Fresho brotes - Channa Brown&lt;br&gt;&lt;/p&gt;', '', 'Brotes enteros Gram', '', ''),
(395, 4, 'براعم - تشانا براون', '&lt;p&gt;براعم فريشو - تشانا براون&lt;br&gt;&lt;/p&gt;', '', 'براعم كاملة جرام', '', ''),
(396, 3, 'Amul Fresh Cream', '&lt;p&gt;Amul Fresh Cream ha sido procesada para dar una consistencia suave y hacer preparaciones para la boca.&lt;br&gt;&lt;/p&gt;', '', 'Crema de leche', '', ''),
(396, 4, 'امول فريش كريم', '&lt;p&gt;تم تجهيز كريم أمول الطازج ليعطي السلس والاتساق ويجعل استعدادات الري الفم.&lt;br&gt;&lt;/p&gt;', '', 'كريم الحليب', '', ''),
(397, 3, 'Baby Milk Cream', '&lt;p&gt;Milk Cream contiene una combinación única de extracto de leche natural y vitaminas A y E. Con dos nutrientes, este producto ayuda a reponer la humedad para dejar la piel suave al bebé.&lt;br&gt;&lt;/p&gt;', '', 'Crema de leche', '', ''),
(397, 4, 'كريم حليب الأطفال', '&lt;p&gt;يحتوي كريم الحليب على مزيج فريد من مستخلصات الحليب الطبيعية والفيتامينات أ. مع ضعف التغذية ، يساعد هذا المنتج على تجديد الرطوبة لترك البشرة ناعمة.&lt;br&gt;&lt;/p&gt;', '', 'كريم الحليب', '', ''),
(398, 3, 'Mocktail - Irish Cream', '&lt;p&gt;Landessa Irish Cream es una refrescante mocktail de leche sin carbonato con sabor. Es Ultra-Heat Treaded y hace una gran bebida en el camino, y una bebida aún mejor para saborear al final del día en un vaso alto con hielo.&lt;br&gt;&lt;/p&gt;', '', 'Crema de leche', '', ''),
(398, 4, 'موكتيل - الأيرلندية كريم', '&lt;p&gt;كريم لانديسا الأيرلندي هو حليب منعش غير مكربن ، بنكهة الحليب. هو [توو-هيت] [تووتد] &amp;amp; يجعل عظيم [أون-و-س] شراب ، &amp;amp; حتّى شراب جيّدة أن يستمتع في النهاية من اليوم في [تلّ غلاس] مع ثلج.&lt;br&gt;&lt;/p&gt;', '', 'كريم الحليب', '', ''),
(399, 3, 'Leche crujiente con crema de leche', '&lt;p&gt;Loacker Wafer Filled - Leche crujiente con crema de leche&lt;br&gt;&lt;/p&gt;', '', 'Crema de leche', '', ''),
(399, 4, 'حليب مقرمش مع حليب كريمة', '&lt;p&gt;لواركر ويفر محشي - حليب مقرمش مع حليب كريم&lt;br&gt;&lt;/p&gt;', '', 'كريم الحليب', '', ''),
(400, 3, 'Yoghurt Berry Delight', '&lt;p&gt;Una combinación berrícola de fresas y arándanos seleccionados a mano, junto con la bondad del yogur en deliciosos helados, que hacen de Yoghurt Berry Delight un placer especial.&lt;br&gt;&lt;/p&gt;', '', 'Crema de yogur', '', ''),
(400, 4, 'زبادي بيري ديلايت', '&lt;p&gt;مزيج التوت البري من الفراولة والتوت البري المنتقاة بعناية مع صلصة الزبادي في الآيس كريم اللذيذ ، مما يجعل الزبادي بيري ديلايت متعة خاصة.&lt;br&gt;&lt;/p&gt;', '', 'كريم الزبادي', '', ''),
(401, 3, 'Cream Crunchiest Avellana con sabor', '&lt;p&gt;Crunch n Cream Crunchiest Hazelnut&lt;br&gt;&lt;/p&gt;', '', 'Crema de yogur', '', ''),
(401, 4, 'كريم بنكهة بنكهة البندق', '&lt;p&gt;أزمة ن كريم أزمة ايز البندق&lt;br&gt;&lt;/p&gt;', '', 'كريم الزبادي', '', ''),
(402, 3, 'Rollitos de obleas con sabor a crema', '&lt;p&gt;Textura muy crujiente y agradable olor a sabor.&lt;br&gt;&lt;/p&gt;', '', 'Crema de yogur', '', ''),
(402, 4, 'نكهة كريم ويفر لفة', '&lt;p&gt;نسيج متموج جدا ورائحة طيبة من النكهة.&lt;br&gt;&lt;/p&gt;', '', 'كريم الزبادي', '', ''),
(403, 3, 'Farm My Favorite Cottage Cream', '&lt;p&gt;Disfrute el sabor atractivo del corazón de Bisk Farm Cottage Biscuits que viene en un sabor vanilla. La crema intercalada entre las dos capas de esta luz y galletas crujientes.&lt;br&gt;&lt;/p&gt;', '', 'Crema de yogur', '', ''),
(403, 4, 'مزرعة بلدي المفضل الكوخ كريم', '&lt;p&gt;استمتع بالنكهة الجذابة للقلب من بسكويت كاسات البسكويت الذي يأتي في طعم الفانيليا. وقد تم وضع الكريم بين طبقتين من هذا البسكويت الخفيف والقشري.&lt;br&gt;&lt;/p&gt;', '', 'كريم الزبادي', '', ''),
(404, 3, 'Go Cream - Fresh', '&lt;p&gt;Hecho de leche de vaca fresca, da sensación de leche de vaca en la boca, mejora el sabor de los platos, UHT mantiene la sensibilidad de la crema fresca&lt;br&gt;&lt;/p&gt;', '', 'Crema fresca', '', ''),
(404, 4, 'الذهاب كريم - طازجة', '&lt;p&gt;مصنوع من حليب البقر الطازج ، يعطي ملمس الفم من حليب البقر ، يحسن نكهة الأطباق ، يحافظ على أهلية حساسية الكريمة الطازجة&lt;br&gt;&lt;/p&gt;', '', 'كريمة طازجة', '', ''),
(405, 3, 'Pasteles frescos - Pasteles de crema de chocolate', '&lt;p&gt;Esponja de chocolate cubierta con crema, mezcla de chocolate y coronada con rica Trufa de Choco.&lt;br&gt;&lt;/p&gt;', '', 'Crema fresca', '', ''),
(405, 4, 'كيك طازجة - شوكولاته كريم جاتو', '&lt;p&gt;إسفنجة شوكولا مغطاة بالكريمة ، خليط شوكولا وتعلوها شوكولاتة شوكولاتة غنية.&lt;br&gt;&lt;/p&gt;', '', 'كريمة طازجة', '', ''),
(406, 3, 'Gel de ducha - Vitalidad fresca', '&lt;p&gt;Nivea Shower Gel - La fórmula Vitality Fresh for Men está enriquecida con minerales oceánicos habituales que lavan suavemente las impurezas y el exceso de sebo para mantener el cabello y la piel perfectamente frescos y limpios.&lt;br&gt;&lt;/p&gt;', '', 'Crema fresca', '', ''),
(406, 4, 'جل الاستحمام - فيتالي فريش', '&lt;p&gt;نيي فيا جل الاستحمام - معجون حيوي للذكور ، غني بالمعادن المحيطية المعتادة التي تغسل الشوائب و الزهم الزائد ليبقي شعرك و بشرتك منتعشة و نظيفة.&lt;br&gt;&lt;/p&gt;', '', 'كريمة طازجة', '', ''),
(407, 3, 'Dove Go Loción para el cuerpo fresca', '&lt;p&gt;Reponga la humedad en su piel seca con la nutrición de la loción para el cuerpo Dove Go Fresh. Esta loción de cuerpo y manos de rápida absorción de Dove consiste en un refrescante aroma de pepino y té verde, junto con una refrescante sensación de mentol que revitaliza tu piel. Esta loción deja la piel con sensación de rocío y suave.&lt;br&gt;&lt;/p&gt;', '', 'Crema fresca', '', ''),
(407, 4, 'دوف جو فريش لوشن للجسم', '&lt;p&gt;قم بتجديد الرطوبة في بشرتك الجافة مع تغذية غسول الجسم دوف جو فريش. يتكون غسول اليد والجسم سريع الامتصاص من حمامة منعشة ورائحة الشاي الأخضر ، بالإضافة إلى إحساس منعش ينتعش بشرتك! هذا المستحضر يترك البشرة بشعور ندي وناعمي.&lt;br&gt;&lt;/p&gt;', '', 'كريمة طازجة', '', ''),
(408, 3, 'Nestlé A + leche tonificada', '&lt;p&gt;Nestlé se ha asociado con productos puros que fomentan la buena salud. Este cartón de 1 litro de leche tonificada no es diferente.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada Nestle', '', ''),
(408, 4, 'نستله + حليب ملون', '&lt;p&gt;وقد ارتبط نستله بالمنتجات النقية التي تشجع على الصحة الجيدة. هذا الحليب منغم 1 لتر كرتون لا يختلف.&lt;br&gt;&lt;/p&gt;', '', 'نستله حليب مكثف', '', ''),
(409, 3, 'Leche en polvo - EveryDay', '&lt;p&gt;No es de extrañar, entonces, que en pruebas de sabor a ciegas, los consumidores clasificaron el té hecho con NESTLE EVERYDAY como su elección número uno para una taza de té perfecta.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada Nestle', '', ''),
(409, 4, 'مسحوق الحليب - كل يوم', '&lt;p&gt;لا عجب بعد ذلك ، في اختبارات الذوق الأعمى ، صنّف المستهلكون الشاي المصنوع من الخيار الأول لاختيار كوب مثالي من الشاي.&lt;br&gt;&lt;/p&gt;', '', 'نستله حليب مكثف', '', ''),
(410, 3, 'Nestle Milkmaid', '&lt;p&gt;La lechera como un nombre sinónimo de deliciosos postres ha estado deleitando a generaciones de consumidores indios en los últimos 100 años&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada Nestle', '', ''),
(410, 4, 'نستله ميلكميد', '&lt;p&gt;خادمة الحليب كإسم مرادف للحلويات اللذيذة قد سُررت أجيال المستهلكين الهنود خلال الـ 100 عام الماضية&lt;br&gt;&lt;/p&gt;', '', 'نستله حليب مكثف', '', ''),
(411, 3, 'Nestle en Pro', '&lt;p&gt;Esto se aplica particularmente a los bebés que no pueden ser amamantados. Cuando se trata de bebés, la leche materna es definitivamente lo mejor para protegerlos de la enfermedad.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada Nestle', '', ''),
(411, 4, 'نستله في برو', '&lt;p&gt;يتم إعطاء هذا بشكل خاص للأطفال الذين لا يمكن رضاعة طبيعية. عندما يتعلق الأمر بالأطفال ، فإن حليب الأم هو بالتأكيد الأفضل لحمايتهم من الأمراض.&lt;br&gt;&lt;/p&gt;', '', 'نستله حليب مكثف', '', ''),
(412, 3, 'Kit de helado de leche criada - Summer Special', '&lt;p&gt;Solución completa de receta de helado. Contiene todos los ingredientes que necesitas para hacer deliciosos helados con MILKMAID.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada lechera', '', ''),
(412, 4, 'حليب خادمة ايس كريم - صيف خاص', '&lt;p&gt;استكمال الحل وصفة الآيس كريم. أنه يحتوي على جميع المكونات التي تحتاج إليها لصنع الآيس كريم اللذيذ مع خادمة الحليب&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada lechera', '', ''),
(413, 3, 'Leche desnatada GoodLife', '&lt;p&gt;Nandini Goodlife Skimmed Milk es perfecto para las personas que intentan controlar su peso; esta leche sin grasa se procesa de manera higiénica y se puede tomar dos veces al día.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada lechera', '', ''),
(413, 4, 'حليب جود لايف منزوع الدسم', '&lt;p&gt;نان ديني حياة جيدة منزوع الدسم حليب مثالي للأشخاص الذين يحاولون مراقبة وزنهم. يتم معالجة هذا الحليب بدون دهون بشكل صحي ويمكن تناوله مرتين في اليوم.&lt;br&gt;&lt;/p&gt;', '', 'خادمة الحليب حليب مكثف', '', ''),
(414, 3, 'Taaza Toned Milk', '&lt;p&gt;Conocido por sus productos lácteos, confitería y otros productos, Amul es una de las mejores marcas en la industria alimentaria de la India.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada lechera', '', ''),
(414, 4, 'تعز تونيد ميلك', '&lt;p&gt;تشتهر أمول بمنتجات الألبان والحلويات وغيرها من المنتجات ، وتعتبر واحدة من أفضل العلامات التجارية في صناعة الأغذية الهندية.&lt;br&gt;&lt;/p&gt;', '', 'خادمة الحليب حليب مكثف', '', ''),
(415, 3, 'Leche de soja - Chocolate', '&lt;p&gt;Prepárese con un delicioso chocolate con sabor a SOFIT. Ya sea un día lleno de trabajo o lleno de diversión, ¡haz más con Sofit! SOFIT Soya Milk es una deliciosa bebida saludable para todos en la familia.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada lechera', '', ''),
(415, 4, 'حليب الصويا - شوكولا', '&lt;p&gt;الحصول على مجموعة مع لذيذ بنكهة الشوكولاتة حتى تناسب. سواء كان يومًا مليئًا بالعمل أو مليئًا بالمرح ، افعل المزيد مع حليب الصويا البسيط هو مشروب صحي لذيذ لكل فرد في العائلة.&lt;br&gt;&lt;/p&gt;', '', 'خادمة الحليب حليب مكثف', '', ''),
(416, 3, 'GoodLife Toned Milk', '&lt;p&gt;Adecuado para preparar té / café, batidos de leche y delicias de leche para las personas que llevan un estilo de vida consciente de la aptitud.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada azucarada', '', ''),
(416, 4, 'الحياة الجيدة منغم الحليب', '&lt;p&gt;مناسبة لإعداد الشاي / القهوة ، ومشروبات الحليب ومشروبات الحليب للأشخاص الذين يقودون نمط حياة واعية.&lt;br&gt;&lt;/p&gt;', '', 'المحلاة الحليب المكثف', '', ''),
(417, 3, 'Leche de soja - Pistacho de azafrán', '&lt;p&gt;¿Está buscando una excelente manera de comenzar su día? ¡Prueba la SOFIT con sabor a Kesar Pista! SOFIT Soya Milk es una deliciosa bebida saludable para todos en la familia.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada azucarada', '', ''),
(417, 4, 'حليب الصويا - زعفران الفستق', '&lt;p&gt;هل تبحث عن طريقة رائعة لبدء يومك؟ جرّب حليب (سويا ميلك) من كيسار بيستا ، وهو مشروب صحي لذيذ لكل فرد في العائلة.&lt;br&gt;&lt;/p&gt;', '', 'المحلاة الحليب المكثف', '', ''),
(418, 3, 'Leche de soja sin azúcar', '&lt;p&gt;Sin azúcar SOFIT, sin azúcar añadido. ¡Una excelente forma de comenzar tu día! SOFIT Soya Milk es una deliciosa bebida saludable para todos en la familia.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada azucarada', '', ''),
(418, 4, 'حليب الصويا - خالية من السكر', '&lt;p&gt;سكر خالي من السكر ، بدون سكر مضاف. طريقة رائعة لبدء يومك! حليب الصويا الأريكة هو مشروب صحي لذيذ لكل فرد في الأسرة.&lt;br&gt;&lt;/p&gt;', '', 'المحلاة الحليب المكثف', '', ''),
(419, 3, 'Leche aromatizada - Badam', '&lt;p&gt;Badam Flavoured Milk: Nandini Badam Flavoured Milk, una energizante bebida saludable que refrescará sus sentidos, esterilizada a altas temperaturas y empacada asépticamente para asegurar alta calidad y pureza.&lt;br&gt;&lt;/p&gt;', '', 'Leche condensada azucarada', '', ''),
(419, 4, 'حليب النكهة - سيئة', '&lt;p&gt;حليب بنكهة النكهة: حليب النانديني سيء النكهة ، مشروب صحي منشط من شأنه أن ينعش حواسك ، معقم في درجات حرارة عالية وتعبئته بشكل مطهر لضمان الجودة العالية والنقاء.&lt;br&gt;&lt;/p&gt;', '', 'المحلاة الحليب المكثف', '', ''),
(420, 3, 'Freso Banana - Robusta', '&lt;p&gt;Disfrute de la textura suave y mantecosa de los plátanos Robusta que son de color verde claro y tienen una gran fragancia y sabor.&lt;br&gt;&lt;/p&gt;', '', 'Plátano', '', ''),
(420, 4, 'فرسو الموز - روبوستا', '&lt;p&gt;استعملي الملمس الناعم المليء بالزبد لموزنا روبوستا الأخضر الفاتح ولديه رائحة وطعم رائع.&lt;br&gt;&lt;/p&gt;', '', 'موز', '', ''),
(421, 3, 'Plátano - Verde crudo', '&lt;p&gt;El plátano verde es un plátano amarillo sin madurar. Es un suministro superior de fibra, minerales y vitaminas y contiene un almidón. Es rico en vitamina B6, C, fibra y potasio. Se comporta más como una fibra que como un almidón.&lt;br&gt;&lt;/p&gt;', '', 'Plátano', '', ''),
(421, 4, 'الموز - الخام الأخضر', '&lt;p&gt;الموز الأخضر هو الموز الأصفر غير منقط. إنه توفير أعلى من الألياف والمعادن والفيتامينات ويحتوي على نشا. وهو غني بفيتامين ب 6 ، ج ، الالياف والبوتاسيوم. ينفذ أكثر مثل الألياف من النشا.&lt;br&gt;&lt;/p&gt;', '', 'موز', '', ''),
(422, 3, 'Plátano - Rojo', '&lt;p&gt;Apartándose de las variedades comunes de plátanos amarillos, los plátanos rojos son cortos, regordetes y de color púrpura rojizo. Incluso la carne es de color rosa claro y más dulce en comparación con otras variedades.&lt;br&gt;&lt;/p&gt;', '', 'Plátano', '', ''),
(422, 4, 'الموز - الأحمر', '&lt;p&gt;وبصرف النظر عن الأنواع الشائعة من الموز الأصفر ، فإن الموز الأحمر يكون لونه قصيرًا وممتلئًا ولونه أحمر ضارب إلى الحمرة. حتى اللحم هو وردي فاتح وأحمر مقارنة مع الأصناف الأخرى.&lt;br&gt;&lt;/p&gt;', '', 'موز', '', ''),
(423, 3, 'Chips - Pimienta de plátano', '&lt;p&gt;Las patatas fritas de plátano son un refrigerio indio tradicional, también una rica fuente de minerales como fibra, hierro y potasio.&lt;br&gt;&lt;/p&gt;', '', 'Plátano', '', ''),
(423, 4, 'رقائق - فلفل موز', '&lt;p&gt;رقائق الموز الفلفل هو وجبة خفيفة الهندية التقليدية ، أيضا مصدر غني بالمعادن مثل الألياف والحديد والبوتاسيوم.&lt;br&gt;&lt;/p&gt;', '', 'موز', '', ''),
(424, 3, 'Papaya - Semi maduro', '&lt;p&gt;Las papayas semi maduras tienen una mezcla de consistencia mantecosa dulce y sabor agrio. Son medio verdes y medio amarillos.&lt;br&gt;&lt;/p&gt;', '', 'Papaya', '', ''),
(424, 4, 'البابايا - شبه ريب', '&lt;p&gt;الببايا شبه ناضجة لديها مزيج من اتساق زبداني الحلو والطعم الحامض. هم نصف أخضر ونصف أصفر.&lt;br&gt;&lt;/p&gt;', '', 'بابايا', '', ''),
(425, 3, 'Papaya, en cubos', '&lt;p&gt;Un montón de deliciosos trozos recién cortados de papaya es irresistible para cualquier comida. Hemos limpiado, cortado en cubitos y empacado cuidadosamente las papayas para que las consuma en el camino.&lt;br&gt;&lt;/p&gt;', '', 'Papaya', '', ''),
(425, 4, 'البابايا - مكعبات', '&lt;p&gt;الكثير من قطع البابايا اللذيذة الطازجة لا تقاوم لأي وجبة. قمنا بتنظيف وتغليف مكعبات البابايا بعناية لتقوم باستهلاكها أثناء التنقل.&lt;br&gt;&lt;/p&gt;', '', 'بابايا', '', ''),
(426, 3, 'Papaya - cultivado orgánicamente', '&lt;p&gt;Las papayas son grandes y tienen forma de pera con color de piel de verde a amarillo cuando están maduras. La carne es de color anaranjado pálido con numerosas semillas pequeñas, negras y pegajosas en el centro.&lt;br&gt;&lt;/p&gt;', '', 'Papaya', '', ''),
(426, 4, 'البابايا - نمت عضويا', '&lt;p&gt;البابايا هي كبيرة والكمثرى على شكل أخضر ولون البشرة الصفراء عندما تنضج. اللحم هو برتقالي شاحب مع العديد من البذور الصغيرة والسوداء اللزجة في المركز.&lt;br&gt;&lt;/p&gt;', '', 'بابايا', '', ''),
(427, 3, 'Papaya - Crudo', '&lt;p&gt;Fresho es nuestra marca de frutas y verduras frescas, elegidas individualmente a diario por nuestros compradores experimentados y técnicamente competentes. Nuestros procesos de compra, almacenamiento y envasado están diseñados para garantizar que solo los productos frescos, ricos en nutrientes, saludables y deliciosos lleguen a su puerta.&lt;br&gt;&lt;/p&gt;', '', 'Papaya', '', ''),
(427, 4, 'ثمرة البابايا (نيئة', '&lt;p&gt;س الطازجة هي علامتنا التجارية من الفواكه والخضروات الطازجة والتي يتم اختيارها بشكل فردي كل يوم من قبل المشترين لدينا ذوي الخبرة وذوي الكفاءة الفنية. تم تصميم عمليات الشراء والتخزين والتعبئة لضمان وصول المنتجات الطازجة والمغذية الغنية بالصحة واللذيذة إلى عتبة منزلك.&lt;br&gt;&lt;/p&gt;', '', 'بابايا', '', ''),
(428, 3, 'El dedo de las señoras', '&lt;p&gt;El dedo de las señoras es una verdura verde con una punta en el extremo y una cabeza verde más clara, que es inedibe y para tirar.&lt;br&gt;&lt;/p&gt;', '', 'Lady Finger', '', ''),
(428, 4, 'إصبع السيدات', '&lt;p&gt;إصبع السيدات هو الخضار الأخضر مع طرف في نهاية المطاف ورأس أخضر أخف ، وهو في طور ويرمى بعيدا.&lt;br&gt;&lt;/p&gt;', '', 'اصبع سيدة', '', ''),
(429, 3, 'Dedo de mujer - en cubos', '&lt;p&gt;Fresho te trae el dedo de damas cortado en cubitos con un sabor suave y ligeramente herboso.&lt;br&gt;&lt;/p&gt;', '', 'Lady Finger', '', ''),
(429, 4, 'إصبع السيدات - مكعبات', '&lt;p&gt;الطازجة يا يجلب لك مكعبات إصبع السيدات مع نكهة عشبية خفيفة وقليلا.&lt;br&gt;&lt;/p&gt;', '', 'اصبع سيدة', '', ''),
(430, 1, 'Healthy Chips - Gourmet Spiced', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Vacuum Fried Vegetable Chips are low on fat, as they retain all nutrients, colour, flavour and texture of the vegetables, but are crispy and a great mid meal snack for all those hunger pangs.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Lady Finger', '', ''),
(430, 3, 'Chips Saludables - Especias Gourmet', '&lt;p&gt;Las patatas fritas al vacío para vegetales son bajas en grasa, ya que retienen todos los nutrientes, el color, el sabor y la textura de las verduras, pero son crujientes y un gran refrigerio a mitad de la comida para todos esos dolores de hambre.&lt;br&gt;&lt;/p&gt;', '', 'Lady Finger', '', ''),
(430, 4, 'رقائق صحية - جورميه متبل', '&lt;p&gt;رقائق الخضروات المقلية منخفضة الدهون ، لأنها تحتفظ بجميع العناصر الغذائية ، واللون ، والنكهة والملمس من الخضروات ، ولكن هي مقرمشة ووجبة خفيفة وجبة كبيرة لجميع تلك آلام الجوع.&lt;br&gt;&lt;/p&gt;', '', 'اصبع سيدة', '', ''),
(431, 3, 'Mysore Bhindi', '&lt;p&gt;Mysore bhindi es una verdura verde con una punta en el extremo y una cabeza verde más clara, que no es comestible y se puede tirar.&lt;br&gt;&lt;/p&gt;', '', 'Lady Finger', '', ''),
(431, 4, 'ميسور بندي', '&lt;p&gt;إن قرني عبارة عن خضروات خضراء مع طرف في النهاية ورأس أخضر أخف ، وهو غير صالح للأكل ويتم التخلص منه.&lt;br&gt;&lt;/p&gt;', '', 'اصبع سيدة', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(432, 3, 'Coco - cultivado orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Fruta orgánica', '', ''),
(432, 4, 'جوز الهند - نمت عضويا', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'فاكهة عضوية', '', ''),
(433, 3, 'Granada - Cultivada orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Fruta orgánica', '', ''),
(433, 4, 'الرمان - نمت عضويًا', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'فاكهة عضوية', '', ''),
(434, 4, 'البطيخ - نمت عضويا', '&lt;p&gt;مع الأسود المخضر إلى السطح الأخضر الداكن الناعم ، فإننا نختار بشكل انتقائي البطيخ المزروع عضويًا من أفضل المزارع&lt;br&gt;&lt;/p&gt;', '', 'فاكهة عضوية', '', ''),
(434, 1, 'Watermelon - Organically Grown', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;With greenish black to smooth dark green surface, we selectively pick organically grown watermelons from the best farms&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Fruit', '', ''),
(434, 3, 'Sandía - Cultivada orgánicamente', '&lt;p&gt;Con negro verdoso para suavizar la superficie de color verde oscuro, seleccionamos selectivamente sandías cultivadas orgánicamente de las mejores granjas&lt;br&gt;&lt;/p&gt;', '', 'Fruta orgánica', '', ''),
(435, 3, 'Sweet Lime - Cultivada orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Fruta orgánica', '', ''),
(435, 4, 'الجير الحلو - نمت عضويا', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'فاكهة عضوية', '', ''),
(436, 3, 'Ajo - Cultivado orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Vegetales orgánicos', '', ''),
(436, 4, 'الثوم - نمت عضويا', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'الخضروات العضوية', '', ''),
(437, 3, 'Cúrcuma fresca - cultivada orgánicamente', '&lt;p&gt;La cúrcuma fresca tiene un tono de color más claro que la cúrcuma común. Esto se ve bastante similar al jengibre, pero el sabor es terroso y picante.&lt;br&gt;&lt;/p&gt;', '', 'Vegetales orgánicos', '', ''),
(437, 4, 'الكركم الطازج - نمت عضويا', '&lt;p&gt;يحتوي الكركم الطازج على لون فاتح اللون أكثر من الكركم العادي. يبدو هذا مشابهاً تماماً للزنجبيل ، ولكن الطعم هو ترابي وفلفل.&lt;br&gt;&lt;/p&gt;', '', 'الخضروات العضوية', '', ''),
(438, 3, 'Pepino - cultivado orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Vegetales orgánicos', '', ''),
(438, 4, 'الخيار - نمت بشكل عضوي', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'الخضروات العضوية', '', ''),
(439, 3, 'Zanahoria - Cultivada orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Vegetales orgánicos', '', ''),
(439, 4, 'الجزر - نمت عضويا', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'الخضروات العضوية', '', ''),
(440, 3, 'Mango - Neelam', '&lt;p&gt;Los mangos tienen una forma perfecta: una base grande, oblonga y puntiaguda. La piel es de color amarillo dorado con un aroma floral y un sabor ácido-dulce. Es una variedad de temporada tardía.&lt;br&gt;&lt;/p&gt;', '', 'Mangos', '', ''),
(440, 4, 'مانجو - نيلام', '&lt;p&gt;المانجو هي عبارة عن قاعدة كبيرة ، مستطيلة ومدببة. الجلد أصفر ذهبي مع رائحة زهرية وطعم حلو حمضي. إنه تنوع الموسم المتأخر.&lt;br&gt;&lt;/p&gt;', '', 'المانجو', '', ''),
(440, 1, 'Mango - Neelam', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Mangoes are perfectly shaped- large, oblong and pointed base. The skin is golden yellow with a floral aroma and an acidic-sweet taste. It is a late season variety.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mangoes', '', ''),
(441, 3, 'Mango - Crudo', '&lt;p&gt;El mango crudo es una fruta de olor dulce que es del agrado de todos por su sabor agrio.&lt;br&gt;&lt;/p&gt;', '', 'Mangos', '', ''),
(441, 4, 'المانجو - الخام', '&lt;p&gt;المانجو الخام هو فاكهة حلوة الرائحة التي يحبها آل نكهة لاذع.&lt;br&gt;&lt;/p&gt;', '', 'المانجو', '', ''),
(442, 3, 'Mango - Totapuri', '&lt;p&gt;Con un pico tipo loro en la punta de la fruta, Totapuri de piel amarilla verdosa es una mezcla perfecta de dulzura y acidez. Tiene un rico sabor aromático.&lt;br&gt;&lt;/p&gt;', '', 'Mangos', '', ''),
(442, 4, 'مانجو - توتابوري', '&lt;p&gt;مع ببغاء مثل المنقار عند طرف الفاكهة ، فإن توتابوري ذو البشرة الصفراء المخضر هو مزيج مثالي من الحلاوة والفم. لها نكهة عطرية غنية.&lt;br&gt;&lt;/p&gt;', '', 'المانجو', '', ''),
(443, 3, 'Jugo - Mango', '&lt;p&gt;Maaza es la bebida de mango complaciente y lista para servir, hecha de pulpa de mango y elegida personalmente por Alphonso.&lt;br&gt;&lt;/p&gt;', '', 'Mangos', '', ''),
(443, 4, 'عصير - مانجو', '&lt;p&gt;مازا هو المشروب المانجو الجاهز للخدمة ، والمصنوع من لب المانجو والمكسور ألفونسو.&lt;br&gt;&lt;/p&gt;', '', 'المانجو', '', ''),
(444, 3, 'Muskmelon - Rayado', '&lt;p&gt;Los melones de Fresho a rayas tienen una piel externa distintiva que es lisa, con nervaduras verdes en la superficie de color gris pistacho. Su carne es de color naranja, dulce con un aroma floral. Los melones de Fresho se obtienen directamente de nuestros agricultores.&lt;br&gt;&lt;/p&gt;', '', 'Melones', '', ''),
(444, 4, 'الشمام - مخطط', '&lt;p&gt;يتميز الشمام الطازج المخطط بجلد خارجي متميز يكون ناعماً مع تضاريس خضراء على سطح الفستق الرمادي الملون. لحمها برتقالي اللون ، حلو مع رائحة زهرية. يتم شراؤها مباشرة من مزارعينا.&lt;br&gt;&lt;/p&gt;', '', 'شمام', '', ''),
(445, 3, 'Muskmelon - pequeño neto', '&lt;p&gt;es un melón redondo con pulpa firme, anaranjada, moderadamente dulce y una corteza delgada, reticulada, de color gris claro.&lt;br&gt;&lt;/p&gt;', '', 'Melones', '', ''),
(445, 4, 'شمام - صغار صغيرة', '&lt;p&gt;لها البطيخ المستديرة مع لحم ، والبرتقال ، والحلو معتدل وقشرة رقيقة ، شبكي ، وردي فاتح.&lt;br&gt;&lt;/p&gt;', '', 'شمام', '', ''),
(446, 3, 'Muskmelon - en cubos', '&lt;p&gt;Nuestros melones en cubos están listos para comer o se pueden mezclar con otras frutas en su ensalada. Dulce pero no exagerado, nuestro melón maduro tiene un aroma refrescante y mucho jugo. Perfecto como un refrigerio saludable para el té.&lt;br&gt;&lt;/p&gt;', '', 'Melones', '', ''),
(446, 4, 'الشمام - مكعبات', '&lt;p&gt;لدينا الشمامات مكعبات جاهزة للأكل أو يمكن أن تكون مختلطة مع الفواكه الأخرى في السلطة الخاصة بك. حلوة ولكن ليس فوق الحلو ، لدينا شمام قد حان لديه رائحة منعشة والكثير من العصير. مثالي كوجبة خفيفة لتناول وجبة خفيفة صحية.&lt;br&gt;&lt;/p&gt;', '', 'شمام', '', ''),
(447, 3, 'Sun Melon', '&lt;p&gt;Una fruta que viene con una piel amarilla mantecosa y carne translúcida, el melón Sun tiene un aroma y sabor dulce. Cuando el melón está maduro, su dura corteza se vuelve de color amarillo brillante.&lt;br&gt;&lt;/p&gt;', '', 'Melones', '', ''),
(447, 4, 'صن ميلون', '&lt;p&gt;الفاكهة التي تأتي مع الجلد الأصفر الغامق واللحم الشفاف ، تحتوي الشمس البطيئة على نكهة حلوة ونكهة. عندما ينضج البطيخ ، تتحول قشورته الصلبة إلى صفراء زاهية.&lt;br&gt;&lt;/p&gt;', '', 'شمام', '', ''),
(448, 4, 'بطاطا بصل الطماطم', '&lt;p&gt;بطاطا بصل الطماطم كل كومبو&lt;br&gt;&lt;/p&gt;', '', 'البطاطس ، الطماطم', '', ''),
(448, 1, 'Potato Onion Tomato ', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: &amp;quot;Roboto Slab&amp;quot;, serif; background-color: rgb(242, 240, 235);&quot;&gt;&amp;nbsp;Potato Onion Tomato&amp;nbsp; Each, Combo&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Potato, Tomato', '', ''),
(448, 3, 'Tomate de cebolla y patata', '&lt;p&gt;Tomate de cebolla con patata cada uno, combinado&lt;br&gt;&lt;/p&gt;', '', 'Patata, tomate', '', ''),
(449, 3, 'Patatas a la inglesa - Zingy Tomato', '&lt;p&gt;Patatas a la inglesa - Zingy Tomato&lt;br&gt;&lt;/p&gt;', '', 'Patata, tomate', '', ''),
(449, 4, 'بطاطس مقرمشة - طماطم زنجي', '&lt;p&gt;بطاطس مقرمشة - طماطم زنجي&lt;br&gt;&lt;/p&gt;', '', 'البطاطس ، الطماطم', '', ''),
(450, 3, 'Papas fritas - tomate español Tango', '&lt;p&gt;Romance sus papilas gustativas con sabor ácido de tomates y especias sabrosas. Bolsas individuales deliciosas: perfectas para comer en el trabajo, en casa o en la escuela.&lt;br&gt;&lt;/p&gt;', '', 'Patata, tomate', '', ''),
(450, 4, 'رقائق البطاطس - الطماطم الاسبانية التانغو', '&lt;p&gt;الرومانسية ذوقك مع نكهة منعشة من الطماطم والتوابل اللذيذة. أكياس فردية لذيذة: مثالية لتناول الوجبات الخفيفة في العمل أو المنزل أو المدرسة.&lt;br&gt;&lt;/p&gt;', '', 'البطاطس ، الطماطم', '', ''),
(451, 3, 'Mccain Smiles - Papa feliz crujiente', '&lt;p&gt;Combo Mccain Smiles - Crispy Happy Potato&lt;br&gt;&lt;/p&gt;', '', 'Patata, tomate', '', ''),
(451, 4, 'ماكشين سمايلز - كرسبي هابي بوتاتو', '&lt;p&gt;كومبو ماكينا سمايلز - كرسبي هابي بوتاتو&lt;br&gt;&lt;/p&gt;', '', 'البطاطس ، الطماطم', '', ''),
(452, 3, 'Listo para comer - Bhindi Masala', '&lt;p&gt;Dedos de mujer cocinados con la mezcla perfecta de especias. Una sabrosa comida, en cualquier momento en cualquier lugar.&lt;br&gt;&lt;/p&gt;', '', 'Ladyfinger', '', ''),
(452, 4, 'جاهز للأكل - بيندي ماسالا', '&lt;p&gt;أصابع السيدات مطبوخة مع مزيج مثالي من التوابل. وجبة لذيذة ، في أي وقت في أي مكان.&lt;br&gt;&lt;/p&gt;', '', 'اصبع سيدة', '', ''),
(453, 4, 'إصبع السيدات - نمت عضويا', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'اصبع سيدة', '', ''),
(453, 1, 'Ladies Finger - Organically Grown', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Product image shown is for representation purpose only, the actually product may vary based on season, produce &amp;amp; availability.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ladyfinger', '', ''),
(453, 3, 'Dedo de mujer - cultivado orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Ladyfinger', '', ''),
(454, 3, 'Pastel de esponja Bonomi - Savoiardi Ladyfinger', '&lt;p&gt;Las galletas Savoiardi son similares a los bizcochos, ya que no se basan en ningún tipo de agente de fermentación para la textura ligera, sino que es el resultado de la incorporación de aire en las claras de huevo.&lt;br&gt;&lt;/p&gt;', '', 'Ladyfinger', '', ''),
(454, 4, 'بونو مي سبون جنرال الكتريك كعكة - البسكويت إصبع سيدة', '&lt;p&gt;سا بسكويت دي بسكويت تشبه الكعك الإسفنج ، لأنها لا تعتمد على أي نوع من وكيل تخمر للنسيج الضوء ، ولكن نتيجة لدمج الهواء في بياض البيض.&lt;br&gt;&lt;/p&gt;', '', 'اصبع سيدة', '', ''),
(455, 1, 'Healthy Chips - Gourmet Spiced', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Vacuum Fried Vegetable Chips are low on fat, as they retain all nutrients, colour, flavour and texture of the vegetables, but are crispy and a great mid meal snack for all those hunger pangs.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ladyfinger', '', ''),
(455, 3, 'Chips Saludables - Especias Gourmet', '&lt;p&gt;Las patatas fritas al vacío para vegetales son bajas en grasa, ya que retienen todos los nutrientes, el color, el sabor y la textura de las verduras, pero son crujientes y un gran refrigerio a mitad de la comida para todos esos dolores de hambre.&lt;br&gt;&lt;/p&gt;', '', 'Ladyfinger', '', ''),
(455, 4, 'رقائق صحية - جورميه متبل', '&lt;p&gt;رقائق الخضروات المقلية منخفضة الدهون ، لأنها تحتفظ بجميع العناصر الغذائية ، واللون ، والنكهة والملمس من الخضروات ، ولكن هي مقرمشة ووجبة خفيفة وجبة كبيرة لجميع تلك آلام الجوع.&lt;br&gt;&lt;/p&gt;', '', 'اصبع سيدة', '', ''),
(456, 3, 'Repollo', '&lt;p&gt;Con una textura crujiente y jugosa en el momento de dar el primer mordisco, las coles son dulces y tienen un sabor a hierba con capas frondosas densas y suaves.&lt;br&gt;&lt;/p&gt;', '', 'Repollo, coliflor', '', ''),
(456, 4, 'الكرنب', '&lt;p&gt;مع ملمس من النضارة والعصارة في اللحظة التي تأخذ فيها اللقمة الأولى ، فإن الكرنب مدلل ومعطر بطبقات كثيفة وناعمة.&lt;br&gt;&lt;/p&gt;', '', 'الملفوف، والقرنبيط', '', ''),
(457, 3, 'Repollo rojo - Rallado', '&lt;p&gt;Las coles rojas son redondas y envueltas en capas de hojas de color rojo purpúreo con un sabor más picante y audaz en comparación con las verdes. Las hojas son más gruesas ya que tienen menos contenido de agua.&lt;br&gt;&lt;/p&gt;', '', 'Repollo, coliflor', '', ''),
(457, 4, 'الملفوف الأحمر - مبشور', '&lt;p&gt;الكرنب الأحمر مستدير وملفوف في طبقات أوراق حمراء مسترجعة مع نكهة أكثر نقاء وجرأة مقارنة بالأخضر. الأوراق أكثر خشونة لأنها تحتوي على كمية أقل من الماء.&lt;br&gt;&lt;/p&gt;', '', 'الملفوف، والقرنبيط', '', ''),
(458, 3, 'Repollo - cultivado orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Repollo, coliflor', '', ''),
(458, 4, 'الملفوف - نمت بشكل عضوي', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'الملفوف، والقرنبيط', '', ''),
(459, 3, 'Col de Fresho', '&lt;p&gt;Con una textura crujiente y jugosa en el momento de dar el primer mordisco, las coles son dulces y tienen un sabor a hierba con capas frondosas densas y suaves.&lt;br&gt;&lt;/p&gt;', '', 'Repollo, coliflor', '', ''),
(459, 4, 'فريشو الملفوف', '&lt;p&gt;مع ملمس من النضارة والعصارة في اللحظة التي تأخذ فيها اللقمة الأولى ، فإن الكرنب مدلل ومعطر بطبقات كثيفة وناعمة.&lt;br&gt;&lt;/p&gt;', '', 'الملفوف، والقرنبيط', '', ''),
(460, 4, 'القرع - ديسكو', '&lt;p&gt;يحتوي القرع ذو الشكل القرصي ذو البشرة البرتقالية الناعمة المائلة للصفرة على لحم دسم باللون البرتقالي مع طعم لذيذ يشبه الكوسا.&lt;br&gt;&lt;/p&gt;', '', 'اليقطين، وأعواد الطبل', '', ''),
(460, 1, 'Pumpkin - Disco', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Disc\' shaped pumpkins with smooth, yellowish orange skin have creamish to orange flesh with a pleasant squash-like taste.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Pumpkin,Drumsticks', '', ''),
(460, 3, 'Calabaza - Disco', '&lt;p&gt;Las calabazas en forma de disco con una piel lisa de color anaranjado amarillento tienen una carne de color crema a naranja con un agradable sabor a calabaza.&lt;br&gt;&lt;/p&gt;', '', 'Calabaza, baquetas', '', ''),
(461, 3, 'Calabaza: cultivada orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Calabaza, baquetas', '', ''),
(461, 4, 'القرع - نمت عضويا', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'اليقطين، وأعواد الطبل', '', ''),
(462, 3, 'Calabaza verde', '&lt;p&gt;Fresho te trae corte de calabaza verde con carne de color crema a amarillo y semillas planas y comestibles (pepitas) en el interior que son tiernas y ligeramente dulces.&lt;br&gt;&lt;/p&gt;', '', 'Calabaza, baquetas', '', ''),
(462, 4, 'القرع الأخضر', '&lt;p&gt;يجلب لك الطازج الأخضر قطع اليقطين مع اللحم الأصفر إلى الكريمي والمسطحة ، والبذور الصالحة للأكل بداخلها طرية وحلوة أقل ما يقال.&lt;br&gt;&lt;/p&gt;', '', 'اليقطين، وأعواد الطبل', '', ''),
(463, 3, 'Calabaza amarilla - Avial', '&lt;p&gt;Pumpkin es una calabaza similar a una calabaza que pertenece a la familia. Las calabazas son tan alegres con sus intensos colores.&lt;br&gt;&lt;/p&gt;', '', 'Calabaza, baquetas', '', ''),
(463, 4, 'القرع الأصفر - افي', '&lt;p&gt;القرع هو قرع يشبه القرع ينتمي إلى الأسرة. القرع هي بهيجة جدا تبحث مع ألوانها المكثفة.&lt;br&gt;&lt;/p&gt;', '', 'اليقطين، وأعواد الطبل', '', ''),
(464, 3, 'Granada - Cultivada orgánicamente', '&lt;p&gt;Los productos orgánicos son cultivados orgánicamente y seleccionados por un experto.&lt;/p&gt;&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;/p&gt;', '', 'Frutas orgánicas', '', ''),
(464, 4, 'الرمان - نمت عضويًا', '&lt;p&gt;تزرع المنتجات العضوية ويتم انتقاءها يدويًا بواسطة خبير.&lt;/p&gt;&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;/p&gt;', '', 'فواكه عضوية', '', ''),
(465, 1, 'Watermelon - Organically', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;These watermelons have juicy, sweet and grainy textured flesh filled with 12-14% of sugar content, making it a healthy alternative to sugary carbonated drinks. Flesh colour of these are pink to red with dark brown/black seeds.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Fruits', '', ''),
(465, 3, 'Sandía - Cultivada orgánicamente', '&lt;p&gt;Estas sandías tienen carne texturizada jugosa, dulce y granulada rellena con un 12-14% de contenido de azúcar, por lo que es una alternativa saludable a las bebidas carbonatadas azucaradas. El color de la carne de estos es rosado a rojo con semillas de color marrón oscuro / negro.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas', '', ''),
(465, 4, 'البطيخ - نمت عضويا', '&lt;p&gt;تحتوي هذه البطيخ على اللحم الغني ، الحلو والمحبب المملوء بنسبة 12-14 ٪ من محتوى السكر ، مما يجعلها بديل صحي للمشروبات الغازية السكرية. لون اللحم من هذه هي الوردي إلى الأحمر مع بذور بني داكن / أسود.&lt;br&gt;&lt;/p&gt;', '', 'فواكه عضوية', '', ''),
(466, 3, 'Sapota: cultivado orgánicamente', '&lt;p&gt;Las sapotas de piel marrón son suaves a textura granosa, con aroma a almizcle y deliciosamente dulces en el sabor. La carne generalmente contiene 2-3 semillas negras grandes y no comestibles.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas', '', ''),
(466, 4, 'سا بوتا - نمت بشكل عضوي', '&lt;p&gt;براون سا البقدونس بالبشرة على نحو سلس لمحبوب محكم ، معطر رائحة ومذاق حلو لذيذ في الذوق. الجسد يحتوي عموما 2-3 بذور سوداء كبيرة وغير صالحة للأكل.&lt;br&gt;&lt;/p&gt;', '', 'فواكه عضوية', '', ''),
(467, 3, 'Mang pratyuri - Orgánico', '&lt;p&gt;Estas variedades de mangos se cultivan orgánicamente, maduran de forma natural a través del heno.&lt;/p&gt;&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;/p&gt;', '', 'Frutas orgánicas', '', ''),
(467, 4, 'مانغ برايتوري - العضوية', '&lt;p&gt;تزرع هذه الأنواع من المانجو عضويا ، نضجت طبيعيا من خلال التبن.&lt;/p&gt;&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;/p&gt;', '', 'فواكه عضوية', '', ''),
(468, 3, 'Mango Neelam - Orgánicamente', '&lt;p&gt;Se cultiva orgánicamente y el mango Neelam es conocido por su hermosa forma, sabor y fragancia floral divina. Se produce en muchas áreas de Pakistán e India. Las variedades pakistaníes más famosas son de la región de Sindh, las conocidas variedades indias provienen del sur de la India.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas', '', ''),
(468, 4, 'مانجو نيلام - عضويا', '&lt;p&gt;هو من نبتة عضويا ومن المعروف المانجو نيلام لشكلها الجميل ، ونكهة ورائحة الأزهار الإلهية. يتم إنتاجه في العديد من المناطق في باكستان والهند. الأنواع الباكستانية الأكثر شهرة هي من منطقة السند ، والأصناف الهندية المعروفة هي من جنوب الهند.&lt;br&gt;&lt;/p&gt;', '', 'فواكه عضوية', '', ''),
(469, 3, 'Papaya - Orgánicamente', '&lt;p&gt;Las papayas son grandes y tienen forma de pera con color de piel de verde a amarillo cuando están maduras. La carne es de color anaranjado pálido con numerosas semillas pequeñas, negras y pegajosas en el centro.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas', '', ''),
(469, 4, 'البابايا - عضويا', '&lt;p&gt;البابايا هي كبيرة والكمثرى على شكل أخضر ولون البشرة الصفراء عندما تنضج. اللحم هو برتقالي شاحب مع العديد من البذور الصغيرة والسوداء اللزجة في المركز.&lt;br&gt;&lt;/p&gt;', '', 'فواكه عضوية', '', ''),
(470, 3, 'Guayaba - Orgánicamente', '&lt;p&gt;Saborea las guayabas verdes junto con las semillas duras comestibles de color amarillo pálido. La carne blanquecina es crujiente y ligeramente dulce con muy buena fragancia. Seleccionamos selectivamente guayabas cultivadas orgánicamente de las mejores granjas&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas', '', ''),
(470, 4, 'الجوافة - عضويا', '&lt;p&gt;تذوق الجوافة الخضراء جنبا إلى جنب مع البذور الصالحة للأكل ، والأصفر شاحب. اللحم الأبيض المائل للصفرة مقدد ومعتدل بشكل جيد مع رائحة جيدة جدا. نحن نختار بشكل انتقائي جوافة نمت عضويًا من أفضل المزارع&lt;br&gt;&lt;/p&gt;', '', 'فواكه عضوية', '', ''),
(471, 3, 'Piña - Orgánicamente', '&lt;p&gt;La parte del centro comestible es firme, correosa y más dulce. Seleccionamos selectivamente piñas cultivadas orgánicamente de las mejores granjas&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas', '', ''),
(471, 4, 'الأناناس - عضويا', '&lt;p&gt;الجزء الوسط الصالح للأكل متين وجلد وأحلى. نحن نختار بشكل انتقائي الأناناس نمت عضويًا من أفضل المزارع&lt;br&gt;&lt;/p&gt;', '', 'فواكه عضوية', '', ''),
(472, 3, 'Cherry - Red Globe Indian', '&lt;p&gt;Las uvas de color rojo rubí de Fresho son uvas extraordinariamente grandes, redondas y de buena calidad. Tienen una piel crujiente, pulpa carnosa y un tinte rosado en color.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas de temporada', '', ''),
(472, 4, 'الكرز - غلوب الاحمر الهندي', '&lt;p&gt;العنب الطازج بلون العنب الأحمر الطازج عبارة عن عنب فريد من نوعه وعالي الجودة. لديهم جلد مقدد ولب لحمي ومسحة ذات لون وردي.&lt;br&gt;&lt;/p&gt;', '', 'الفواكه العضوية الموسمية', '', ''),
(473, 3, 'Naranja bebé', '&lt;p&gt;Frutas adorables, brillantes, rojizas, brillantes y de piel suave, estas pequeñas naranjas son una experiencia pura. La jugosidad y dulzura de las mini naranjas son distintivas. Estos también son simples de pelar y seccionar.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas de temporada', '', ''),
(474, 3, 'Pera - Naspathi, india', '&lt;p&gt;El sabor suave y dulce viene con increíble crujido y jugosidad, mientras que la cáscara le da un toque de sabor a la carne dulce.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas de temporada', '', ''),
(474, 4, 'الكمثرى - ناس المسار ، الهندي', '&lt;p&gt;المذاق اللطيف الحلو يأتي بشكل كامل مع العصارة الرائعة والعصارة ، في حين يضيف التقشير لمسة من اللحم الحلو.&lt;br&gt;&lt;/p&gt;', '', 'الفواكه العضوية الموسمية', '', ''),
(475, 3, 'Mango - Crudo', '&lt;p&gt;El mango crudo es una fruta de olor dulce que es del agrado de todos por su sabor agrio. El color varía en tonos de verdes y la carne interna es de color blanco.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas de temporada', '', ''),
(475, 4, 'المانجو - الخام', '&lt;p&gt;المانجو الخام هو فاكهة حلوة الرائحة التي يحبها آل نكهة لاذع. اللون يختلف في ظلال اللون الأخضر واللون الداخلي أبيض اللون.&lt;br&gt;&lt;/p&gt;', '', 'الفواكه العضوية الموسمية', '', ''),
(476, 3, 'Cherry - Bangalore', '&lt;p&gt;Cultivadas exclusivamente en los distritos de Chikkaballapur, Bangalore Urban y Kolar, estas uvas de color negro Fresho, de piel suave, tienen un sabor astuto y un sabor picante brisky.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas de temporada', '', ''),
(476, 4, 'الكرز - بنغالور', '&lt;p&gt;يزرع حصرياً في مناطق تشيكا بالابور ، وبنغالور أوربان ، وكو لار ، هذه العنب الطازج ذو اللون الأزرق الفاتح ، له نكهة ماكر وطعم لاذع.&lt;br&gt;&lt;/p&gt;', '', 'الفواكه العضوية الموسمية', '', ''),
(477, 3, 'Naranja - Importado', '&lt;p&gt;Estas naranjas importadas son mucho más grandes en comparación con la contraparte india.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas de temporada', '', ''),
(477, 4, 'برتقالي - مستورد', '&lt;p&gt;هذه البرتقال المستورد أكبر حجماً بالمقارنة مع نظيرتها الهندية.&lt;br&gt;&lt;/p&gt;', '', 'الفواكه العضوية الموسمية', '', ''),
(478, 3, 'Sandía - Pequeño', '&lt;p&gt;El color de la carne de estas sandías es rosado a rojo con semillas de color marrón oscuro / negro.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas de temporada', '', ''),
(478, 4, 'البطيخ - صغير', '&lt;p&gt;لون اللحم من هذه البطيخ هي الوردي إلى الأحمر مع بذور بني داكن / أسود.&lt;br&gt;&lt;/p&gt;', '', 'الفواكه العضوية الموسمية', '', ''),
(479, 3, 'Sweet Lime - Orgánicamente', '&lt;p&gt;La imagen del producto mostrada es solo para fines de representación, el producto real puede variar según la temporada, el producto y la disponibilidad.&lt;br&gt;&lt;/p&gt;', '', 'Frutas orgánicas frescas', '', ''),
(479, 4, 'الجير الحلو - عضويا', '&lt;p&gt;صورة المنتج المعروضة لغرض التمثيل فقط ، قد يختلف المنتج الفعلي حسب الموسم ، الإنتاج والتوافر.&lt;br&gt;&lt;/p&gt;', '', 'الفواكه العضوية الطازجة', '', ''),
(480, 3, 'Capsicum - Verde', '&lt;p&gt;Dejando un sabor moderadamente picante en la lengua, los pimientos verdes, también conocidos como pimientos verdes, son vainas de fruta de tamaño mediano, en forma de campana. Tienen una piel gruesa y brillante con una textura carnosa dentro.&lt;br&gt;&lt;/p&gt;', '', 'Vegetales frescos', '', ''),
(480, 4, 'الفليفلة - الخضراء', '&lt;p&gt;وترك الفليفلة الخضراء ، المعروفة أيضًا بالفلفل الأخضر ، طعمًا لاذعًا إلى حدٍ ما على اللسان ، وهي عبارة عن قرون فاكهة متوسطة الحجم على شكل جرس. لديهم بشرة سميكة ولامعة مع نسيج سمين داخل.&lt;br&gt;&lt;/p&gt;', '', 'الخضروات الطازجة', '', ''),
(473, 4, 'بيبي أورانج', '&lt;p&gt;فاكهة جميلة ، مشرقة ، ضاربة إلى الحمرة ، لامعة وناعمة ، هذه البرتقال الصغير هي تجربة محض. العصير والحلاوة من البرتقال مصغرة هي مميزة. هذه هي أيضا بسيطة لقشر وقسم.&lt;br&gt;&lt;/p&gt;', '', 'الفواكه العضوية الموسمية', '', ''),
(52, 1, 'Green Apple', '&lt;p&gt;Green apples provides a huge range of health and beauty benefits, especially when compared to red apples. &amp;nbsp;Green apples, on the other hand, are more the sweet and sour type (this is popularly classified as cooking apples). Green Apple has green skin. It has sugary,juicy and little bitter flavor. It is rich in carbohydrates and delicious to eat. It improves immunity and has countless health benefits. Consuming green apples gives healthy and glowing skin.&lt;/p&gt;\n', '', 'Green Apple', '', ''),
(54, 1, 'Basket Apples', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Details:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Apples have oval and pear shape. It\'s outer peels comes in different colors like red, golden, green and yellow depending upon the cultivator type. They are crispy and have juicy off white pulp which has a mixture of mild sweet and sour flavour. It\'s seeds are inedible because they are bitter in taste.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Ingredients:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Vitamins, Carbohydrates, water, Vitamins&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Instructions:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Keep it in cool and dry place.&lt;/p&gt;&lt;p&gt;Keep it in refrigerator to consume more then a week.&lt;/p&gt;', 'basket,apples', 'Basket Apples', '', ''),
(55, 1, 'Pear', '&lt;p&gt;Pear includes white or cream-colored flesh. They often contain brown colored speckles on their outer surface. They are juicy, crispy and has a sweet taste with grainy texture. A ripe pear is hard but not as hard as rock which contains a rich aroma when ripe. It includes carbohydrates, Vitamins A, C, K, E, Folate, B2, B1. Important phytochemicals in pears include beta-carotene, quercetin, chlorogenic acid and pectin.Product image shown is for representation purpose only, the actually product may vary based on season, produce &amp;amp; availability.&lt;/p&gt;', '', 'Pear', '', ''),
(56, 1, 'Plum', '&lt;p&gt;Red Plum is one of the healthiest fruit among all fruits. It has red brown skin and rich in antioxidants. It has juicy and tart flavour and easily consumable. It can be eaten fresh and is used in making jams or other recepies.Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 17.1428px;&quot;&gt;Instructions:&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keep it in refrigerator.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;place it in cool and dry place.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;p&gt; &lt;/p&gt;', '', 'Plum', '', ''),
(58, 1, 'Grapes', '&lt;p&gt;Grapes are rich in vitamin C, vitamin &amp;nbsp;K and polyphenolic pyhto chemical compound reseveratrol which is rich in antioxidants. They are rich in natural water and sugars.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Product image is only for representative purpose, it may vary from actual product based on availability and season.&lt;/p&gt;', '', 'Grapes', '', ''),
(59, 1, 'Strawberries', 'Red Strawberries are bright, juicy and very sweet. They are rich in vitamin C. The little heart shape themselves gives the first clue that they can be beneficial for heart as it protects heart. It increase lower good chlestrol, lowers the blood pressure. They are rich in vitamins, antioxidants and fibres. They are sodium free and fat free.&amp;nbsp;', '', 'Strawberries', '', ''),
(60, 1, 'Golden apple', '&lt;p&gt;Golden apple is a tropical fruit. It has shiny golden skin and has soft and juicy flesh. These&amp;nbsp;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;apples provides a huge range of health and beauty benefits, especially when compared to red apples. &amp;nbsp;Golden apples, on the other hand, are more the sweet and sour type. It has sugary,juicy and little bitter flavor. It is rich in carbohydrates and delicious to eat. It improves immunity and has countless health benefits. Consuming green apples gives healthy and glowing skin.&lt;/span&gt;&lt;/p&gt;', '', 'Golden apple', '', ''),
(61, 1, 'Fuji Apple Bag', '&lt;p&gt;Product image is only for representation purpose. actual product may vary base on season and availability.&lt;/p&gt;', '', 'Fuji Apple Bag', '', ''),
(62, 3, 'Bag of Apples', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Bag of apples contains both red and golden apples. Both types of apples are rich in carbohydrates and are beneficial for health and skin too.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Bag of Apples', '', ''),
(63, 1, 'Red Pear', '&lt;p&gt;Red pear is new in market also known as Christmas pear because it is mostly found in holiday gifts fruit basket. It\'s skin is easily breakable. About it\'s flavor it is very creamy, juicy and sweet.&lt;/p&gt;&lt;p&gt;Product image is for representation purpose only. Actual product may vary based on season and availability.&lt;/p&gt;', '', 'Red Pear', '', ''),
(68, 1, 'Sweet Cherries', '&lt;p&gt;Cherries are enriched with unique antioxidants and are full of health benefits nutrients. They belong to the family of plums and peaches. Cherries are sweet in taste and are rich in source of minerals and vitamins.&lt;/p&gt;&lt;p&gt;It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', ' Sweet Cherries', '', ''),
(70, 1, 'Berries Package', '&lt;p&gt;It is a combo of black and blue berries. Both berries are rich in antioxidants and are beneficial for health.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 'Berries Package', '', ''),
(73, 1, 'Tropicana Mango Juice', '&lt;p&gt;Tropicana Mango Juice 200 ml&lt;/p&gt;', '', 'Tropicana Mango Juice', '', ''),
(74, 1, 'Mango', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Mangoes, the king of fruits. This is a seasonal fruit and arrives in summer. It is enriched with antioxidants which helps in protecting against cholesterol and colon. It has many benefits like improves eye sight, clears skin, improves digestion and helps in fighting against heat stroke.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mango', '', ''),
(75, 1, 'Baby Spinach', '&lt;p&gt;There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. ..&lt;/p&gt;\n                          &lt;div class=&quot;divider&quot;&gt;&lt;/div&gt;\n                          &lt;h3&gt;Ingredients&lt;/h3&gt;\n                          &lt;ul class=&quot;double-list&quot;&gt;\n                    &lt;li&gt;White rice &lt;/li&gt;\n                    &lt;li&gt;Curry Paste &lt;/li&gt;\n                    &lt;li&gt;Eggplant &lt;/li&gt;\n                    &lt;li&gt;Nuts, coconut milk &lt;/li&gt;\n                    &lt;li&gt;Papayas &lt;/li&gt;\n                    &lt;li&gt;Zucchini &lt;/li&gt;\n                    &lt;li&gt;Butternut squash &lt;/li&gt;\n                    &lt;li&gt;Red tomatoes &lt;/li&gt;\n                  &lt;/ul&gt;\n                          &lt;h3&gt;Directions&lt;/h3&gt;\n                          &lt;p&gt;Keep refrigerated.&lt;/p&gt;\n', '', 'Baby Spinach', '', ''),
(79, 1, 'Brown Bread', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Details:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Brown Bread are made with the significant amount of wheat and whole grain flour. It includes dark colored ingredients such as coffee. It reduces risk of heart diseases and lowers the risk of weight gain.It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Ingredients:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Molasses, Whole Grain Flour, Salt, Sugar, Yeast, Glutten, Water, Vegetable Fat, Yeast, Calcium Propionate, Dough Conditioner.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Instructions:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Keep in refrigrator.&lt;/p&gt;&lt;p&gt;Place it in cool and dry place.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 'Brown Bread', '', ''),
(80, 1, 'Eggs', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Details:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Eggs are enriched with proteins. Both white and yolk of an egg are rich in nutrients - proteins, vitamins and minerals. The yolk contains cholesterol and soluble fat . More then half of the protein is contained in egg white. They are also a good source of vitamins D, B6, B12 and minerals like zinc, iron and copper.making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Ingredients:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Organic Whole Eggs&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Directions:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Keep refrigrated at 45 &amp;nbsp;degrees to prevent them from bacteria.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Handle it with care.&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Eggs', '', ''),
(82, 1, 'Fruit Cake', '&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Fruit cake is made from dried and candid fruits, nuts and dryfruits. are great antioxidants. &amp;nbsp;The fruits in cakes contains nutrients known as catechins that resist the damage caused by the oxidation process. The antioxidants thus protect your organs from damage. Fruits containing cakes also help in improving the blood flow in your body.survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Instructions:&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Sugar, Wheat Flour, Baking Soda, Vanilla essence, Sea Salt, Organic Gum Blend (Organic Guar and Locust Bean Gums), fruits, dry Fruits, Nuts, Water.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Warning:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Do not consume raw batter.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', '', 'Fruit Cake', '', ''),
(83, 1, 'Pamper Pants', '&lt;p&gt;Baby Pamper Pants are comfortable, soft and smooth with fitted and soft waist band. It avoids the problem of rashes and irritation. Helps in keeping the skin dry and smooth and it\'s a great help to mother.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Key Features:&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Avoids irritation and rashes&lt;/p&gt;&lt;p&gt;Keeps Skin Dry&lt;/p&gt;&lt;p&gt;High POWER OF ABSORBING LIQUID&lt;/p&gt;&lt;p&gt;Baby feels fresh and cheerful all day long&lt;/p&gt;&lt;p&gt;Soft elastic with comfortable fit&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Items Included:&lt;/span&gt; 48 pieces of pamper pants&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Brand Information:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(103, 103, 103); font-family: Arial; line-height: 17px; text-align: justify;&quot;&gt;For more than 50 years, Pampers has been inspired by babies. Pampers brand is owned by P&amp;amp;G which has won accolades of being consistent #1 ranking within industry on “Most Admired” list for 25 of 26 total years and for 13 years in a row.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Pamper Pants', '', ''),
(89, 1, 'Johnson\'s Tip to Toe', '&lt;p&gt;Johnson\'s Baby Top to Toe Wash with its No More Tears formula is so gentle and moisturising that it cleanses skin thoroughly and protects the skin with it\'s natural moisturiser As gentle to eyes and skin as pure water. Naturally derived cleansing ingredients. It is soap free and dye free.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Key Features:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;No harmful chemicals&lt;/p&gt;&lt;p&gt;Natural cleaning ingredients&lt;/p&gt;&lt;p&gt;Soap free and dye free&lt;/p&gt;&lt;p&gt;no more tears formula&lt;/p&gt;&lt;p&gt;Protects skin with natural moisturiser&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Brand Information:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(103, 103, 103); font-family: Arial; line-height: 17px; text-align: justify;&quot;&gt;Johnson &amp;amp; Johnson was founded more than 120 years ago. Since then, they have bought innovative ideas, products and services to advance the health and well-being of people. They have more than 250 operating companies in 60 countries. Johnson &amp;amp; Johnson group companies work with partners in health care to touch the lives of over a billion people every day, throughout the world. Barron’s magazine, in 2010, ranked Johnson &amp;amp; Johnson #2 in the World\'s Most Respected Companies list.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 'Johnson\'s Tip to Toe', '', ''),
(91, 1, 'Amul Gold Milk ', 'The Amul Gold Homogenized Standardized Milk is one of its beverage products. It is long life standardized milk and it is fresh milk. The milk has been processed with modern technology like Ultra High Temperature or UHT. Amul Gold Homogenized Standardized Milk does not contain any preservatives and the Ultra High Temperature technology ensures zero microbial activity. The modern technology helps to preserve the original taste, flavor and the nutritional value of Amul Gold Homogenized Standardized Milk.&lt;br&gt;', '', 'Amul Gold mIlk', '', ''),
(92, 1, 'Danone Misti Curd ', 'Curds are a dairy product obtained by coagulating milk in a process called curdling. The coagulation can be caused by adding rennet or any edible acidic substance such as lemon juice or vinegar, and then allowing it to sit.&lt;br&gt;&lt;br&gt;', '', 'Danone', '', ''),
(93, 1, 'Amul Butter 100 gm', '&lt;p&gt;Amul Pasteurized luscious butter is made up of fresh cream and pure milk fat. Be it paranthas, bread, roti or any other food, this nutritional bar is sure to enhance the taste further. Added to it, it is acceptable natural colour makes it safe for utilization. So, add a flavour of fine taste to your cooking and baking skills by going for this 100 gm Amul Butter!&lt;br&gt;&lt;/p&gt;', '', 'Amul Butter', '', ''),
(97, 1, 'Sweet Muffins', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;POLYCOATED FLOWER SHAPE PAPER CUP FOR MUFFINS &amp;amp; CUPCKAES SET BY RED FOREST&lt;/span&gt;&lt;br&gt;&lt;br&gt;These Stylish Muffin Cups Are Made From Food Grade Papercream Cheese Paper Cupcakesgreat For Cupcakes, Desserts, Hot And Cold Appetizers, And Candiesdisposable, Eco-Friendlyavailable In Random Colors.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;KEY DETAILS&lt;/span&gt;&lt;br&gt;&lt;br&gt;Dimension Of The Product: Lxbxh (In Cms): 4 X 3 X 2&lt;br&gt;Material Used: 0&lt;br&gt;Weight Of The Product: 50 Gm&lt;br&gt;&lt;/p&gt;', '', 'Sweet Muffins', '', ''),
(98, 1, 'Baby Biotique Soap', '&lt;p&gt;Baby Biotique soap is blended with natural ingredients like almond, margosa, coconut oils which helps in washing away all the impurities from skin and make the skin soft, supple and glowy.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Key Features:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Blended with natural almonds, turmeric, coconut oil and margosa.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Recommendation:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Recommended only for sensitive skin&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Brand Information:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Biotique’s baby care deals with skincare and haircare products that are made from pure natural ingredients to pamper and protect baby’s delicate skin. Biotique offers products that would form a protective layer on baby’s sensitive skin to keep it healthy and nurtured from head to toe. All products in Biotique\'s baby care range are Pediatrician approved.&lt;/p&gt;', '', 'Baby Biotique Princess Soap', '', ''),
(113, 1, 'Himalayas Dental Care', 'Himalaya Dental care cream is enriched wiyth ayurvedic properties.It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).The toothpaste is blended with neem and meswak.&lt;p&gt;&lt;/p&gt;', '', 'Himalayas Dental Care', '', ''),
(116, 1, 'Tata Shakti Moong Dal', 'Every grain of i-Shakti Dal is 100% laser-sorted and graded using modern technology to ensure that consumers get no impurities, damaged, or weevilled grains - the dals are indeed, ready-to-cook. It does away with the time-consuming process of cleaning grains at home. A convenient way to good health!&lt;br&gt;&amp;nbsp;&lt;br&gt;', '', 'Tata Shakti Moong Dal', '', ''),
(118, 1, 'Tata Toor Dal', '&lt;p&gt;Tata Toor Dal comprises of all natural goodness and is free from the use of water, oil or stone polish. It is a protein rich product which does not involve the interference of any impurities, chemicals and cholesterol. These benefits make this product quick to cook and great to taste!&lt;br&gt;&lt;/p&gt;', '', 'Tata Toor Dal', '', ''),
(121, 1, 'DCC Cashews', '&lt;p&gt;Cashews, the sweet, buttery nuts aren’t just delicious but have a gamut of health benefits. With zero cholesterol and high levels of minerals, cashews improve blood circulation, control blood cholesterol, and are effective for weight management. Cashews are also a rich source of antioxidants, and monounsaturated fats, which promote cardiovascular health.&lt;br&gt;&lt;/p&gt;', '', 'DCC Cashews', '', ''),
(131, 1, 'Raw Rice', '&lt;p&gt;Basmati is a variety of long, slender grain aromatic rice which is traditionally from Indian Subcontinent.As of 2014, India supplies 65 percent of the overseas basmati rice market, while Pakistan accounts for the rest, according to the state-run Agricultural and Processed Food Products Export Development Authority.&lt;br&gt;&lt;/p&gt;', '', 'Raw Rice', '', ''),
(136, 1, 'Nivea Deodrant', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;It prevents from odour and wetness. The fragrance keeps womwn fresh and cool all day long.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Ingredients:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Butane, Isobutane, Propane, Cyclomethicone, Aluminum Chlorohydrate, Tocopheryl Acetate, Disteardimonium Hectorite, Dimethicone, Octyldodecanol, Butylotanoic Acid, Persea Gratissima, Caprylic/Capric Triglyceride, Fucus Vesiculosus, BHT, Parfum.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Instructions:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Hold 15 cm from underarm and spary.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keep it in cool and dry place&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Inflammable&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Shake well before use&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Use before 24 months of manufacturing.&lt;/p&gt;', '', 'Nivea Deodrant', '', ''),
(139, 1, 'Venus Satin Care', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Venus razor blades are spaced close together which adjust to a woman’s natural contours. This way, each razor blade stays in contact with the skin for a curve-hugging, close shave. The Venus Embrace Refillable razor uses 5 blades surrounded by a Ribbon of Moisture for extra glide.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Suggested for use:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Arms, Under arms and Legs&lt;/p&gt;', '', 'Venus Satin Care', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(141, 1, 'Coke', '&lt;p&gt;Enriched with carbonates. It is mostly used and enjoyed during parties or any events. It can also be taken with lunch or dinner.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857; font-weight: bold;&quot;&gt;Ingredients:&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Carbonated Water, Acidity Regulator, Sweeteners, &amp;nbsp;Preservative,, Caffeine. Contains Permitted Natural Colour, and Added Flavours&lt;br&gt;&lt;/p&gt;', '', 'Coke', '', ''),
(146, 1, 'Roasted Coffee', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Roasted and ground coffee is used along with coffee maker.It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Direction to Use:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Keep it in cool and dry place.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Use before 24 months from the date of packaging when opened.&lt;/p&gt;', '', 'Roasted Coffee', '', ''),
