(158, 1, 'Ariel Complete Matic', '&lt;p&gt;Ariel Complete matic is well known brand which is popular for clearing tough stains from clothes.It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy.&lt;/p&gt;', '', 'Ariel Complete Matic', '', ''),
(168, 1, 'Mozzarella Cheese', '&lt;p&gt;&lt;span style=&quot;line-height: 17.1428px;&quot;&gt;Mozzarella is italian cheese &amp;nbsp;basically made from buffalo milk. It has semi-soft texture and contains low fats.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mozzarella Cheese', '', ''),
(174, 1, 'Lady Finger', '&lt;p&gt;Lady Finger medicinal vegetable which is available all around a year. It has various benefits i.e. it is rich in fibre and has low calories which helps in reducing weight. &amp;nbsp;It controls blood sugar level and improves digestion.&amp;nbsp;&lt;/p&gt;', '', 'Lady Finger', '', ''),
(177, 1, 'Organic Guava', '&lt;p&gt;Organic Guava are healthy to consume and have less amount of sugar in it. They are free from pesticides as grown organically. They are enriched with nutrients and are rich in taste. They can be consumed every day which helps in improving digestion and immune system&lt;/p&gt;', '', 'Organic Guava', '', ''),
(186, 1, 'Fresh Cream', '&lt;p&gt;Fresh Cream is one of the diary products which is enriched with high butter fat. It can be used in various ways like it can be used as ingredient in many foods whether it is sweet dish or salty one. There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary. Now a days, there are many varieties of cream available in a market.&lt;/p&gt;', '', 'Fresh Cream', '', ''),
(199, 1, 'testproduct', '&lt;p&gt;test&lt;/p&gt;', '', 'testproduct', '', ''),
(206, 1, 'Caesar Veg', '&lt;div&gt;Lettuce, croutons, parmesan cheese with caesers dressing&lt;/div&gt;&lt;div&gt;Calorie count with dressing&amp;nbsp;&lt;/div&gt;', '', 'Ready To Eat Salads', '', ''),
(207, 1, 'Lettuce and herb cottage cheese', '&lt;p&gt;&lt;span style=&quot;color: rgb(76, 76, 76); font-family: &amp;quot;Alegreya Sans&amp;quot;, &amp;quot;Exo 2&amp;quot;, Arial, Helvetica, sans-serif; font-size: 18px;&quot;&gt;Assorted lettuce, herbed cottage cheese, bell peppers, cherry tomatoes with honey mustard dressing&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ready To Eat Salads', '', ''),
(208, 1, 'Mid Eastern Salad with Za’atar lemon-mint dressing', '&lt;p&gt;&lt;span style=&quot;color: rgb(76, 76, 76); font-family: &amp;quot;Alegreya Sans&amp;quot;, &amp;quot;Exo 2&amp;quot;, Arial, Helvetica, sans-serif; font-size: 18px;&quot;&gt;Assorted lettuce, tomato, radish, red bell peppers, cucumber, parsley with za’atar lemon-mint dressing&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ready To Eat Salads', '', ''),
(209, 1, 'COCA-COLA', '&lt;p&gt;&lt;span style=&quot;color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;Coca-Cola is the most popular and biggest-selling soft drink in history, as well as one of the most recognizable brands in the world.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ready To Drink', '', ''),
(211, 1, 'FANTA', '&lt;p&gt;&lt;span style=&quot;color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;Introduced in 1950, Fanta is the second oldest brand of The&amp;nbsp;&lt;/span&gt;&lt;nobr style=&quot;outline: 0px; quotes: &amp;quot;“&amp;quot; &amp;quot;”&amp;quot;; color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;Coca-Cola&lt;/nobr&gt;&lt;span style=&quot;color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;&amp;nbsp;Company and our second largest brand outside the US. Fanta Orange is the leading flavor but almost every fruit grown is available as a Fanta flavor somewhere.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ready To Drink', '', ''),
(212, 1, 'DIET COKE', '&lt;p&gt;&lt;span style=&quot;color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;Diet Coke, also known as&amp;nbsp;&lt;/span&gt;&lt;nobr style=&quot;outline: 0px; quotes: &amp;quot;“&amp;quot; &amp;quot;”&amp;quot;; color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;Coca-Cola&lt;/nobr&gt;&lt;span style=&quot;color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;&amp;nbsp;light in some markets, is a sugar- and calorie-free soft drink. It was first introduced in the United States on August 9, 1985, as the first new brand since 1886 to use the&amp;nbsp;&lt;/span&gt;&lt;nobr style=&quot;outline: 0px; quotes: &amp;quot;“&amp;quot; &amp;quot;”&amp;quot;; color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;Coca-Cola&lt;/nobr&gt;&lt;span style=&quot;color: rgb(75, 75, 75); font-family: proxima-nova, sans-serif; font-size: medium;&quot;&gt;Trademark.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ready to Drink', '', ''),
(213, 1, 'RED, ORANGE, YELLOW AND (SOME) GREEN VEGGIES', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: Georgia, Times, serif; font-size: 18px;&quot;&gt;These colorful veggies are one of the best sources of carotenoids. This powerful antioxidant is vital for eye health—and it stands up well to cooking in high heat.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ready To Cook Veggies', '', ''),
(214, 1, 'LEAFY GREEN VEGGIES', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: Georgia, Times, serif; font-size: 18px;&quot;&gt;Raw, leafy greens contain oxalic acid, an organic compound which prevents your body from absorbing the healthy calcium and iron they serve, explains Levinson.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ready To Cook Veggies', '', ''),
(215, 1, 'PURPLE VEGGIES', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: Georgia, Times, serif; font-size: 18px;&quot;&gt;Purple veggies contain phytochemicals called anthocyanins that are anti-inflammatory and may lower the risk for heart disease and cancer,” says Pine&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ready To Cook Veggies', '', ''),
(216, 1, 'CRUCIFEROUS VEGGIES', '&lt;p&gt;Dress with a tablespoon of oil to help your body absorb the veggies’ fat-soluble vitamins.&lt;br&gt;&lt;/p&gt;', '', 'Ready To Cook Veggies', '', ''),
(217, 1, 'Peeled cherry', '&lt;h3 class=&quot;subbuzz__title  xs-mb1 bold&quot; style=&quot;box-sizing: inherit; margin-right: 0px; margin-bottom: 1rem; margin-left: 0px; padding: 0px; line-height: 1.2;&quot;&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-family: &amp;quot;Proxima Nova&amp;quot;, Helvetica, Arial, sans-serif; font-size: 19.5px; font-weight: 600;&quot;&gt;This veiny-looking peeled cherry&lt;/span&gt;&lt;br&gt;&lt;/h3&gt;', '', 'Cut &amp;amp; Peeled Fruits', '', ''),
(219, 1, 'Peeled wedge', '&lt;p&gt;This peeled wedge of clementine that looks...squidgy.&lt;br&gt;&lt;/p&gt;', '', 'Cut &amp;amp; Peeled Fruits', '', ''),
(220, 1, ' Mango Face Packs For A Healthy Skin This Summer', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 16px;&quot;&gt;Mangoes are of huge importance for Buddhists. They consider it sacred because the Buddha was accustomed to rest in the lush mango groves. please see the youtube video here:-&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 16px;&quot;&gt;&amp;lt;iframe width=&quot;560&quot; height=&quot;315&quot; src=&quot;https://www.youtube.com/embed/xJEj0nF5grg&quot; frameborder=&quot;0&quot; allow=&quot;autoplay; encrypted-media&quot; allowfullscreen&amp;gt;&amp;lt;/iframe&amp;gt;&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mangoes', '', ''),
(222, 1, 'Eating Mangoes ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 16px;&quot;&gt;The sea-faring Portuguese were so lured with the mangoes that they took the fruit and its seeds and introduced it to many other countries who had never tasted the fruit.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mangoes', '', ''),
(223, 1, 'Roasted Tomatoes', '&lt;p&gt;&lt;span style=&quot;color: rgb(28, 28, 28); font-family: FranklinGothicURW-Boo, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;Drizzle with olive oil and balsamic vinegar. Sprinkle the garlic, sugar, salt, and pepper over the tomatoes.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Potatoes, onions &amp;amp; Tomatoes', '', ''),
(224, 1, 'Roasted Cherry Tomatoes', '&lt;p&gt;&lt;span style=&quot;color: rgb(28, 28, 28); font-family: FranklinGothicURW-Boo, Helvetica, Arial, sans-serif; font-size: 16px;&quot;&gt;Toss the tomatoes lightly with olive oil on a sheet pan. Spread them out into one layer and sprinkle generously with kosher salt and pepper.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Potatoes, onions &amp;amp; Tomatoes', '', ''),
(225, 1, 'Garlic Roasted Potatoes', '&lt;p&gt;&lt;span style=&quot;color: rgb(28, 28, 28); font-family: FranklinGothicURW-Boo, Helvetica, Arial, sans-serif; font-size: 16px;&quot;&gt;Cut the potatoes in half or quarters and place in a bowl with the olive oil, salt, pepper, and garlic; toss until the potatoes are well coated.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Potatoes, onions &amp;amp; Tomatoes', '', ''),
(226, 1, 'Cauliflower', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Palatino, &amp;quot;Palatino Linotype&amp;quot;, &amp;quot;Palatino LT STD&amp;quot;, &amp;quot;Book Antiqua&amp;quot;, Georgia, serif; font-size: 18.2px;&quot;&gt;Cauliflower has had quite the resurgence as of late, as its versatility and ability to replace many grain dishes has gained popularity.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cabbage, Cauliflour, Broccoli', '', ''),
(227, 1, 'Cabbage', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Palatino, &amp;quot;Palatino Linotype&amp;quot;, &amp;quot;Palatino LT STD&amp;quot;, &amp;quot;Book Antiqua&amp;quot;, Georgia, serif; font-size: 18.2px;&quot;&gt;These days you can get your fill of cabbage with more than the green variety that dominates the supermarkets.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cabbage, Cauliflour, Broccoli', '', ''),
(228, 1, 'Broccoli', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Palatino, &amp;quot;Palatino Linotype&amp;quot;, &amp;quot;Palatino LT STD&amp;quot;, &amp;quot;Book Antiqua&amp;quot;, Georgia, serif; font-size: 18.2px;&quot;&gt;Perhaps everyone\'s favorite brassica, take a few minutes to brush up on the basics of cooking this veggie.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cabbage, Cauliflour, Broccoli', '', ''),
(229, 1, 'Brussels Sprouts', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Palatino, &amp;quot;Palatino Linotype&amp;quot;, &amp;quot;Palatino LT STD&amp;quot;, &amp;quot;Book Antiqua&amp;quot;, Georgia, serif; font-size: 18.2px;&quot;&gt;Roasting, perhaps the most popular way to prepare this veggie, has proved them to be one of the tastier vegetables we enjoy once the weather cools.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cabbage, Cauliflour, Broccoli', '', ''),
(230, 1, 'Baby corn', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Roboto Slab&amp;quot;, &amp;quot;Times New Roman&amp;quot;, Times, serif; font-size: 14px;&quot;&gt;This is a year-round product often imported from Mexico and is available in white and yellow varieties.&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Roboto Slab&amp;quot;, &amp;quot;Times New Roman&amp;quot;, Times, serif; font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/p&gt;', '', 'Baby Vegetables', '', ''),
(231, 1, 'Baby celery ', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Roboto Slab&amp;quot;, &amp;quot;Times New Roman&amp;quot;, Times, serif; font-size: 14px;&quot;&gt;A fall and winter crop, baby celery is around 7 inches long with a strong celery flavor.&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Roboto Slab&amp;quot;, &amp;quot;Times New Roman&amp;quot;, Times, serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Roboto Slab&amp;quot;, &amp;quot;Times New Roman&amp;quot;, Times, serif; font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/p&gt;', '', 'Baby Vegetables', '', ''),
(232, 1, 'Baby French green bean', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Roboto Slab&amp;quot;, &amp;quot;Times New Roman&amp;quot;, Times, serif; font-size: 14px;&quot;&gt;February through November via southern California. Commonly called haricot verts, this flavorful strain of green beans was developed and popularized in France and has more recently gained appeal in the United States.&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Roboto Slab&amp;quot;, &amp;quot;Times New Roman&amp;quot;, Times, serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Roboto Slab&amp;quot;, &amp;quot;Times New Roman&amp;quot;, Times, serif; font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/p&gt;', '', 'Baby Vegetables', '', ''),
(234, 1, 'Bitter Gourd', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;The most bitter among all fruits, bitter gourds come with a rough, bumpy and green skin. The off-white translucent flesh tastes crispy with the combination of the bitter seeds that are present inside.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Gourds, Pumpkins &amp;amp; Drumsticks', '', ''),
(235, 1, 'Pumpkin Green ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Fresho brings to you cut pumpkin green with creamish to yellow flesh and flat, edible seeds&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Gourds, Pumpkins &amp;amp; Drumsticks', '', ''),
(236, 1, 'Drumstick', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Drumsticks have long, dark green bumpy pods running along the length and fleshy pulp inside the pod encasing each seed. These pods have a faint bitter taste combined with slight sweetness.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Gourds, Pumpkins &amp;amp; Drumsticks', '', ''),
(237, 1, 'Black Forest Cake', '&lt;p&gt;&lt;span style=&quot;color: rgb(24, 24, 24); font-size: 16px;&quot;&gt;Made with Fresh Whipped Cream and blends of Chocolate, Blackforest is the most sought-after cake flavour, and the all-time favorite of almost everyone. Send this freshly baked delicacy to your loved ones today. Suitable for Birthday, Anniversaries, and more occasions, etc.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cakes', '', ''),
(238, 1, 'Tempting Truffle Cake', '&lt;p&gt;&lt;span style=&quot;color: rgb(24, 24, 24); font-size: 16px;&quot;&gt;This cake is a perfect example of \'Beauty Lies In Simplicity\'. With its mushy base and luscious chocolate glaze, this Chocolate Truffle is a drool worthy treat for all the times you wish to gorge on something delicious.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cakes', '', ''),
(239, 1, 'Artistic Chocolate Pleasure', '&lt;p&gt;&lt;span style=&quot;color: rgb(24, 24, 24); font-size: 16px;&quot;&gt;This Chocolate Truffle is all you need to add a special touch. The mushy chocolatey base finished perfectly with chocolate cream and artistic design is sure to please everyone in the crowd.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cakes', '', ''),
(240, 1, 'Butter Cookies', '&lt;h1 style=&quot;margin-bottom: 0px; padding: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; color: rgb(0, 0, 0);&quot;&gt;Danisa Butter Cookies&lt;/h1&gt;', '', 'Muffins, Cookies, Rusks', '', ''),
(241, 1, 'BRITANNIA PREMIUM BAKE RUSK', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: Varela; font-size: 20px; letter-spacing: 0.2px; text-transform: uppercase;&quot;&gt;BRITANNIA PREMIUM BAKE RUSK PACKET&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Muffins, Cookies, Rusks', '', ''),
(242, 1, 'Bake Rusk', '&lt;p&gt;&lt;span style=&quot;color: rgba(0, 0, 0, 0.87); font-family: Roboto, sans-serif; font-size: 15px;&quot;&gt;The crunchiest, tastiest rusk by Britannia.Dip a slice of rusk in your tea and see it soak in the right amount of tea, then go ahead bite into that inviting sliver of juicy crunchiness.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Muffins, Cookies, Rusks', '', ''),
(243, 1, 'Choco Filled Biscuit', '&lt;h4 class=&quot;prBrandName&quot; style=&quot;margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: 13px; line-height: 13px; min-height: 27px; max-height: 30px; overflow: hidden; font-family: Roboto, sans-serif; color: rgb(46, 46, 46) !important; text-transform: capitalize !important;&quot;&gt;Milano Choco Filled Biscuit&lt;/h4&gt;', '', 'Muffins, Cookies, Rusks', '', ''),
(244, 1, 'Mist Curd', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Milky Mist Curd Farm Fresh is a rich supply of calcium and proteins. Prepared from better quality pasteurized toned milk to provide you the right width and texture.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Curd', '', ''),
(245, 1, 'Nestle A+ Dahi', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Nestle is a brand that has been around since its inception in 1866. With a history of innovation and evolution, this brand creates a number of products that are a part of our daily lives.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Curd', '', ''),
(247, 1, 'Mother Dairy Dahi', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Our curd is arranged using the best quality standards making it disinfected. It is regularly thick, reliable and natural lacking the use of any preservatives.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Curd', '', ''),
(248, 1, 'Dabur Hommade', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Dabur Hommade goes beyond its popular range of cooking pastes to elevate the tastes of Indian homemade recipes with Lemoneez.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Concentrates', '', ''),
(249, 1, 'Minute Maid Juice Concentrate ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Water, sugar, concentrate of fresh lemon juice&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Concentrates', '', ''),
(250, 1, 'Nilgiri Natural ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Provides Protection to your family by reducing the side effects of Chemicals, It\'s natural formula prevents mosquito insects and germs and make your environment lively.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Concentrates', '', ''),
(251, 1, 'JUICE CONCENTRATES', '&lt;p&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 16.1px;&quot;&gt;The quality and availability is guaranteed based on agreed specification and a contract throughout seasons.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Concentrates', '', ''),
(252, 1, 'Mango and Pineapple Punch', '&lt;p&gt;&lt;span style=&quot;color: rgb(99, 103, 112); font-family: &amp;quot;Trebuchet MS&amp;quot;;&quot;&gt;A refreshing chiller that can be enjoyed anytime, the quick Fruit Punch can be prepared in minutes using readymade fruit juices and vanilla ice-cream.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mango Juices', '', ''),
(253, 1, 'Mango Green Chillies ', '&lt;p&gt;&lt;span style=&quot;color: rgb(99, 103, 112); font-family: &amp;quot;Trebuchet MS&amp;quot;;&quot;&gt;A delicious chilled sweet and spicy sorbet!&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mango Juices', '', ''),
(254, 1, 'Mango Pasta ', '&lt;p&gt;&lt;span style=&quot;color: rgb(99, 103, 112); font-family: &amp;quot;Trebuchet MS&amp;quot;;&quot;&gt;This is an unconventional Salad of Mangoes and Pasta. The dressing of this salad has a very pleasant sunshine colour and will definitely be a hit when served to guests.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mango Juices', '', ''),
(255, 1, 'Fruit Punch', '&lt;p&gt;&lt;span style=&quot;color: rgb(99, 103, 112); font-family: &amp;quot;Trebuchet MS&amp;quot;;&quot;&gt;One of the most popular welcome drinks served at most parties, the fruit punch features a delightful blend of colours and flavours.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mango Juices', '', ''),
(256, 1, 'Minute Maid', '&lt;p&gt;&lt;span style=&quot;color: rgb(17, 17, 17); font-family: TiemposTextWeb-Regular, Georgia, Times, serif; font-size: 19px;&quot;&gt;The minute maid&amp;nbsp; was tasty and not too acidic. The overall taste was a little watery but sweet.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Orange &amp;amp; Apple Juices', '', ''),
(257, 1, 'Tropicana', '&lt;p&gt;&lt;span style=&quot;color: rgb(17, 17, 17); font-family: TiemposTextWeb-Regular, Georgia, Times, serif; font-size: 19px;&quot;&gt;Perhaps this was just a placebo effect of the branding, but it almost tasted like there was a passion fruit or mango flavor added to the orange juice.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Orange &amp;amp; Apple Juices', '', ''),
(258, 1, 'Apple Pie Smoothie', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Montserrat, sans-serif; font-size: 15px;&quot;&gt;All the flavor and decadence of apple pie, minus the fuss of making a pie crust&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Orange &amp;amp; Apple Juices', '', ''),
(259, 1, 'Ginger Hard Apple', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Montserrat, sans-serif; font-size: 15px;&quot;&gt;This fruity, sparkly, bubbly, big-batch cocktail gets its signature kick from hard cider&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Orange &amp;amp; Apple Juices', '', ''),
(260, 1, 'Frooti Drink ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;&amp;nbsp;It ensures that you can get pleasure from the taste of the best-grown mangoes suitably throughout the year.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Other Juices', '', ''),
(261, 1, 'Appy Juice', '&lt;p&gt;Appy Fizz consists of sparkling apple juice and is used as the foundation for cocktails and is a well-liked drink with the early life.&lt;br&gt;&lt;/p&gt;', '', 'Other Juices', '', ''),
(262, 1, 'Coconut Water ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Coconut Water is bottled natural coconut water which packs all the goodness of natural coconut water.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Other Juices', '', ''),
(263, 1, 'Lipton Green Tea Bags', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Green tea is produced when freshly plucked leaves are heated, rolled/cut and then dried. The catechins in the fresh leaves are preserved during the green tea process, making green tea rich in catechins.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Green Tea', '', ''),
(264, 1, 'Tetley Green Tea ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Tetley Green Tea Pure Original Long Leaf&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Green Tea', '', ''),
(265, 1, 'bb Royal Green Tea', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;It also increases metabolisim that burns calories &amp;amp; reduces fat content in the body. Drinking green tea on a daily basis refreshes your body &amp;amp; keeps you healthy.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Green Tea', '', ''),
(266, 1, 'Tetley Green Tea', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Tetley Green Tea with refreshing pure original flavour&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Green Tea', '', ''),
(267, 1, 'Cothas Coffee Premium Special', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Cothas coffee offers you with finest of both the worlds; the wealthy taste and aroma of usual filter coffee along with the confidence and superiority of a truly world class product.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ground Coffee', '', ''),
(268, 1, 'Leo Coffee', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;&amp;nbsp;Its lightly roasted ground coffee beans help create the perfect decoction for a rich and smooth flavourful cup that helps rejuvenate your senses. The nitro flush packaging retains its fresh flavour and aroma providing rich, tasteful notes. Kick-start your day with a cup of fresh and aromatic Bru Green Label Coffee.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ground Coffee', '', ''),
(269, 1, ' Classic Coffee - Matinee Sundowner', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Classic brings to you a unique blend of Arabica beans straight from the exotic coffee plantations to your coffee mugs. Experience the authenticity of premium grade quality coffee through its rich aroma and great taste in your daily cuppa to be enjoyed with the company of your friends and family.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ground Coffee', '', ''),
(270, 1, 'Classic Coffee Perfect ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Classic brings to you a unique blend of Arabica beans straight from the exotic coffee plantations to your coffee mugs. Experience the authenticity of premium grade quality coffee through its rich aroma and great taste in your daily cuppa to be enjoyed with the company of your friends and family.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ground Coffee', '', ''),
(271, 1, 'Ayusya Herbal Tea - Wellness', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Energizes your day and keep you fit. Helps loosing weight and extra fats.helps relieving thyroid ,helps relieving asthma.boasts your immunity system. Purifies your blood.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Herbal Tea', '', ''),
(272, 1, 'Teabox Herbal Tea - Hibiscus Lemongrass', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;The teas are sealed at source within 48 hours from harvest. A handcrafted tisane with robust spring flavors. Its velvety liquor bears distinct flavor notes of tart and citrus with a hint of spice.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Herbal Tea', '', ''),
(273, 1, 'Octavius Herbal Tea - Indian', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;This is an absolutely natural beverage with an ancient caffeine free preparation, which gives instant relief from common cold, cough, sore throat, headache and body ache.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Herbal Tea', '', ''),
(274, 1, 'Sri Sri Ayurveda Herbal Tea - Madhukari', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;&amp;nbsp;Digestive aid, Ir reduce kapha and relives thirst, Every cup of Madhukari Herbal Tea ensure the same freshness aroma and taste.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Herbal Tea', '', ''),
(275, 1, 'Teabox Herbal Tea - Ginger Mint', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;With a light lemon yellow colour and a medium aroma of mint and ginger notes, this tea is medium-bodied and well-rounded throughout. Notes of fresh ginger and mint are prominent throughout the length of the cup.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Herbal Tea', '', ''),
(277, 1, 'Tetley Masala Tea', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Tetley Original Black Tea&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Tea Bags', '', ''),
(278, 1, 'Wagh Bakri Assam Tea', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;&amp;nbsp;It is rich in antioxidants and is packed in innovative double chambered staple-free bags. Thus, apart from ensuring health benefits, it also promises safety.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Tea Bags', '', ''),
(279, 1, 'Tetley Tea - Ginger', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Tetley Black Tea with natural ginger flavour&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Tea Bags', '', ''),
(280, 1, 'Channa Dal', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;&amp;nbsp;Popular is our in house economy range of staples which offers your great quality and variety at consistently low prices.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Channa Dal', '', ''),
(281, 1, 'bb Royal Organic', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Organic Channa Dal plays the vital part while accompanying rice or rotis. It is one of the best dals to improve taste and purity after preparing it. The finest thing about Channa Dal is multiple dishes can be completed out of it.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Channa Dal', '', ''),
(282, 1, 'bb Royal Channa Dal Unpolished', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Channa dal contains a mild sweet taste when Cooked and is rich nutritious.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Unpolished dal is always a healthier option. It may not look glossy but it gives natural taste &amp;amp; aroma. It can be made into a paste easily and cooking time is also less compared to polished dals.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Channa Dal', '', ''),
(283, 1, 'bb Royal Toor Dal', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Toor Dal is the most widely-used form of the lentil. It is used in famous recipes. It contains a thick gelatinous or meaty texture, &amp;amp; takes a little longer to cook than moong or masoor dal. It is fine for health and fulfills the energy.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Other Dals', '', ''),
(284, 1, 'Royal Urad Dal', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Urad Whole is skinned urad dal are creamy white and somewhat bland. It has fine taste and holds significant importance as a staple diet in several parts of the country.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Other Dals', '', ''),
(285, 1, 'Royal Masoor Dal', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Masoor Dal is one of the most well-known Indian lentils. This dal is with no skin and red in color.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Other Dals', '', ''),
(286, 1, 'Popular Moong Dal', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Moong beans is a popular food among vegetarians since it contains a lot of proteins and fiber. It is one of the easiest dals to digest and for this reason it is often given to people recovering from an illness, specially a stomach upset.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Moong Dal', '', ''),
(287, 1, 'Royal Organic', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Moong dal will get from Mung beans. The split moong dal is utilized in Indian curries. It is high in fiber and protein, other than low on fat.This is cultivated without the use of pesticides ,artificial fertilizers or chemicals&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Moong Dal', '', ''),
(288, 1, 'Royal Moong Dal', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Moong dal is one of the most popular lentils eaten across India. Packed with protein, BB Royal moong dal packs deliver the finest selection of lentils which is evident from the shine on the lentils.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Moong Dal', '', ''),
(289, 1, 'Haldirams Namkeen - Moong Dal', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Haldirams Moong Dal is made by using excellence of moong and other elements. And it has high-quality taste and smell. This all time favourite salted snack is prepared of fried moong lentils.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Moong Dal', '', ''),
(290, 1, 'DELON Body Wash ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Organic Now BODY WASH uses nature to take, reviatlize and protect your skin. This refreshingly scented BODY WASH gives your skin all the benefits of organic Aloe Vera Leaf Juice, leaving it soft, smooth and healthy.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Soap &amp;amp; Body wash', '', ''),
(291, 1, 'Dove Body Wash', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Replenish the moisture in your dry skin with the nourishment of Dove Go Fresh Body Lotion. This fast absorbing hand and body lotion by Dove consists of a refreshing cucumber and green tea scent, along with a cooling menthol sensation that revitalizes your skin!&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Soap &amp;amp; Body wash', '', ''),
(292, 1, 'Jovees Body Wash', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;This gentle and moisturising body wash is luxurious and super lathery, making your skin feel silky and soft. Its non-drying and perfect for daily use.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Soap &amp;amp; Body wash', '', ''),
(293, 1, 'Dettol Body Wash', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Dettol Cool pH balanced Bodywash with crispy menthol fragrance provides Dettols trusted germ protection from a wide range of unseen germs. It cleanses and protects your skin keeping you healthy everyday.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Soap &amp;amp; Body wash', '', ''),
(294, 1, 'Park avenue Deo Talc', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Park Avenue Storm Freshness Deo Talc has a powerful deodorising effect which keeps you fresh and fights body odour all day.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Deo &amp;amp; Talcs', '', ''),
(295, 1, 'Navratna Talc ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Navratna Cool Talc- Duniya ka sabse chhota AC, comes as a refreshing break from the offerings of ordinary talc category, since it provides double benefits of Cooling + Fragrance.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Deo &amp;amp; Talcs', '', ''),
(296, 1, 'Wild Stone Deo Talc ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Wild stone Deo talc with ultra masculine fragrance specially created by masters perfumers.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Deo &amp;amp; Talcs', '', ''),
(297, 1, 'Vlcc Body Lotion', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;VLCC Pista Massage Cream (200g):effective multi-action cream gives cellular protection and Hydration.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Body Lotions &amp;amp; Creams', '', ''),
(298, 1, 'Vaseline Intensive Care ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Have you ever wondered how to get glowing skin? When skin is radiant, it helps to boost self-confidence and assures that the skin is healthy, both inside and out.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Body Lotions &amp;amp; Creams', '', ''),
(299, 1, 'Shea Nourishing Whip', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Light and fluffy, this quick-absorbing, non-greasy whipped cream lotion, with rich and velvety natural ingredients, smoothes easily over the skin, leaving it feeling well moisturised, soft and supple. Suitable for very dry skin types.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Body Lotions &amp;amp; Creams', '', ''),
(300, 1, 'Lakme Peach Milk ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Is your skin loosing moisture as the day goes by ? Lakme brings to you a moisturizer which is a blend of wholesome peaches and milk, which nourishes the skin deeply without making it appear oily.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Body Lotions &amp;amp; Creams', '', ''),
(301, 1, 'Apollo Pharmacy Dental ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Apollo Pharmacy Dental Floss Picks provide a complete clean feeling every time you floss. Its thin silky floss with textured pick, slide easily between teeth to remove debris and fight bad breath, plaque and tooth decay.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Dental Care', '', ''),
(302, 1, 'Colgate Toothpaste', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Colgate strong Teeth is Indias No. 1 Anti-Cavity Toothpaste. Its Calci-lock Protection helps lock calcium in teeth and keeps them protected from cavities.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Dental Care', '', ''),
(303, 1, 'Future Organics Tooth Powder', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;India has been blessed with magical herbs , having medicinal and healing properties. We bring to you a tooth powder, which apart from doing wonders for your gums and teeth and can help fight against obesity&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toothpastes &amp;amp; Powder', '', ''),
(304, 1, 'Sensodyne Toothpaste', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Clinically proven relief and daily protection for sensitive teeth. Sensodyne Relieves sensitivity by building a protective barrier that blocks the sensitivity caused by hot, cold, sweet and other contact triggers.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toothpastes &amp;amp; Powder', '', ''),
(305, 1, 'Dabur Babool Toothpaste', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Babool Toothpaste is natural toothpaste filled with the medicinal benefits of Babul tree \'Acacia Arabia\'. The Babul herbal extract in this toothpaste helps avoid swelling and bleeding of gums, keeping your gums strong and teeth sturdy.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toothpastes &amp;amp; Powder', '', ''),
(306, 1, 'Sensodyne Sensitive Toothbrush', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Specially designed for people with sensitive teeth. Sensodyne Toothbrush Provides effective cleaning of the teeth. Broad ergonomic handle ensures comfortable grip and better reach&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toothbrushes', '', ''),
(307, 1, 'Colgate Toothbrush - ZigZag', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Colgate Zig Zag comes with multi-angle zig zag bristles designed to reach deep between teeth to effectively remove plaque. The end rounded medium bristles feel gentle on teeth and gums.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toothbrushes', '', ''),
(308, 1, 'Oral-B Tooth Brush Pro ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Oral-B is the Worlds No1 toothbrush brand which brings to you and your family revolutionary brushing solutions with best in class technology to ensure you and your family get Healthier &amp;amp; Cleaner mouth.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toothbrushes', '', ''),
(309, 1, 'Colgate Toothbrush - Kids Barbie', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Colgate Kids Barbie toothbrush comes with your childs favorite character to make brushing exciting and fun. Especially designed for kids of ages 5 years and above, the extra soft bristles of the kids brush work gently on their developing teeth and gums.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toothbrushes', '', ''),
(310, 1, 'Fem Creme Bleach', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;A complete cure from the suns harmful rays, FEM brings you the first De-Tan Bleach. With FEM De-Tan Bleach, you can now step out for the day confidently.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Bleach &amp;amp; Hair Removers', '', ''),
(311, 1, 'Oxy Life Creme Bleach', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Fight 5 skin problems with the power of oxygen -Removes dark spots -Makes the skin tone even -Brightens dull skin -Eliminates dead skin cells -Lightens sun tan.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Bleach &amp;amp; Hair Removers', '', ''),
(312, 1, 'Veet Hair Removal Cream', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Veets Hair Removal Cream is your answer to a smooth, flawless and hair-free skin. Its contains 100% natural Camellia Seed Oil extracts which smoothens your skin without causing much irritation and moisturising it in the process.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Bleach &amp;amp; Hair Removers', '', ''),
(313, 1, 'Dettol Handwash - Skin Care', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Dettol skincare liquid hand wash has been especially formulated for daily use. It fights the growth of germs and bacteria and leaves your hands feeling fresh and clean.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Skin Care', '', ''),
(314, 1, 'Bajaj Nomarks', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;New Bajaj Nomarks Cream for Normal Skin is an Ayurvedic skin safe formulation with the goodness of Turmeric, Lemon and wheat germ oil.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Skin Care', '', ''),
(315, 1, 'Kaya Sunscreen Lotion', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;It is no news that sun exposure is one of the top culprits for skin ageing. Studies have shown that UV exposure is responsible for up to 90 percent of visible signs of skin aging.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Skin Care', '', ''),
(316, 1, 'bb Popular Cashew/Kaju ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Cashew - Broken (4 pc) contain good amounts of dietary fibre, oil and antioxidants. They are wealthy in monounsaturated fatty acid and minerals such as potassium, iron, phosphorous, zinc, copper and selenium.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cashews', '', ''),
(317, 1, 'Cashew/Kaju Whole Premium ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Cashew nuts are seeds of the fruit of the cashew tree. It is white, soft and meaty. It hardens and changes to a darker white once roasted, and has a rich flavour making it the most flavoursome nut. These are rich in monounsaturated fatty acid and minerals such as iron, potassium, phosphorous, copper, zinc and selenium.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cashews', '', ''),
(318, 1, 'Organic - Cashew/Kaju Whole', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Cashew Whole is enhanced with high calorie and fat content. It contains several health advantages because of their rich mineral content.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cashews', '', ''),
(319, 1, 'Raisins/Kishmish - Indian', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Indian Raisins has delicious taste, high nutritional value and freshness. These raisins are used in cuisines and palatable dishes all over the globe.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Raisins', '', ''),
(320, 1, 'Raisins/kishmish - Black, Seedless', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Black Seedless Raisin, the most famous variety of dried grape, is widely known for its sugary taste &amp;amp; juicy flavor.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Raisins', '', ''),
(321, 1, 'Abjosh/Munakka', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Abjosh is dried grapes which have a wrinkly appearance to them. They are sweet and are much loved by the young and old alike. Abjosh are usually a different color from the usual green raisins.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Raisins', '', ''),
(322, 1, 'Parachute Coconut Oil', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Parachute Coconut hair oil gives ample miniaturization and nourishment to keeps hair soft, supple and nourished. It brings to you the natural goodness of coconut.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Coconut Oil', '', ''),
(323, 1, 'Shudhi - Coconut Oil', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;KPL Shudhi Coconut Oil keeps against insulin resistance, reducing the danger of type 2 diabetes. It is also showed to speed up metabolism.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Coconut Oil', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(324, 1, 'Parachute Advansed Hair Oil - Coconut', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Parachute Advanced coconut hair oil from Marico has been made especially keeping in mind the needs of hair. It contains essential oils of ylang-ylang to give it a rich and deep fragrance.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Coconut Oil', '', ''),
(325, 1, 'Organic Coconut Oil - Cold Pressed', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;ForGreen Cold Pressed Organic Coconut Oil: Coconut Oil is, Rich source of lauric acid, Rich in Antioxidants, Good Cooking oil, Good natural nutrients for hair, Very good massage oil&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Coconut Oil', '', ''),
(326, 1, 'Patanjali Mustard Oil', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Oil of Mustard seeds. Free from Argemone oil. Kitchens all over India use Mustard oil extensively in preparing tasty recipes &amp;amp; pickles.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mustard Oil', '', ''),
(327, 1, 'Emami Healthy &amp; Tasty', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Manufactured by: EMAMI AGROTECH LIMITED&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mustard Oil', '', ''),
(328, 1, 'Nutty Yogi Organic Cold Pressed ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Nutty Yogis Mustard Oil is 100% certified organic, cold pressed mustard oil extracted from the freshest &amp;amp; finest mustard seeds.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mustard Oil', '', ''),
(329, 1, 'Nandini Pure Ghee', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;A taste of purity, Nandini Ghee made from pure butter. It is pure and fresh with a delicious flavor. Ghee is the natural stuff that provides nutrition.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ghee', '', ''),
(330, 1, 'Mother dairy Pure Cow - Ghee', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;In Ayurveda, Cow ghee is believed to be the best for human consumption. It is considered as rasayana, a rejuvenating and longevity promoting food.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ghee', '', ''),
(331, 1, 'Amul Pure Ghee', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Clarified Butter or Pure Ghee is a staple in Indian Kitchens. Known to be rich in anti oxidants and trans fat, this product from the house of Amul can be used for cooking and aids people in the weight management process as well.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ghee', '', ''),
(332, 1, 'Patanjali Cow Ghee', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Patanjali country cow ghee is like amrit. We can not trust the cow ghee which is available in markets. It may harm instead of benefit.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ghee', '', ''),
(333, 1, 'Johnson Baby Laundry Detergent', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;We know that you need to protect your baby from everything harsh and hence you go that extra mile so that only the most gentle reaches her.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Laundry', '', ''),
(334, 1, 'Natural Liquid - Laundry Detergent', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;We know that you need to protect your baby from everything harsh and hence you go that extra mile so that only the most gentle reaches her.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Laundry', '', ''),
(335, 1, 'Natural Liquid - Laundry Detergent', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Soapnuts are rich in lather and are chemical free alternatives for various cleansing. Free from SLS, SLES, Sulphanates, Phosphates, Artificial fragrance, colour, Bleach, Optical brigthners, Allergens, Nuts 1.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Laundry', '', ''),
(336, 1, 'Baby Accessories &amp; Vegetable Liquid Cleanser', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;With Baby In Mind, Mee Mee Baby Accessories Vegetable Liquid Cleanser Is Carefully Made To The Highest Safety Standards. Liquid Cleanser Is Formulated With Edible Ingredients.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Laundry', '', ''),
(337, 1, ' Detergent Washing Powder ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;New Tide + with Extra Power detergent, now with the added Power of Bar, has been developed to bring you brilliant whiteness on your clothes.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Detergent Power &amp;amp; Bars', '', ''),
(338, 1, 'Rin Detergent Bar', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;With so many chores on the list, expert help always works! Leave your laundry woes to the Rin Detergent Bar- its NSD technology ensures the bar stays dry whereas the easy to hold shape gives you a better grip while washing away stains.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Detergent Power &amp;amp; Bars', '', ''),
(339, 1, 'BORGES Olive Oil - Extra Light', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Borges Light Flavour Olive Oil has a very soft taste allowing the flavours of other ingredients to come during.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Olive Oil', '', ''),
(340, 1, 'Figaro Pure Olive Oil', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Figaro Olive Oil has been celebrating the goodness of olive oil for nearly a century.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Olive Oil', '', ''),
(341, 1, 'Farrell Olive Oil - Pomace', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Farrell Olive Pomace Oil is light and neutral and is perfect for utilize in cooking and frying. Since it comes with no any flavor, Olive Pomace Oil does not alter the flavor of the food being arranged with it.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Olive Oil', '', ''),
(342, 1, 'Olive Oil - Pure, Classic', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Borges is a well known brand that produces high quality food products including aromatic and flavourful olive oils that are categorised as per the level of press that the olives have enjoyed before being bottled.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Olive Oil', '', ''),
(343, 1, 'Royal Corn Flour', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Corn flour mixes well with extra food ingredients and can be mixed with wheat flour to decrease gluten for cakes, pastries, cookies and crackers.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Softerners &amp;amp; Satins Removers', '', ''),
(344, 1, 'Revive Starch Stiffener', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Revive liquid stiffener assists make the fabric look more respectable. This contains no detergent, and hence the fabric need not be washed after the use of stiffener. This is simple to use and skin friendly. To look superior in old clothes.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Starch &amp;amp; Whitners', '', ''),
(345, 1, 'Anti Bacteria Fabric Stiffener', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Revive is a renowned brand in fabric care products. Keeping up with its tradition, Revive has come up with Revive anti bacteria fabric stiffener.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Starch &amp;amp; Whitners', '', ''),
(346, 1, 'Faultless Spray Starch', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Faultless Regular Starch is the exclusive starch formula sprays consistently on clothes to recommend the body you normally get only from specialized laundering. Shirts and blouses come out sharp and crisp.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Starch &amp;amp; Whitners', '', ''),
(347, 1, 'Faultless Heavy Starch', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Faultless Heavy Starch (567g) Original Scent sprays on evenly with its button technology. In turn, it\'ll assist your entire shirts look professional and fresh all day.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Starch &amp;amp; Whitners', '', ''),
(348, 1, 'Satinance Multani Mati', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Satinance multani matti is an excellent skin toner and astringent. reduces oiliness and while nourishing the skin, keeps it soft and grime.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Softerners &amp;amp; Satins Removers', '', ''),
(349, 1, 'Vanish Stain Remover', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Only detergents are not enough for removing tough stains and most of the times the stain remains on the clothes even after a wash with detergent.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Softerners &amp;amp; Satins Removers', '', ''),
(350, 1, 'Satinance Wild Turmeric Powder ', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Radiance &amp;amp; Glowing It helps in removing facial hair &amp;amp;pimple marks, When applied before taking bath it gives a glow to skin. Its natural way of caring your skin reduces blemishes&amp;amp;removes tan from face.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Softerners &amp;amp; Satins Removers', '', ''),
(351, 1, 'Face Wash - Tan Removal Orange', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;&amp;nbsp;Enriched with natural ingredients like Orange Peel extract, Papain and Honey, it effectively tones, exfoliates, and moisturizes skin right from the first application.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Softerners &amp;amp; Satins Removers', '', ''),
(352, 1, 'Orange Peel &amp; Geranium', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Satinance Natural Clay Pack will make your skin tone light and serves as a remover of acne marks, dark circles, zits, etc&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Softerners &amp;amp; Satins Removers', '', ''),
(353, 1, ' Bathroom Cleaner - Lemon', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Harpic Bathroom Cleaner is a strong bathroom disinfectant and cleaning liquid that helps remove the toughest of stains. It gives you an unbeatable cleaning on greasy soil and particulate matter and the freshest Harpic freshness for the whole bathroom.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toilet Cleaners', '', ''),
(354, 1, 'Toilet Cleaner - Ocean Fresh', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;The all new Domex Fresh &amp;amp; Clean is a premium toilet cleaner that leaves behind a refreshing aroma and delivers a long lasting fragrance&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toilet Cleaners', '', ''),
(355, 1, 'Toilet Cleaner Germ &amp; Stain Blaster', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Harpic Germ and Stain Blaster is a powerful toilet cleaner, strongest of the Harpic lot that gives you unbeatable cleaning both above and below the waterline and floral freshness for the toilet.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toilet Cleaners', '', ''),
(356, 1, 'Toilet Cleaner - Bleach, White &amp; Shine', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Harpic is Indias No.1 Toilet Cleaning Brand which is highly recommended by the Indian Medical Association.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Toilet Cleaners', '', ''),
(357, 1, 'Stain Blaster - Floral', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Harpic Germ and Stain Blaster is a powerful toilet cleaner, strongest of the Harpic lot that gives you unbeatable cleaning both above and below the waterline and floral freshness for the toilet.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Floor Cleaners &amp;amp; Phenyls', '', ''),
(358, 1, 'Bathroom Cleaning Liquid - Floral', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Toilet Cleaning Brand which is highly recommended by the Indian Medical Association.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Floor Cleaners &amp;amp; Phenyls', '', ''),
(359, 1, 'Phenyl - Organic Floor Cleaner', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Phenyl cleans your house in the way it should be cleaned - the natural way. distilled desi cow urine acts as a natural anti microbial agent.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Floor Cleaners &amp;amp; Phenyls', '', ''),
(360, 1, 'Floor Cleaner - 2-in-1 Phenolic', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;The sheer power of Domex gives you the confidence you need in eradicating all known germs.With Domex, you can be absolutely certain that the job is done.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Floor Cleaners &amp;amp; Phenyls', '', ''),
(361, 1, 'Glass &amp; Household Cleaner', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Glass cleaner contains unique blend of ingredients that easily removes stubborn dirt, finger prints &amp;amp; dust build up on various glass surfaces.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Glass &amp;amp; Others Cleaners', '', ''),
(362, 1, 'Justmop - Glass Cleaner Spray', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Herbal Glass Cleaner SprayThis Herbal Glass Cleaner is made from plant deriving ingredients with the presence ofessential oils which it tough on dirt, but gentle to home and the earth.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Glass &amp;amp; Others Cleaners', '', ''),
(363, 1, ' Multipurpose Glass Cleaner with Spray', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Integrated water cleaner, synchronized water, wiping, cleaning the same time, the windows become clean! Widely used in flat surface windows, glass, mirrors, floors, cars, etc.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Glass &amp;amp; Others Cleaners', '', ''),
(364, 1, 'Glass &amp; Surface Cleaner', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Use on mirrors, windows, refrigerators, countertops, ceramic tile, stainless steel and linoleum.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Glass &amp;amp; Others Cleaners', '', ''),
(365, 1, 'Window Glass Cleaner', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;This is a three in one use floor and window cleaner.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Glass &amp;amp; Others Cleaners', '', ''),
(366, 1, ' Disinfectant Surface Cleaner - Citru', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;The product is available in 8 different fragrances and is perfect for floors, tiles, sinks, kitchen counters and all other washable surfaces in your home.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'All Purpose Cleaners', '', ''),
(367, 1, 'Cleaner - Glass and Household', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Colin Cleaner Glass and House hold has vinegar as the main ingredient known for its strong cleansing action. It removes the dust from your surfaces and makes them spick and span.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'All Purpose Cleaners', '', ''),
(368, 1, 'All Purpose Cleaner - Lemon Fresh', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;All Purpose Cleaner - Lemon Fresh Cleans Grease and Grime throughout the house&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'All Purpose Cleaners', '', ''),
(369, 1, 'Plastic Bucket - Assorted Color', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;B&lt;/span&gt;ucket is convienient to use. Also, it is very durable as it uses high grade of virgin plastic. Ideally used for washing and moping.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Buckets, Tubs &amp;amp; Mugs', '', ''),
(370, 1, 'Deep Bucket - Assorted Colour', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Saaj plastic bucket of 20 Litre made From 100 Percent Virgin Material.Designed To Enhance Your Bathroom Decor. The Products Are Designed Keeping In Mind The Aesthetic As Well As Practicality.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Buckets, Tubs &amp;amp; Mugs', '', ''),
(371, 1, 'All Time Mug - Pink', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 'Buckets, Tubs &amp;amp; Mugs', '', ''),
(372, 1, 'All Time Mug - Pink', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;All Time Mug contains powerful framework and suggests excellent functional as well as aesthetic value. They are prepared using bakelite and other high quality PVC which creates them long lasting.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Buckets, Tubs &amp;amp; Mugs', '', ''),
(373, 1, 'Bottle with Lunch Box - Pink', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Simple yet stylish, the Tupperware Pink Plastic Bottle with Lunch Box is a must have in your kitchen. It features a classy design and flaunts a pink colour shade.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Bottle , Lunch &amp;amp; Containers', '', ''),
(374, 1, 'Water Bottle, Assorted Colour, Yummy Box', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Eco friendly stainless steel lunch box set with lunch bag and stainless steel water bottle, from the House of Sreeram. Pack a balanced meal quickly and easily.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Bottle , Lunch &amp;amp; Containers', '', ''),
(375, 1, 'Set of Bottle &amp; Container with Lid - Black', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Make Tupperware Set of 2 Pcs Extreme Set Bottle 750 ml &amp;amp; Box 500 ml a part of your kitchenware to be able to carry liquids easily while travelling.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Bottle , Lunch &amp;amp; Containers', '', ''),
(376, 1, 'Popular Rice - Steam, Sona Masoori', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Sona Masoori Silky Steam Rice is light weight aromatic rice. It has a affordable prices and very hygienic.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Raw Rice', '', ''),
(377, 1, 'Rice - Raw, Sona Masoori', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Sona Masoori Raw Rice has fine grains and is of great taste when cooked. This rice is grown without any chemical pesticides thereby retaining its great flavor and smell.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Raw Rice', '', ''),
(378, 1, 'Masoori Rice Raw Rice - Super Premium', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Sona masoori is a variety of Indian white rice. It is a medium-grain, sweet-smelling rice that is trivial and low in starch. Sona masoori is naturally used in dishes such as biryani, sweet pongal, fried rice and idlis.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Raw Rice', '', ''),
(379, 1, 'Raw Rice - Kolam, 25 kg Bag', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Sona Masoori Is A Variety Of Indian White Rice. It Is A Medium-Grain, Sweet-Smelling Rice That Is Trivial And Low In Starch. Sona Masoori Is Naturally Used In Dishes Such As Biryani, Sweet Pongal, Fried Rice And Idlis.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Raw Rice', '', ''),
(380, 1, 'Basmati Rice - Feast Rozzana', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;India Gate Basmati Rice Feast Rozzana is defined by its long grains and amazing aromatic flavour.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Basmati Rice', '', ''),
(381, 1, 'Royal Basmati Rice - Premium', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Royal Premium Basmati rice leaves a lasting impression because of its aroma, flavour and fluffy texture. Popularly known as Pusa from the Basmati-rice-bowl states of Punjab, Haryana and Uttarakhand&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Basmati Rice', '', ''),
(383, 1, 'Basmati Rice - Traditional', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Even steamed rice can be an aromatic work of culinary art. &amp;nbsp;Every grain of Daawat Traditional Basmati Rice is aged to perfection, reviving the splendour of our royal cuisine.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Basmati Rice', '', ''),
(384, 1, 'Finest Whole Grain - Black', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Gluten Free, Low in calories, high in protein and fiber.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Whole Grains', '', ''),
(385, 1, 'Sauce - Whole Grain Mustard', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Happy Chef whole grain mustard involves an original French recipe when combined with cheese. Get ready to indulge yourself into the finest range of sauces and dips.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Whole Grains', '', ''),
(386, 1, 'Organic - Whole Wheat Multi Grain Atta', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Organic Multi Grain Atta has high protein content and helps keep your body healthy and active. It has abundant minerals that play a decisive role in improving the overall liveliness of the body.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Whole Grains', '', ''),
