(392, 1, 'Organics &amp; Naturals Malt - Multi Millet, Sprouted', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Dhatu Sprouted Millet Malt is made using Foxtail Millet, Browntop Millet, Kodo Millet and Little Millet. All the four types of Millets are sprouted, dried, mildly roasted and cold milled to bring out the aroma and to retain the maximum amount of nutrients.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Sprouts Whole Gram', '', ''),
(393, 1, 'Sprouts - Gram Green', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Bean sprouts are the young shoots of the mung bean with petite pale yellow to pale green leaves attached on a silvery bright white shoot.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Sprouts Whole Gram', '', ''),
(394, 1, 'Royal Fried Gram', '&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); font-family: ProximaNova-Regular; font-size: 13px;&quot;&gt;Fried Gram can be consumed in the form of whole dried seeds or they can be separated from the husk and split into two in a mill.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Sprouts Whole Gram', '', ''),
(395, 1, 'Sprouts - Channa Brown', '&lt;p&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-family: ProximaNova-Semibold; font-size: 22px;&quot;&gt;Fresho&lt;/span&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-family: ProximaNova-Semibold; font-size: 22px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-family: ProximaNova-Semibold; font-size: 22px;&quot;&gt;Sprouts - Channa Brown&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Sprouts Whole Gram', '', ''),
(396, 1, 'Amul Fresh Cream', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Amul Fresh Cream has been processed to give smooth, consistency and makes mouth watering preparations.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Milk Cream', '', ''),
(397, 1, 'Baby Milk Cream', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Milk Cream contains a unique combine of natural milk extract and Vitamins A &amp;amp; E. With twice nourishment, this product helps replenish moisture to leave skin feeling baby soft.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Milk Cream', '', ''),
(398, 1, 'Mocktail - Irish Cream', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Landessa Irish Cream Is A Refreshing Non-Carbonated, Flavored Milk Mocktail. It Is Ultra-Heat Treaded &amp;amp; Makes A Great On-The-Go Drink, &amp;amp; An Even Better Drink To Relish At The End Of The Day In A Tall Glass With Ice.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Milk Cream', '', ''),
(399, 1, ' Milk Crispy with Milk Cream', '&lt;h2 style=&quot;margin-right: 0px; margin-bottom: 19px; margin-left: 0px; padding: 0px; color: rgb(34, 34, 34); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 20px; font-family: &amp;quot;Roboto Slab&amp;quot;, serif;&quot;&gt;Loacker Wafer Filled - Milk Crispy with Milk Cream&lt;/h2&gt;', '', 'Milk Cream', '', ''),
(400, 1, 'Yoghurt Berry Delight', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;A berrylicious combination of handpicked Strawberries and Blueberries coupled with the goodness of yoghurt in delicious ice cream, which makes the Yoghurt Berry Delight a special treat.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Yogurt Cream', '', ''),
(401, 1, 'Cream Crunchiest Hazelnut Flavored', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: &amp;quot;Roboto Slab&amp;quot;, serif; background-color: rgb(242, 240, 235);&quot;&gt;Crunch n Cream Crunchiest Hazelnut&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Yogurt Cream', '', ''),
(402, 1, 'Flavoured Cream Wafer Roll', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Very crispiest texture and pleasant odour of flavour.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Yogurt Cream', '', ''),
(403, 1, 'Farm My Favourite Cottage Cream', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Enjoy the heart attractive flavor of Bisk Farm Cottage Biscuits that comes in a vanilla taste. The cream sandwiched between the two layers of this light and crusty biscuits.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Yogurt Cream', '', ''),
(404, 1, 'Go Cream - Fresh', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Made from Fresh Cow Milk, Give Mouth Feel of Cow Milk, Enhences the flavour of Dishes, UHT upholds sensitivity of Fresh Cream&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Fresh Cream', '', ''),
(405, 1, 'Fresh Cakes - Chocolate Cream Gateaux', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Chocolate Sponge topped with Cream, Chocolate mix &amp;amp; topped with rich Choco Truffle.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Fresh Cream', '', ''),
(406, 1, 'Shower Gel - Vitality Fresh', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Nivea Shower Gel - Vitality Fresh for Men formula is enriched with usual oceanic minerals that softly wash off impurities and excess sebum to keep your hair and skin feeling perfectly refreshed and clean.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Fresh Cream', '', ''),
(407, 1, 'Dove Go Fresh Body Lotion', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Replenish the moisture in your dry skin with the nourishment of Dove Go Fresh Body Lotion. This fast absorbing hand and body lotion by Dove consists of a refreshing cucumber and green tea scent, along with a cooling menthol sensation that revitalises your skin! This lotion leaves the skin feeling dewy and soft.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Fresh Cream', '', ''),
(408, 1, 'Nestle A+ Toned Milk', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Nestle has been associated with pure products that encourage good health. This toned milk 1 litre carton is no different.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Nestle Condensed Milk', '', ''),
(409, 1, 'Milk Powder - EveryDay', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&amp;nbsp;Its no wonder then, that in blind taste tests consumers ranked tea made with NESTLE EVERYDAY as their No.1 choice for a perfect cup of tea.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Nestle Condensed Milk', '', ''),
(410, 1, 'Nestle Milkmaid', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Milkmaid as A Name Synonymous With Delicious Desserts Has Been Delighting Generations Of Indian Consumers Over The Past 100 Years&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Nestle Condensed Milk', '', ''),
(411, 1, 'Nestle Nan Pro', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;This is particularly given to babies who cannot be breastfed. When it comes to babies, mother’s milk is definitely the best to protect them from illness.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Nestle Condensed Milk', '', ''),
(412, 1, 'Milkmaid Ice Cream Kit - Summer Special', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Complete Ice cream recipe solution. It contains all the ingredients you need to make delicious ice creams with MILKMAID.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Milkmaid Condensed Milk', '', ''),
(413, 1, 'GoodLife Skimmed Milk', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Nandini Goodlife Skimmed Milk is perfect for people who are trying to watch their weight; this no-fat milk is hygienically processed and can be taken twice a day.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Milkmaid Condensed Milk', '', ''),
(414, 1, 'Taaza Toned Milk', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Known for its dairy, confectionary and other products, Amul is one of the best brands in the Indian food industry.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Milkmaid Condensed Milk', '', ''),
(415, 1, 'Soya Milk - Chocolate', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Get set with delicious chocolate flavored SOFIT. Be it a day filled with work or one brimming with fun, do more with Sofit!&amp;nbsp;SOFIT Soya Milk is a Delicious Healthy Drink for everyone in the Family.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Milkmaid Condensed Milk', '', ''),
(416, 1, 'GoodLife Toned Milk', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Suitable for preparing tea/coffee, milk shakes and milk delights for people leading a fitness conscious lifestyle.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Sweetend Condensed Milk', '', ''),
(417, 1, 'Soya Milk - Kesar Pista', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Looking for a great way to kick start your day? Try the Kesar Pista flavored SOFIT! SOFIT Soya Milk is a Delicious Healthy Drink for everyone in the Family.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Sweetend Condensed Milk', '', ''),
(418, 1, 'Soya Milk - Sugar Free', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Sugar Free SOFIT, without added sugar. A great way to kick start your day! SOFIT Soya Milk is a Delicious Healthy Drink for everyone in the Family.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Sweetend Condensed Milk', '', ''),
(419, 1, 'Flavored Milk - Badam', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Badam Flavoured Milk: Nandini Badam Flavoured Milk, an energising health drink that will rfresh your senses, Sterilised at high temperatures and packed aseptically to ensure high quality and purity.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Sweetend Condensed Milk', '', ''),
(420, 1, 'Fresho Banana - Robusta', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Relish the soft, buttery texture of Robusta bananas that are light green and have a great fragrance and taste.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Banana', '', ''),
(421, 1, 'Banana - Raw Green', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Green banana is an unripened yellow banana. It is a superior supply of fiber, minerals, and vitamins and contains a starch. It is rich in vitamin B6, C, fiber &amp;amp; potassium. It performs more like a fiber than a starch.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Banana', '', ''),
(422, 1, 'Banana - Red', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Standing apart from the common varieties of yellow bananas, Red bananas are short, plump and reddish-purple in colour. Even the flesh is light pink and sweeter compared to other varieties.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Banana', '', ''),
(423, 1, ' Chips - Banana Pepper', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Banana chips pepper is a traditional indian snack, also rich source of minerals like fibre,iron &amp;amp; potassium.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Banana', '', ''),
(424, 1, 'Papaya - Semi Ripe', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Semi ripe papayas have blend of sweet buttery consistency and sour taste. They are half green and half yellow.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Papaya', '', ''),
(425, 1, 'Papaya- Diced', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Lots of delicious fresh-cut chunks of papaya is irresistable for any meal. We have neatly cleaned, diced and packed the papayas for you to consume it on the go.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Papaya', '', ''),
(426, 1, 'Papaya - Organically Grown', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Papayas are large and pear shaped with green to butter yellow skin colour when ripe. The flesh is pale orange with numerous small, black, sticky seeds at the center.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Papaya', '', ''),
(427, 1, 'Papaya - Raw', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Fresho is our brand of fresh fruits and vegetables which are individually handpicked everyday by our experienced and technically competent buyers. Our buying, storing and packaging processes are tailored to ensure that only the fresh, nutrient dense, healthy and delicious produce reaches your doorstep.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Papaya', '', ''),
(428, 1, 'Ladies\' Finger', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Ladies\' finger is a green vegetable with a tip at the end and a lighter green head, which is inedibe and to be thrown away.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Lady Finger', '', ''),
(429, 1, 'Ladies Finger - Diced', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Fresho brings to you diced Ladies Finger with a mild and slightly grassy flavour.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Lady Finger', '', ''),
(431, 1, 'Mysore Bhindi', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Mysore bhindi is a green vegetable with a tip at the end and a lighter green head, which is inedible and to be thrown away.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Lady Finger', '', ''),
(432, 1, 'Coconut - Organically Grown', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Product image shown is for representation purpose only, the actually product may vary based on season, produce &amp;amp; availability.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;div&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;', '', 'Organic Fruit', '', ''),
