(437, 1, 'Fresh Turmeric - Organically Grown', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;The fresh turmeric has a lighter shade of colour than common turmeric. This looks quite similar to ginger, but the taste is earthy and peppery.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Vegetable', '', ''),
