(441, 1, 'Mango - Raw', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Raw mango is a sweet-smelling fruit which is liked by al for its tart flavor.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mangoes', '', ''),
(442, 1, 'Mango - Totapuri', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;With a parrot like beak at the fruit tip, greenish yellow skinned Totapuri is a perfect blend of sweetness and tartness. It has rich aromatic flavour.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mangoes', '', ''),
(443, 1, 'Juice - Mango', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Maaza is the indulging, ready-to-serve mango drink, made from mango pulp and handpicked Alphonso.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Mangoes', '', ''),
(444, 1, 'Muskmelon - Striped', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Fresho striped muskmelons have a distinct external skin that is smooth, with green ribbing on pistachio-grey colored surface. Their flesh is orange coloured, sweet with a floral aroma. Fresho muskmelons are directly procured from our farmers.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Melons', '', ''),
(445, 1, 'Muskmelon - Netted Small', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;its a round melon with firm, orange, moderately sweet flesh and a thin, reticulated, light-grey rind.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Melons', '', ''),
(446, 1, 'Muskmelon - Diced', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Our diced muskmelons are ready to eat or can be mixed with other fruits in your salad. Sweet but not oversweet, our ripe muskmelon has a refreshing aroma and plenty of juice. Perfect as a healthy tea break snack.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Melons', '', ''),
(447, 1, 'Sun Melon', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;A fruit that comes with buttery yellow skin and translucent flesh, Sun melon has a sweet aroma and flavour. When the melon is ripe, its hard rind turns bright yellow.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Melons', '', ''),
(449, 1, 'Potato Crisps - Zingy Tomato', '&lt;p&gt;Potato Crisps - Zingy Tomato&lt;br&gt;&lt;/p&gt;', '', 'Potato, Tomato', '', ''),
(450, 1, 'Potato Chips - Spanish Tomato Tango', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Romance your taste buds with tangy flavor of tomatoes and savory spices. Delicious individual bags: perfect for snacking at work, home or school.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Potato, Tomato', '', ''),
(451, 1, 'Mccain Smiles - Crispy Happy Potato', '&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: &amp;quot;Roboto Slab&amp;quot;, serif; background-color: rgb(242, 240, 235);&quot;&gt;Combo Mccain Smiles - Crispy Happy Potato&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Potato, Tomato', '', ''),
(452, 1, 'Ready To Eat - Bhindi Masala', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Ladies fingers cooked with the perfect blend of spices. A tasty meal, anytime anywhere.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ladyfinger', '', ''),
(454, 1, 'Bonomi Sponge Cake - Savoiardi Ladyfinger', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Savoiardi biscuits are similar to sponge cakes, since it does not rely on any type of leavening agent for the light texture, but is the result of incorporating air into the egg whites.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Ladyfinger', '', ''),
(456, 1, ' Cabbage', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;With a texture of crispness and juiciness the moment you take the first bite, cabbages are sweet and grassy flavoured with dense and smooth leafy layers.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cabbage,Cauliflour', '', ''),
(457, 1, 'Red Cabbage - Grated', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Red cabbages are round and wrapped in purplish red leaf layers with a more peppery and bold flavour compared to green ones. Leaves are coarser as they have less water content.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cabbage,Cauliflour', '', ''),
(458, 1, 'Cabbage - Organically Grown', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Product image shown is for representation purpose only, the actually product may vary based on season, produce &amp;amp; availability.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cabbage,Cauliflour', '', ''),
(459, 1, 'Fresho Cabbage', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;With a texture of crispness and juiciness the moment you take the first bite, cabbages are sweet and grassy flavoured with dense and smooth leafy layers.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Cabbage,Cauliflour', '', ''),
(461, 1, ' Pumpkin - Organically Grown', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Product image shown is for representation purpose only, the actually product may vary based on season, produce &amp;amp; availability.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Pumpkin,Drumsticks', '', ''),
(462, 1, 'Pumpkin Green', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Fresho brings to you cut pumpkin green with creamish to yellow flesh and flat, edible seeds ( pepitas) inside that are tender and mildly sweet.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Pumpkin,Drumsticks', '', ''),
(463, 1, 'Yellow Pumpkin - Avial ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Pumpkin is a gourd-like squash that belongs to the Cucurbita family. Pumpkins are so joyful looking with their intense colors.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Pumpkin,Drumsticks', '', ''),
(464, 1, 'Pomegranate - Organically Grown', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&amp;nbsp;Organic products are organically grown and handpicked by expert.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; font-size: 18px;&quot;&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Product image shown is for representation purpose only, the actually product may vary based on season, produce &amp;amp; availability.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Fruits', '', ''),
(466, 1, 'Sapota - Organically Grown', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Brown skinned sapotas are smooth to grainy textured, musky-scented and deliciously sweet in taste. The flesh generally contains 2-3 large and inedible black seeds.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Fruits', '', ''),
(467, 1, 'Mango Tothapuri - Organically', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;These varieties of Mangoes are grown organically, Naturally ripened through hay.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; font-size: 18px;&quot;&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Product image shown is for representation purpose only, the actually product may vary based on season, produce &amp;amp; availability.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Fruits', '', ''),
(468, 1, ' Mango Neelam - Organically', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;It Is Organically Grown And Neelam mango is known for their beautiful shape, flavor and divine floral fragrance. It is produced in many areas of Pakistan and India. The more famous Pakistani varieties are from the Sindh region, the well-known Indian varieties are from the South of India.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Fruits', '', ''),
(469, 1, ' Papaya - Organically ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Papayas are large and pear shaped with green to butter yellow skin colour when ripe. The flesh is pale orange with numerous small, black, sticky seeds at the center.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Fruits', '', ''),
(470, 1, 'Guava - Organically ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Savour the green guavas along with hard, pale yellow edible seeds. The off-white flesh is crunchy and mildly sweet with very good fragrance. We selectively pick organically grown guavas from the best farms&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Fruits', '', ''),
(471, 1, 'Pineapple - Organically', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;The edible center part is firm, leathery and sweeter. We selectively pick organically grown pineapples from the best farms&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Fruits', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(472, 1, 'Cherry - Red Globe Indian', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Ruby-coloured Fresho red globe grapes are uniquely large, round and good quality grapes. They have a crunchy skin, fleshy pulp and a pinkish tinge in colour.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Seasonal Organic Fruits', '', ''),
(473, 1, ' Baby Orange', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Lovely, bright, reddish, glossy and smooth skinned fruits, these little oranges are a sheer experience. The juiciness and sweetness of the mini oranges are distinctive. These are also simple to peel and section.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;iframe src=&quot;//www.youtube.com/embed/2ILAkWciUnE&quot; width=&quot;640&quot; height=&quot;360&quot; frameborder=&quot;0&quot;&gt;&lt;/iframe&gt;&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'fruits', 'Seasonal Organic Fruits', '', ''),
(474, 1, 'Pear - Naspathi, Indian', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;The mild, sweet taste comes fully with incredible crunch and juiciness, while the peel adds a tanginess to the sweet flesh.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Seasonal Organic Fruits', '', ''),
(475, 1, 'Mango - Raw', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Raw mango is a sweet-smelling fruit which is liked by al for its tart flavor. The colour varies in shades of greens and the inner flesh is white in colour.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Seasonal Organic Fruits', '', ''),
(476, 1, 'Cherry - Bangalore ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Exclusively grown in Chikkaballapur, Bangalore Urban and Kolar districts, these soft skinned Fresho black blue grapes have a foxy flavour and a brisky pungent taste.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Seasonal Organic Fruits', '', ''),
(477, 1, 'Orange - Imported', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;These imported oranges are much bigger in size as compared to the Indian counterpart.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Seasonal Organic Fruits', '', ''),
(478, 1, 'Watermelon - Small', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&amp;nbsp;Flesh colour of these watermelons are pink to red with dark brown/black seeds.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Seasonal Organic Fruits', '', ''),
(479, 1, 'Sweet Lime - Organically ', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Product image shown is for representation purpose only, the actually product may vary based on season, produce &amp;amp; availability.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Fresh Organic Fruits', '', ''),
(480, 1, 'Capsicum - Green', '&lt;p&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Leaving a moderately pungent taste on the tongue, Green capsicums, also known as green peppers are bell shaped, medium-sized fruit pods. They have thick and shiny skin with a fleshy texture inside.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Fresh Vegetables', '', '');
