Important: Payment of the advance fee indicates that the client accepts these terms and conditions, and approves to commence the work.&lt;/p&gt;&lt;p&gt;2. 1 Year Free Technical Support: FATbit provides 1 year free technical support for following kind of issues:&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Server side scripting/programming errors/bugs&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Logical Bugs/Calculation related errors/bugs&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Connection errors/API Integration Errors&lt;/p&gt;&lt;p&gt;Above support is not available if the errors/bugs arise due to any external entity. Examples:&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Server or software or application or extension downgrades or upgrades&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Edits done by any external entity/person/professional in the code/scripts delivered by us.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Operating System or Browser Version Downgrades/Upgrades&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Any other factor which is not directly related to any deficiency at the end of FATbit&lt;/p&gt;&lt;p&gt;3. Photography and graphics: FATbit Technologies may use stock photographs and images while creating the website. Images and graphics purchased from stock libraries are not generally included in the quote and will be invoiced separately. FATbit will keep the client updated about the stock images being used and the cost involved before raising the invoice.&lt;/p&gt;&lt;p&gt;4. Browser compatibility: FATbit Technologies makes every effort to design pages that work flawlessly on most popular current browsers i.e. IE11 and latest version of FireFox/Chrome released on the date of project agreement. We however cannot be held responsible for pages that do not display acceptably in new versions of browsers released after pages have been designed. IE10 and older IE versions are outdated browsers and hence we don’t design with them in mind. We recommend using latest version of Chrome or Firefox instead of older versions of Microsoft Internet Explorer.&lt;/p&gt;&lt;p&gt;5. Search Engine Submission: Following services are not part of the project unless agreed otherwise in writing:&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Submission of websites on different search engines.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Securing good ranking of your website on different search engines.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Search Engine Optimization – On Page/Off Page.&lt;/p&gt;&lt;p&gt;6. Site maintenance: Unless otherwise agreed in writing, following services will be separately billed after the website has been made live:&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Content updates&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Refinements and logical tweaks to the website, which were not planned/approvedby client earlier.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Content presentation and design updates which were not planned/approved by client earlier.&lt;/p&gt;&lt;p&gt;7. Content: After FATbit has delivered the website to client, client is solely responsible for the content/information/images posted on his website. If there is any error or omission by FATbit team while uploading/posting the content/information/images on client’s website, FATbit will correct it if reported to FATbit representatives.&lt;/p&gt;&lt;p&gt;8. Material: All material supplied by the client shall remain client’s property. FATbit rightfully believes that this material belongs to the client and that it does not breach any copyright laws. Under no circumstances shall FATbit be held responsible for any claims, damages, and loss of profit or reputation caused to client due to the use of material provided by the client.&lt;/p&gt;&lt;p&gt;9. Domain names booked by FATbit on behalf of client: FATbit provides domain name consultancy if required. Domain names registered by FATbit on the client’s behalf are property of FATbit until client has paid for the domain booked and any fee involved.&lt;/p&gt;&lt;p&gt;FATbit Technologies agrees to transfer such domains to the client or his/her agent when asked to do so provided that all accounts have been settled.&lt;/p&gt;&lt;p&gt;Note: Domains booked and owned by client are not subject to this term. This term applies only to those domains which are booked by FATbit upon the request of client.&lt;/p&gt;&lt;p&gt;10. Travel Time and Expenses: Travelling time to and from the client premises is not generally included in our estimate. If a visit/travel is required for meeting, the client will bear all the expenses or as agreed by both the parties.&lt;/p&gt;&lt;p&gt;11. 3rd Party Add-ons/services/applications: All third party costs arising from the registration of a domain name/purchase of third party utilities/services shall be met by the Client and are payable to FATbit Technologies before a formal application for registration is made. Examples of 3rd party fees are as under:&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Domain Names&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Server Space Hosting Fees&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;SSL Certificates&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Backup Services&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;3rd Party APIs, if any, required by ‘Client’ to be integrated with the work ordered.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;3rd Party Plugins/Scripts/Applications/Software/Widgets/Services, if any, required by ‘Client’ to be integrated with the work ordered.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Payment Gateways Signup and Recurring Fees&lt;/p&gt;&lt;p&gt;12. Examples of work: Unless negotiated otherwise, FATbit Technologies retains the right to list/display the client name and logo with or without work performed (Design/Development/Online Promotion) for the Client in its respective portfolios and promotion materials. This over-rides all previous agreements and NDAs signed.&lt;/p&gt;&lt;p&gt;13. Quotations: The price quoted to the client is for the work agreed in the proposal document only. Should the client decide that changes are required after the project work has been initiated, then FATbit will provide a separate quote for the additional work and may need to review the timescale for completing the project. Cost estimates and prices quoted are valid for maximum one month unless otherwise agreed.&lt;/p&gt;&lt;p&gt;14. Mode of Payment&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Clients Based Outside India: International Wire Transfers, Credit Card/PayPal via 2Checkout payment gateway.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Clients Based in India: NEFT, RTGS or Physical Cheques mailed to our office address.&lt;/p&gt;&lt;p&gt;15. Payment Terms:&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Payment plan is agreed between the ‘Client’ and FATbit based on the milestones.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Payment shall be due within 14 days of the invoice date unless specifically mentioned in the Invoice.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Full publication of the website/technical work will only take place after full payment has been received in our account unless otherwise agreed in writing.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Any material previously published may be removed if payment is not received. When this occurs, a minimum charge of $100 USD will be charged to have the site restored.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Accounts that have not been settled within 14 days of the date shown on the invoice will incur a late payment charge of $500 USD for delay of each week.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;In case of delay in payments beyond the due date, FATbit reserves the right to stop the work being commenced and ‘Client’ agrees to exempt FATbit from meeting the timelines agreed.&lt;/p&gt;&lt;p&gt;16. Cancellation: Both the parties reserve the right to cancel the project at any stage.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;In case the project is cancelled by Client, the payments made for the project can be refunded to the client after deducting the upfront payment amount received for Initiation of the project and the other payments received against the milestones completed.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;In case the project is cancelled by FATbit, the payments made for the project can be refunded after deducting USD 15 per hour for the hours spent on the work performed for the client including but not limited to the time spent on project discussion, requirements gathering, project planning &amp;amp; documentation, project initiation and execution. After the payments are settled between the two parties – FATbit shall transfer to ‘Client’ - all the documents, designs and scripts produced for the project.&lt;/p&gt;&lt;p&gt;17. Delayed Response From Client Side: Unreasonable delays from client side in providing the required feedback/information/data to finish the project shall exempt FATbit from meeting the timelines mentioned in the quote. In case client does not provide required details/data/information within 15 working days, client agrees that the payments made towards the project will be forfeited and retained by FATbit as full and final settlement against the work completed till date. FATbit shall not be liable to deliver any files to client if client is not traceable or not responsive for 15 working days.&lt;/p&gt;&lt;p&gt;18. Time Estimates: Client agrees that stipulated timelines cannot be met if the project scope is changed by client once the project scope document is finalized. Client agrees not to change the requirements without extending the original agreed timelines by minimum 1 week against each change request.&lt;/p&gt;&lt;p&gt;19. Share in profits from business or sale of business: After client makes the agreed payment for the project, FATbit will not claim share in client’s profits from business or from sale of business to some other company.&lt;/p&gt;&lt;p&gt;20. Copyright/Ownership Rights: FATbit Technologies will retain the copyright of any material, including design, artwork and the source code, created for the client by FATbit Technologies. FATbit Technologies reserves the right to retain the copyright on all material created by FATbit Technologies unless otherwise agreed between the two parties in writing. As per the agreed terms client owns rights on following items:&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Logo/Graphics/Pictures/Images supplied by client – Yes&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Website Interface/PSD/Creatives/Designs – Yes, if client has ordered custom design with Exclusive Rights.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Programming Files/Source Code – Yes, if the Client has ordered the project with Exclusive Rights. Client does not own the copyright/Intellectual property rights for projects being done on Single Domain License basis.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;If the project is being done on Single Domain License basis, Client owns the rights to use the system only on designated domains and Client should take reasonable care of the system files to restrict un-authorized access of the system scripts/source code delivered.&lt;/p&gt;&lt;p&gt;21. Ownership of Code and Intellectual Property Rights: Unless otherwise agreed, FATbit is the owner of the source code and the intellectual property rights and reserves the right to reuse the code for other projects.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;(Terms 22nd to 25th are only applicable in case of Single Domain Non Exclusive License)&lt;/span&gt;&lt;/p&gt;&lt;p&gt;22. Single Domain License: Unless otherwise agreed, client agrees to setup the scripts delivered only on one domain, one sub-domain (wip.yourdomain.com) and localhost. However if client wish to run same website on different domain/sub-domain, then client has to purchase separate license for each domain/sub-domain.&lt;/p&gt;&lt;p&gt;No license would be required for Add-on Domains that will point to the main domain where this system will be implemented. All add-on domains will be forwarded to the main domain from the hosting server and no additional license would be required for these domains.&lt;/p&gt;&lt;p&gt;For every new domain or sub-domain , client has to buy a separate license.&lt;/p&gt;&lt;p&gt;23. License Validity Period: License comes without expiry date as long as it is for single domain. (Only for FATbit Products)&lt;/p&gt;&lt;p&gt;24. No recurring costs of license: There is no renewal/recurring license fee. However, if client wishes to run same website on different domain or sub domain, then client has to purchase separate license for each domain or sub domain.&lt;/p&gt;&lt;p&gt;25. Use of encrypted files: Unless otherwise agreed, FATbit can use own framework (code library in encrypted format) for web applications development for making source code of our intellectual property/scripts secure from other programmers; faster turnaround time; and bug free application development. Client will be provided with detailed documentation for using framework (code library functions). With the help of documentation provided, other programmers can modify the website functionality. FATbit framework is collection of functions related to Database Manipulation, Images/Files Management, Paging, and Form Builder etc. which looks like PHP Functions but have different syntax than default PHP functions. Other willing and efficient PHP programmers can learn and practice these functions/framework within 2-4 days.&lt;/p&gt;&lt;p&gt;Note : In no event, FATbit Technologies shall be liable to the client or any third party for any damages, including any lost profits, lost savings or other incidental, consequential or special damages arising out of the operation of or inability to operate these Web pages or website, even if FATbit Technologies has been advised of the possibility of such damages. Despite the best efforts of FATbit Technologies, errors in web page information may occur. At no time will FATbit Technologies be held responsible for accidentally including erroneous information, extending beyond correcting the error.&lt;/p&gt;&lt;p&gt;Should FATbit Technologies waive any of these terms on an individual basis, this shall not affect the validity of remaining clauses or commit FATbit Technologies to waive the same clause on any other occasion.&lt;/p&gt;&lt;p&gt;By agreeing to these terms and conditions, your statutory rights are not affected.&lt;/p&gt;&lt;p&gt;FATbit Technologies reserves the right to change or modify any of these terms or conditions at any time, but agreements signed prior to the updates in this agreement remains unaffected. Please feel free to contact us for more info/clarification about any of the terms and conditions mentioned above.&lt;/p&gt;', 'Terms &amp; Conditions', '', ''),
(6, 4, 'Delivery Information', '&lt;p&gt;\r\n	Delivery Information&lt;/p&gt;\r\n', '', '', ''),
(4, 4, 'About Us', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Company Overview&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;FATbit is a team of website designers, developers and marketers helping businesses &amp;amp; online investors realize the true power of web. As a professional web design company, we have successfully completed more than 2000 web projects across the map, and are determined to make web design &amp;amp; development services affordable for all.&amp;gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;11 years of industry experience and exemplary work has earned us the title of \'best website design company India\' from our global clients. We are not just exceptionally good with our designs but also work dedicatedly towards empowering businesses and organizations on web. Backed by values like futuristic thinking, personalized attention, result oriented innovation, exceeding client expectation, and competitive pricing, we are indeed a rapidly growing spearhead of the entire ball game. Our best web designers and programmers will walk miles with you to take your business to the next level and make success your mandatory trait, while assuring you an entire year\'s technical support for FREE.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Affordable Web Design Solutions&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;We design to impress&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;We research, plan, and design custom websites that are rich in user experience.&lt;/p&gt;&lt;p style=&quot;line-