(3, 4, 'Privacy Policy', '&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Privacy Policy&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;What information do we collect?&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;We collect information from you when you fill out a form. When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address, phone number or credit card information. You may, however, visit our site anonymously.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;What do we use your information for?&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Any of the information we collect from you may be used in one of the following ways:&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To personalize your experience&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;(your information helps us to better respond to your individual needs)&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To improve our website&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;(we continually strive to improve our website offerings based on the information and feedback we receive from you)&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To improve customer service&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;(your information helps us to more effectively respond to your customer service requests and support needs)&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;:To process transactions&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Your information, whether public or private, 