ur site visitors. These service providers are not permitted to use the information collected on our behalf except to help us conduct and improve our business.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&lt;span style=&quot;font-weight: bold; line-height: 1.42857;&quot;&gt;Do we disclose any information to outside parties?&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;California Online Privacy Protection Act Compliance&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Because we value your privacy we have taken the necessary precautions to be in compliance with the California Online Privacy Protection Act. We therefore will not distribute your personal information to outside parties without your consent.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Childrens Online Privacy Protection Act Co