ne-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Payment Gateways Signup and Recurring Fees&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;12. Examples of work: Unless negotiated otherwise, FATbit Technologies retains the right to list/display the client name and logo with or without work performed (Design/Development/Online Promotion) for the Client in its respective portfolios and promotion materials. This over-rides all previous agreements and NDAs signed.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;13. Quotations: The price quoted to the client is for the work agreed in the proposal document only. Should the client decide that changes are required after the project work has been initiated, then FATbit will provide a separate quote for the additional work and may need to review the timescale for completing the project. Cost estimates and prices quoted are valid for maximum one month unless otherwise agreed.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;14. Mode of Payment&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Clients Based Outside India: International Wire Transfers, Credit Card/PayPal via 2Checkout payment gateway.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Clients Based in India: NEFT, RTGS or Physical Cheques mailed to our office address.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;15. Payment Terms:&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Payment plan is agreed between the ‘Client’ and FATbit based on the milestones.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Payment shall be due within 14 days of the invoice date unless specifically mentioned in the Invoice.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Full publication of the website/technical work will only take place after full payment has been received in our account unless otherwise agreed in writing.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Any material previously published may be removed if payment is not received. When this occurs, a minimum charge of $100 USD will be charged to have the site restored.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;Accounts that have not been settled within 14 days of the date shown on the invoice will incur a late payment charge of $500 USD for delay of each week.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;In case of delay in payments beyond the due date, FATbit reserves the right to stop the work being commenced and ‘Client’ agrees to exempt FATbit from meeting the timelines agreed.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;16. Cancellation: Both the parties reserve the right to cancel the project at any stage.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;In case the project is cancelled by Client, the payments made for the project can be refunded to the client after deducting the upfront payment amount received for Initiation of the project and the other payments received against the milestones completed.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp; • &amp;nbsp; &amp;nbsp;In case the project is cancelled by FATbit, the payments made for the project can be refunded after deducting USD 15 per hour for the hours spent on the work performed for the client including but not limited to the time spent on project discussion, requirements gathering, project planning &amp;amp; documentation, project initiation and execution. After the payments are settled between the two parties – FATbit shall transfer to ‘Client’ - all the documents, designs and scripts produced for the project.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;17. Delayed Response From Client Side: Unreasonable delays from client side in providing the required feedback/information/data to finish the project shall exempt FATbit from meeting the timelines mentioned in the quote. In case client does not provide required details/data/information within 15 working days, client agrees that the payments made towards the project will be forfeited and retained by FATbit as full and final settlement against the work completed till date. FATbit shall not be liable to deliver any files to client if client is not traceable or not responsive for 15 working days.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;18. Time Estimates: Client agrees that stipulated timelines cannot be met if the project scope is changed by client once the project scope document is finalized. Client agrees not to change the requirements without extending the original agreed timelines by minimum 1 week against each change request.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;19. Share in profits from business or sale of business: After client makes the agreed payment for the project, FATbit will not claim share in client’s profits from business or from sale of business to some other company.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;20. Copyright/Ownership Rights: FATbit Technologies will retain the copyright of any material, including design, artwork and the source code, created for the client by FATbit Technologies. FATbit Technologies reserves the right to retain the copyright on all material created by FATbit Technologies unless otherwise agreed between the two parties in writing. As per the agreed terms client owns rights on following items:&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;&amp;nbsp; &amp;nbsp