ain domain where this system will be implemented. All add-on domains will be forwarded to the main domain from the hosting server and no additional license would be required for these domains.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;For every new domain or sub-domain , client has to buy a separate license.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;23. License Validity Period: License comes without expiry date as long as it is for single domain. (Only for FATbit Products)&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;24. No recurring costs of license: There is no renewal/recurring license fee. However, if client wishes to run same website on different domain or sub domain, then client has to purchase separate license for each domain or sub domain.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;25. Use of encrypted files: Unless otherwise agreed, FATbit can use own framework (code library in encrypted format) for web applications development for making source code of our intellectual property/scripts secure from other programmers; faster turnaround time; and bug free application development. Client will be provided with detailed documentation for using framework (code library functions). With the help of documentation provided, other programmers can modify the website functionality. FATbit framework is collection of functions related to Database Manipulation, Images/Files Management, Paging, and Form Builder etc. which looks like PHP Functions but have different syntax than default PHP functions. Other willing and efficient PHP programmers can learn and practice these functions/framework within 2-4 days.&lt;/p&gt;&lt;p style=&quot;line-height: 17.1428px;&quot;&gt;Note : In no event, FATbit Technologies shall be liable to the client or any third party for any damages, including any lost profits, lost savings or other incidental, consequential or special damages arising out of the operation of or inability